(34, 'craulier', '$2y$10$jfrDFsud4KB83RPdXJuuXeuA3fWSpJnUO9ZnRW1BUOaEbJnVlBHJW', 'dU+UGzCoe4cY3WRHcCInfMDlL6FOW9biEOcowQHQJDA=', 'RAULIER', 'Céline', 'celine.raulier@homegrade.brussels', NULL, NULL, NULL, 1, 1, 'CRM', NULL, NULL, NULL, 'AQMkADMyYWU5MzcwLWZiNjItNGU3NS05ZjM2LWE5ZDNjZjIwOWYxOAAuAAADG7UHTW-Mbk6ats64FkKxrgEAVU8ERDC09kKwLC6sYFaaZAACbkiPYgAAAA==', '40bf0999-d445-ead9-b21a-57aeebc62bfc', 1000, 1, NULL, 1, 'Bonjour, \r\n\r\nJe serai absente du 20 /07/2023  jusqu\'au 20 Aout 2023.\r\n\r\nPour obtenir une réponse rapide, je vous invite à adresser votre demande à l\'adresse générale info@homegrade.brussels  ou via le formulaire de contact  https://homegrade.brussels/homegrade/contact/\r\n ,en précisant que  vous étiez en contact avec moi précédemment.\r\nEn cas de demande \"urgente\", vous pouvez contacter notre permanence téléphonique au 1810   ou venir à notre guichet d\'information sans RDV,  selon les horaires d\'ouvertures  : https://homegrade.brussels/homegrade/contact/\r\n\r\n\r\nCordialement ,\r\n\r\n Céline Raulier\r\n\r\nGoeiedag, \r\n\r\nIk zal afwezig zijn van 20/07/2023 tot 20/08/2023.\r\n\r\nIndien u een antwoord wenst, gelieve uw vraag te richten aan het algemene adres info@homegrade.brussels of via het contactformulier https://homegrade.brussels/homegrade/contact/\r\n, met de vermelding dat u eerder contact had met mij.\r\n\r\nIn geval van een \"dringende\" vraag kunt u contact opnemen met onze telefonische infolijn op 1810 , of kom zonder afspraak naar ons infoloket tijdens de openingsuren van het loket: https://homegrade.brussels/homegrade/contact/\r\n\r\n\r\nMet vriendelijke groet,\r\n\r\n Céline Raulier', '2023-07-18', '2023-08-21', 0, NULL, 'default.png', NULL, NULL),
