(143, 'fnogaret', '$2y$10$nhasPhGRyjH4MXmwkJqC7uKTvmgHp80MQWVqU8ZNkjAmro9j3zjRK', 'KOjjIsjJUbu9e3YLfojvXA==', 'NOGARET', 'Fabienne', 'fabienne.nogaret@homegrade.brussels', NULL, NULL, 1, 1, 1, 'CRM', NULL, NULL, 1, 'AAMkADM3MDcyYTYxLWU2MTAtNDExNy04ZDc1LWNlN2U2OTJjYzcwMgAuAAAAAACNNB5vF8KIQ4nkmC_LdVMXAQAHENlii533SYTl7MeXw8IpAAAAAH7kAAA=', '', 1000, 1, NULL, 1, 'Bonjour,\r\n\r\nJe suis actuellement en arrêt maladie. \r\nPour toute question urgente, veuillez remplir le formulaire de contact ou appeler le 1810 en précisant le numéro de votre demande afin de ne pas créer de doublons.\r\n\r\nCordialement,\r\n\r\nAnaïs Pereira\r\nHomegrade\r\nPlace Quetelet / Queteletplein 7 - 1210 Bruxelles / Brussel\r\nTel 1810\r\nwww.homegrade.brussels', '2023-07-27', '2023-10-01', 45, NULL, 'default.png', NULL, NULL),
(144, 'mvanhaeperen', '$2y$10$A5OV36/8IYFuFefNoccaLOr8.mDj74E00I4Qb.wB6Z3HLxG/2F7Bi', 'Uripkwk62tb0Mkkx8BiEKA==', 'VAN HAEPEREN', 'Marie-Zoe', 'mariezoe.vanhaeperen@homegrade.brussels', NULL, NULL, 1, 1, 1, 'CRM', NULL, NULL, 1, 'AQMkADgyOTA5YmFjLWVjOGYtNGQ3Zi04MGUyLWUxZDFhODYwOWE3NQAuAAADX3FrqZ0iCE_XUnMk4Od0jAEAFKYTh5dNPEuyzxU4nDpnrgAAAm8_AAAA', '', 1000, 1, NULL, 1, 'Bonjour,\r\n\r\nJe suis absente du vendredi 28 juillet 2023 jusqu\'au mardi 15 août 2023 inclus.\r\nJe vous répondrai à mon retour.\r\n\r\nPour toute question, n\'hésitez pas à compléter notre formulaire de contact :\r\nhttps://homegrade.brussels/homegrade/contact/\r\n\r\nCordialement,\r\n\r\nGoeiedag,\r\n\r\nIk ben afwezig vanaf vrijdag 28 juli t.e.m. dinsdag 15 augustus 2023.\r\nIk zal u antwoorden wanneer ik terug ben.\r\n\r\nVoor alle vragen,vul dan ons contactformulier in https://homegrade.brussels/homegrade/contact/\r\n\r\nVriendelijke groeten,', '2023-07-28', '2023-08-15', 0, NULL, 'default.png', NULL, NULL),
