(97, 'SELECT demande.id_demande as id_demande_id, demande.date as date_demande, joinliste_id_demande_statut.label as id_demande_statut , CONCAT (joinliste_utilisateur_createur.nom,\' \',joinliste_utilisateur_createur.prenom) as utilisateur_createur , CONCAT (joinliste_utilisateur_demande.nom,\' \',joinliste_utilisateur_demande.prenom) as utilisateur_demande , CONCAT (joinliste_utilisateur_demande_2.nom,\' \',joinliste_utilisateur_demande_2.prenom) as utilisateur_demande_2 , demande.nom as nom_demande, joinliste_demande_moyen_contact.label as demande_moyen_contact , joinliste_id_type_demande.label as id_type_demande , ( SELECT GROUP_CONCAT( liste_th_visite.label)  FROM liste_th_visite WHERE  FIND_IN_SET (liste_th_visite.id,demande_caracteristique.id_visite)) as demande_id_visite, joinliste_demande_id_thematique_principal.label as demande_id_thematique_principal , ( SELECT GROUP_CONCAT( liste_thematique.label)  FROM liste_thematique WHERE  FIND_IN_SET (liste_thematique.id,demande_caracteristique.id_thematique_secondaire)) as demande_id_thematique_secondaire, bien.adresse_fr as adresse_fr_bien, bien.adresse_nl as adresse_nl_bien, CONCAT (joinliste_adresse_fr_cp.cp,\' \',joinliste_adresse_fr_cp.localite_fr,\' \',joinliste_adresse_fr_cp.localite_nl_select) as adresse_fr_cp , bien.bt as adresse_bt, CONCAT (joinliste_utilisateur_createur_bien.nom,\' \',joinliste_utilisateur_createur_bien.prenom) as utilisateur_createur_bien , joinliste_id_type_bien_coche.label as id_type_bien_coche , bien.etage_logement as etage_logement_bien, joinliste_id_nombre_bien.label as id_nombre_bien  FROM bien LEFT JOIN personne_bien ON personne_bien.id_bien=bien.id_bien LEFT JOIN bien_caracteristique ON bien_caracteristique.id_bien=personne_bien.id_bien  LEFT JOIN demande ON demande.id_demande=personne_bien.id_demande  LEFT JOIN demande_caracteristique ON demande_caracteristique.id_demande=personne_bien.id_demande  LEFT JOIN liste_demande_statut as joinliste_id_demande_statut ON  joinliste_id_demande_statut.id=demande.id_demande_statut  LEFT JOIN users as joinliste_utilisateur_createur ON  joinliste_utilisateur_createur.id_user=demande.id_user_create  LEFT JOIN users as joinliste_utilisateur_demande ON  joinliste_utilisateur_demande.id_user=demande.id_utilisateur  LEFT JOIN users as joinliste_utilisateur_demande_2 ON  joinliste_utilisateur_demande_2.id_user=demande.id_utilisateur_2  LEFT JOIN liste_moyen_contact as joinliste_demande_moyen_contact ON  joinliste_demande_moyen_contact.id=demande.moyen_contact  LEFT JOIN liste_demande_type as joinliste_id_type_demande ON  joinliste_id_type_demande.id=demande.id_type_demande  LEFT JOIN liste_th_visite as joinliste_demande_id_visite ON  joinliste_demande_id_visite.id=demande_caracteristique.id_visite  LEFT JOIN liste_thematique as joinliste_demande_id_thematique_principal ON  joinliste_demande_id_thematique_principal.id=demande_caracteristique.id_thematique_principal  LEFT JOIN liste_thematique as joinliste_demande_id_thematique_secondaire ON  joinliste_demande_id_thematique_secondaire.id=demande_caracteristique.id_thematique_secondaire  LEFT JOIN liste_cp_brugis as joinliste_adresse_fr_cp ON  joinliste_adresse_fr_cp.cp=bien.adresse_fr_cp  LEFT JOIN users as joinliste_utilisateur_createur_bien ON  joinliste_utilisateur_createur_bien.id_user=bien.id_user_create  LEFT JOIN liste_bien_type as joinliste_id_type_bien_coche ON  joinliste_id_type_bien_coche.id=bien.id_type  LEFT JOIN liste_bien_nombre_logement as joinliste_id_nombre_bien ON  joinliste_id_nombre_bien.label=bien.id_nombre_logement  WHERE ((bien.adresse_fr IS NOT NULL AND bien.adresse_fr!=\'\') )  AND  (  YEAR(bien.date_insert)=2019 ) ', 'id_demande_id,date_demande,id_demande_statut,utilisateur_createur,utilisateur_demande,utilisateur_demande_2,nom_demande,demande_moyen_contact,id_type_demande,demande_id_visite,demande_id_thematique_principal,demande_id_thematique_secondaire,adresse_fr_bien,adresse_nl_bien,adresse_fr_cp,adresse_bt,utilisateur_createur_bien