(132, 'SELECT demande.id_demande as id_demande_id, demande.date as date_demande, joinliste_id_demande_statut.label as id_demande_statut , CONCAT (joinliste_utilisateur_demande.nom,\' \',joinliste_utilisateur_demande.prenom) as utilisateur_demande , demande.nom as nom_demande, (SELECT content from fh_messagerie WHERE fh_messagerie.entity=\'demande\' AND fh_messagerie.id_entity=demande.id_demande ORDER BY fh_messagerie.date_created DESC LIMIT 1) as note_interne, joinliste_id_type_demande.label as id_type_demande , joinliste_demande_id_type_accompagnement.label as demande_id_type_accompagnement , joinliste_type_rdv.label as type_rdv , rdv.titre as titre_rdv, joinliste_statut_rdv.label as statut_rdv , rdv.date_rdv_debut as date_rdv_debut, joinliste_type_tache.label as type_tache , tache.sujet as sujet_tache, joinliste_statut_tache.label as statut_tache , tache.date_tache as date_tache FROM tache LEFT JOIN demande_tache ON demande_tache.id_tache=tache.id_tache  LEFT JOIN demande ON demande_tache.id_demande=demande.id_demande  LEFT JOIN demande_caracteristique ON demande_caracteristique.id_demande=demande.id_demande  LEFT JOIN encodage ON encodage.id_encodage=demande.id_encodage  LEFT JOIN personne_bien ON personne_bien.id_demande=demande.id_demande  LEFT JOIN personne ON personne.id_personne=personne_bien.id_personne  LEFT JOIN bien ON bien.id_bien=personne_bien.id_bien LEFT JOIN bien_caracteristique ON bien_caracteristique.id_bien=bien.id_bien   LEFT JOIN demande_rdv ON demande_rdv.id_rdv=demande.id_demande LEFT JOIN rdv ON rdv.id_rdv=demande_rdv.id_rdv   LEFT JOIN liste_demande_statut as joinliste_id_demande_statut ON  joinliste_id_demande_statut.id=demande.id_demande_statut  LEFT JOIN users as joinliste_utilisateur_demande ON  joinliste_utilisateur_demande.id_user=demande.id_utilisateur  LEFT JOIN liste_demande_type as joinliste_id_type_demande ON  joinliste_id_type_demande.id=demande.id_type_demande  LEFT JOIN liste_type_accompagnement as joinliste_demande_id_type_accompagnement ON  joinliste_demande_id_type_accompagnement.id=demande_caracteristique.id_type_accompagnement  LEFT JOIN liste_rdv_type as joinliste_type_rdv ON  joinliste_type_rdv.id=rdv.id_type_rdv  LEFT JOIN liste_rdv_statut as joinliste_statut_rdv ON  joinliste_statut_rdv.id=rdv.id_statut_rdv  LEFT JOIN liste_tache_type as joinliste_type_tache ON  joinliste_type_tache.id=tache.id_type_tache  LEFT JOIN liste_tache_statut as joinliste_statut_tache ON  joinliste_statut_tache.id=tache.id_statut_tache  WHERE (tache.date_tache>\'2020-03-16\' )  AND  (  YEAR(tache.date_tache)=2019 OR  YEAR(tache.date_tache)=2020 ) ', 'id_demande_id,date_demande,id_demande_statut,utilisateur_demande,nom_demande,note_interne,id_type_demande,demande_id_type_accompagnement,type_rdv,titre_rdv,statut_rdv,date_rdv_debut,type_tache,sujet_tache,statut_tache,date_tache', '@@array[ou_et]=0@@array[entity]=tache@@array[champ]=date_tache@@array[operateur]=superieur@@array[choice]=16/03/2020@@array[par_ouvert]=0@@array[par_ferme]=0', 'ou_et_%23%231=0&entity_%23%231=tache&champ_%23%231=date_tache&operateur_%23%231=superieur&%23%231%23%23_value=16%2F03%2F2020&par_ouvert_%23%231=0&par_ferme_%23%231=0&number=1&fields_select%5B%5D=nom_personne&id_demande_id&fields_select[]=date_demande&fields_select[]=id_demande_statut&fields_select[]=utilisateur_demande&fields_select[]=nom_demande&fields_select[]=note_interne&fields_select[]=id_type_demande&fields_select[]=demande_id_type_accompagnement&fields_select[]=type_rdv&fields_select[]=titre_rdv&fields_select[]=statut_rdv&fields_select[]=date_rdv_debut&fields_select[]=type_tache&fields_select[]=sujet_tache&fields_select[]=statut_tache&fields_select[]=date_tache', 23, '2020-03-27 14:43:28', 0, 'tâches confinement', 2019, 2020, NULL, NULL),
