(134, 'SELECT demande.id_demande as id_demande_id, demande.date as date_demande, joinliste_id_demande_statut.label as id_demande_statut , CONCAT (joinliste_utilisateur_demande.nom,\' \',joinliste_utilisateur_demande.prenom) as utilisateur_demande , demande.nom as nom_demande, joinliste_demande_moyen_contact.label as demande_moyen_contact , ( SELECT GROUP_CONCAT( liste_thematique.label)  FROM liste_thematique WHERE  FIND_IN_SET (liste_thematique.id,demande_caracteristique.id_thematique_secondaire)) as demande_id_thematique_secondaire, ( SELECT GROUP_CONCAT( liste_permis.label)  FROM liste_permis WHERE  FIND_IN_SET (liste_permis.id,demande_caracteristique.id_objet_permis)) as demande_id_objet_permis, ( SELECT GROUP_CONCAT( liste_permis_raison.label)  FROM liste_permis_raison WHERE  FIND_IN_SET (liste_permis_raison.id,demande_caracteristique.id_raison_permis)) as demande_id_raison_permis, ( SELECT GROUP_CONCAT( liste_th_accompagnement.label)  FROM liste_th_accompagnement WHERE  FIND_IN_SET (liste_th_accompagnement.id,demande_caracteristique.id_th_accompagnement)) as demande_id_accompagnement FROM demande LEFT JOIN personne_bien ON personne_bien.id_demande=demande.id_demande LEFT JOIN encodage ON encodage.id_encodage=demande.id_encodage   LEFT JOIN demande_caracteristique ON demande_caracteristique.id_demande=demande.id_demande  LEFT JOIN liste_demande_statut as joinliste_id_demande_statut ON  joinliste_id_demande_statut.id=demande.id_demande_statut  LEFT JOIN users as joinliste_utilisateur_demande ON  joinliste_utilisateur_demande.id_user=demande.id_utilisateur  LEFT JOIN liste_moyen_contact as joinliste_demande_moyen_contact ON  joinliste_demande_moyen_contact.id=demande.moyen_contact  LEFT JOIN liste_thematique as joinliste_demande_id_thematique_secondaire ON  joinliste_demande_id_thematique_secondaire.id=demande_caracteristique.id_thematique_secondaire  LEFT JOIN liste_permis as joinliste_demande_id_objet_permis ON  joinliste_demande_id_objet_permis.id=demande_caracteristique.id_objet_permis  LEFT JOIN liste_permis_raison as joinliste_demande_id_raison_permis ON  joinliste_demande_id_raison_permis.id=demande_caracteristique.id_raison_permis  LEFT JOIN liste_th_accompagnement as joinliste_demande_id_accompagnement ON  joinliste_demande_id_accompagnement.id=demande_caracteristique.id_th_accompagnement  WHERE (demande.date>\'2020-01-01\' AND demande.date<\'2021-01-01\' AND ( demande_caracteristique.id_type_accompagnement  LIKE  \'2\') )  AND  (  YEAR(demande.date)=2020 ) ', 'id_demande_id,date_demande,id_demande_statut,utilisateur_demande,nom_demande,demande_moyen_contact,demande_id_thematique_secondaire,demande_id_objet_permis,demande_id_raison_permis,demande_id_accompagnement', '@@array[ou_et]=0@@array[entity]=demande@@array[champ]=date_demande@@array[operateur]=superieur@@array[choice]=01/01/2020@@array[par_ouvert]=0@@array[par_ferme]=0@@begin@@array[ou_et]=AND@@array[entity]=demande@@array[champ]=date_demande@@array[operateur]=inferieur@@array[choice]=01/01/2021@@array[par_ouvert]=0@@array[par_ferme]=0@@begin@@array[ou_et]=AND@@array[entity]=demande_detail@@array[champ]=demande_id_type_accompagnement@@array[operateur]=egal@@array[choice_is_array]=2@@array[par_ouvert]=0@@array[par_ferme]=0', 'ou_et_%23%231=0&entity_%23%231=demande&champ_%23%231=date_demande&operateur_%23%231=superieur&%23%231%23%23_value=01%2F01%2F2020&par_ouvert_%23%231=0&par_ferme_%23%231=0&ou_et_%23%232=AND&entity_%23%232=demande&champ_%23%232=date_demande&operateur_%23%232=inferieur&%23%232%23%23_value=01%2F01%2F2021&par_ouvert_%23%232=0&par_ferme_%23%232=0&ou_et_%23%233=AND&entity_%23%233=demande_caracteristique&champ_%23%233=demande_id_type_accompagnement&operateur_%23%233=egal&%23%233%23%23_value%5B%5D=2&par_ouvert_%23%233=0&par_ferme_%23%233=0&number=3&fields_select%5B%5D=nom_personne&id_demande_id&fields_select[]=date_demande&fields_select[]=id_demande_statut&fields_select[]=utilisateur_demande&fields_select[]=nom_demande&fields_select[]=demande_moyen