eur_createur ON  joinliste_utilisateur_createur.id_user=demande.id_user_create  LEFT JOIN users as joinliste_utilisateur_demande ON  joinliste_utilisateur_demande.id_user=demande.id_utilisateur  LEFT JOIN users as joinliste_utilisateur_demande_2 ON  joinliste_utilisateur_demande_2.id_user=demande.id_utilisateur_2  LEFT JOIN liste_demande_type as joinliste_id_type_demande ON  joinliste_id_type_demande.id=demande.id_type_demande  LEFT JOIN liste_th_visite as joinliste_demande_id_visite ON  joinliste_demande_id_visite.id=demande_caracteristique.id_visite  LEFT JOIN liste_type_accompagnement as joinliste_demande_id_type_accompagnement ON  joinliste_demande_id_type_accompagnement.id=demande_caracteristique.id_type_accompagnement  LEFT JOIN liste_thematique as joinliste_demande_id_thematique_principal ON  joinliste_demande_id_thematique_principal.id=demande_caracteristique.id_thematique_principal  LEFT JOIN liste_thematique as joinliste_demande_id_thematique_secondaire ON  joinliste_demande_id_thematique_secondaire.id=demande_caracteristique.id_thematique_secondaire  LEFT JOIN liste_th_acoustique as joinliste_demande_id_th_acoustique ON  joinliste_demande_id_th_acoustique.id=demande_caracteristique.id_th_acoustique  LEFT JOIN liste_rel_personne_bien as joinliste_rel_personne_bien ON  joinliste_rel_personne_bien.id=personne_bien.rel_personne_bien  LEFT JOIN liste_cp_brugis as joinliste_adresse_fr_cp ON  joinliste_adresse_fr_cp.cp=bien.adresse_fr_cp  LEFT JOIN liste_bien_type as joinliste_id_type_bien_coche ON  joinliste_id_type_bien_coche.id=bien.id_type  WHERE (demande.date>\'2020-01-01\' AND (( demande_caracteristique.id_thematique_principal  LIKE  \'1\') OR ( demande_caracteristique.id_thematique_secondaire  LIKE  \'1\' OR  demande_caracteristique.id_thematique_secondaire  LIKE  \'1,%\'  OR  demande_caracteristique.id_thematique_secondaire  LIKE  \'%,1\')) )  AND  (  YEAR(demande.date)=2019 OR  YEAR(demande.date)=2020 ) ', 'id_demande_id,date_demande,id_demande_statut,u