(163, 'SELECT demande.id_demande as id_demande_id, demande.date as date_demande, joinliste_id_type_demande.label as id_type_demande , joinliste_demande_id_type_accompagnement.label as demande_id_type_accompagnement , joinliste_id_demande_statut.label as id_demande_statut , CONCAT (joinliste_utilisateur_demande.nom,\' \',joinliste_utilisateur_demande.prenom) as utilisateur_demande  FROM demande LEFT JOIN personne_bien ON personne_bien.id_demande=demande.id_demande LEFT JOIN encodage ON encodage.id_encodage=demande.id_encodage   LEFT JOIN demande_caracteristique ON demande_caracteristique.id_demande=demande.id_demande  LEFT JOIN liste_demande_type as joinliste_id_type_demande ON  joinliste_id_type_demande.id=demande.id_type_demande  LEFT JOIN liste_type_accompagnement as joinliste_demande_id_type_accompagnement ON  joinliste_demande_id_type_accompagnement.id=demande_caracteristique.id_type_accompagnement  LEFT JOIN liste_demande_statut as joinliste_id_demande_statut ON  joinliste_id_demande_statut.id=demande.id_demande_statut  LEFT JOIN users as joinliste_utilisateur_demande ON  joinliste_utilisateur_demande.id_user=demande.id_utilisateur  WHERE (( demande.id_utilisateur  LIKE  \'2\') OR ( demande.id_user_create  LIKE  \'2\') )  AND  (  YEAR(demande.date)=2020 OR  YEAR(demande.date)=2019 ) ', 'id_demande_id,date_demande,id_type_demande,demande_id_type_accompagnement,id_demande_statut,utilisateur_demande', '@@array[ou_et]=0@@array[entity]=demande@@array[champ]=utilisateur_demande@@array[operateur]=egal@@array[choice_is_array]=2@@array[par_ouvert]=0@@array[par_ferme]=0@@begin@@array[ou_et]=OR@@array[entity]=demande@@array[champ]=utilisateur_createur@@array[operateur]=egal@@array[choice_is_array]=2@@array[par_ouvert]=0@@array[par_ferme]=0', 'ou_et_%23%231=0&entity_%23%231=demande&champ_%23%231=utilisateur_demande&operateur_%23%231=egal&%23%231%23%23_value%5B%5D=2&par_ouvert_%23%231=0&par_ferme_%23%231=0&ou_et_%23%232=OR&entity_%23%232=demande&champ_%23%232=utilisateur_cr