(165, 'SELECT ( SELECT GROUP_CONCAT( CONCAT ( users.nom,\' \',users.prenom))  as label_affiche  FROM users WHERE  FIND_IN_SET (users.id_user,rdv.id_user_rdv)) as user_rdv_multi, COUNT(DISTINCT rdv.id_rdv) as count_rdv FROM rdv LEFT JOIN demande_rdv ON demande_rdv.id_rdv=rdv.id_rdv   LEFT JOIN demande ON demande_rdv.id_demande=demande.id_demande  LEFT JOIN demande_caracteristique ON demande_caracteristique.id_demande=demande.id_demande  LEFT JOIN encodage ON encodage.id_encodage=demande.id_encodage   LEFT JOIN personne_bien ON personne_bien.id_demande=demande.id_demande  LEFT JOIN personne ON personne.id_personne=personne_bien.id_personne  LEFT JOIN bien ON bien.id_bien=personne_bien.id_bien LEFT JOIN bien_caracteristique ON bien_caracteristique.id_bien=bien.id_bien    LEFT JOIN users as joinliste_user_rdv_multi ON  joinliste_user_rdv_multi.id_user=rdv.id_user_rdv  WHERE (( rdv.id_type_rdv  LIKE  \'1\' OR  rdv.id_type_rdv  LIKE  \'8\') AND ( rdv.id_statut_rdv  LIKE  \'3\') AND ( demande.id_type_demande  LIKE  \'2\') AND rdv.date_rdv_debut>\'2020-12-31\' AND rdv.date_rdv_debut<\'2022-01-01\' )  AND  (  YEAR(rdv.date_insert)=2020 OR  YEAR(rdv.date_insert)=2021 )  GROUP BY rdv.id_user_rdv ', 'user_rdv_multi,count_rdv', '@@array[ou_et]=0@@array[entity]=rdv@@array[champ]=type_rdv@@array[operateur]=egal@@array[choice_is_array]=1,8@@array[par_ouvert]=0@@array[par_ferme]=0@@begin@@array[ou_et]=AND@@array[entity]=rdv@@array[champ]=statut_rdv@@array[operateur]=egal@@array[choice_is_array]=3@@array[par_ouvert]=0@@array[par_ferme]=0@@begin@@array[ou_et]=AND@@array[entity]=demande_detail@@array[champ]=id_type_demande@@array[operateur]=egal@@array[choice_is_array]=2@@array[par_ouvert]=0@@array[par_ferme]=0@@begin@@array[ou_et]=AND@@array[entity]=rdv@@array[champ]=date_rdv_debut@@array[operateur]=superieur@@array[choice]=31/12/2020@@array[par_ouvert]=0@@array[par_ferme]=0@@begin@@array[ou_et]=AND@@array[entity]=rdv@@array[champ]=date_rdv_debut@@array[operateur]=inferieur@@array[cho