(167, 'SELECT personne.id_personne as id_personne, joinliste_is_professionel_pro.label as is_professionel_pro , personne.nom as nom_personne, demande.id_demande as id_demande_id, bien.adresse_fr as adresse_fr_bien, bien.adresse_nl as adresse_nl_bien FROM personne LEFT JOIN personne_bien ON personne_bien.id_personne=personne.id_personne    LEFT JOIN demande ON demande.id_demande=personne_bien.id_demande   LEFT JOIN bien ON bien.id_bien=personne_bien.id_bien LEFT JOIN bien_caracteristique ON bien_caracteristique.id_bien=personne_bien.id_bien   LEFT JOIN liste_oui_non as joinliste_is_professionel_pro ON  joinliste_is_professionel_pro.id=personne.is_professionel  WHERE ((personne.email IS NULL OR personne.email=\'\') AND (demande.id_demande IS NULL OR demande.id_demande=\'\') )  AND  (  YEAR(personne.date_insert)=2013 OR  YEAR(personne.date_insert)=2014 ) ', 'id_personne,is_professionel_pro,nom_personne,id_demande_id,adresse_fr_bien,adresse_nl_bien', '@@array[ou_et]=0@@array[entity]=personne@@array[champ]=email_personne@@array[operateur]=vide@@array[choice]=@@array[par_ouvert]=0@@array[par_ferme]=0@@begin@@array[ou_et]=AND@@array[entity]=demande@@array[champ]=id_demande_id@@array[operateur]=vide@@array[choice]=@@array[par_ouvert]=0@@array[par_ferme]=0', 'ou_et_%23%231=0&entity_%23%231=personne&champ_%23%231=email_personne&operateur_%23%231=vide&%23%231%23%23_value=&par_ouvert_%23%231=0&par_ferme_%23%231=0&ou_et_%23%232=AND&entity_%23%232=demande&champ_%23%232=id_demande_id&operateur_%23%232=vide&%23%232%23%23_value=&par_ouvert_%23%232=0&par_ferme_%23%232=0&number=2&fields_select%5B%5D=nom_personne&id_personne&fields_select[]=is_professionel_pro&fields_select[]=nom_personne&fields_select[]=id_demande_id&fields_select[]=adresse_fr_bien&fields_select[]=adresse_nl_bien', 23, '2020-11-18 14:33:20', 0, 'Personnes sans email, sans demande, sans bien', 2013, 2014, '', NULL),
(171, 'SELECT demande.id_demande as id_demande_id, demande.date as date_demande, joinliste_id_demande_statut.label as id_demande_statut , CONCAT (joinliste_utilisateur_createur.nom,\' \',joinliste_utilisateur_createur.prenom) as utilisateur_createur , CONCAT (joinliste_utilisateur_demande.nom,\' \',joinliste_utilisateur_demande.prenom) as utilisateur_demande , CONCAT (joinliste_utilisateur_demande_2.nom,\' \',joinliste_utilisateur_demande_2.prenom) as utilisateur_demande_2 , joinliste_id_type_demande.label as id_type_demande , ( SELECT GROUP_CONCAT( liste_th_visite.label)  FROM liste_th_visite WHERE  FIND_IN_SET (liste_th_visite.id,demande_caracteristique.id_visite)) as demande_id_visite, joinliste_demande_id_type_accompagnement.label as demande_id_type_accompagnement , joinliste_demande_id_thematique_principal.label as demande_id_thematique_principal , ( SELECT GROUP_CONCAT( liste_thematique.label)  FROM liste_thematique WHERE  FIND_IN_SET (liste_thematique.id,demande_caracteristique.id_thematique_secondaire)) as demande_id_thematique_secondaire, ( SELECT GROUP_CONCAT( liste_th_prime.label)  FROM liste_th_prime WHERE  FIND_IN_SET (liste_th_prime.id,demande_caracteristique.id_th_prime)) as demande_id_prime, demande.nom as nom_demande, demande.descriptif as descriptif_demande, (SELECT subject from fh_messagerie WHERE fh_messagerie.entity=\'demande\' AND fh_messagerie.id_entity=demande.id_demande ORDER BY fh_messagerie.date_created DESC LIMIT 1) as objet_note_interne, (SELECT content from fh_messagerie WHERE fh_messagerie.entity=\'demande\' AND fh_messagerie.id_entity=demande.id_demande ORDER BY fh_messagerie.date_created DESC LIMIT 1) as note_interne, COUNT(DISTINCT rdv.id_rdv) as count_rdv, COUNT(DISTINCT tache.id_tache) as count_tache, bien.id_bien as id_bien, joinliste_id_type_bien_coche.label as id_type_bien_coche , CONCAT (joinliste_adresse_fr_cp.cp,\' \',joinliste_adresse_fr_cp.localite_fr,\' \',joinliste_adresse_fr_cp.localite_nl_select) as adresse_fr_cp , bien.adresse_fr as adresse_fr_bien, bien.adresse_nl as adresse_nl_bien, bien.bt as adresse_bt, bien.etage_logement as etage_logement_bien, joinliste_id_nombre_bien.label as id_nombre_bien , personne.id_personne as id_personne, personne.prenom as prenom_personne, personne.nom as nom_personne, joinliste_langue_personne.label as langue_personne , joinliste_civilite_personne.label as civilite_personne , personne.email as email_personne, personne.telephone as telephone_personne, joinliste_rel_personne_bien.label as rel_personne_bien , (SELECT count(dem.id_demande) from demande as dem LEFT JOIN personne_bien as pb ON pb.id_demande=dem.id_demande WHERE (dem.id_demande_statut=1 OR dem.id_demande_statut=2 OR dem.id_demande_statut=3) AND pb.id_personne=personne.id_personne) as nb_demande_ouverte FROM demande LEFT JOIN personne_bien ON personne_bien.id_demande=demande.id_demande LEFT JOIN encodage ON encodage.id_encodage=demande.id_encodage   LEFT JOIN demande_caracteristique ON demande_caracteristique.id_demande=demande.id_demande  LEFT JOIN demande_rdv ON demande_rdv.id_demande=demande.id_demande LEFT JOIN rdv ON demande_rdv.id_rdv=rdv.id_rdv  LEFT JOIN demande_tache ON demande_tache.id_demande=demande.id_demande LEFT JOIN tache ON demande_tache.id_tache=tache.id_tache  LEFT JOIN bien ON bien.id_bien=personne_bien.id_bien  LEFT JOIN personne ON personne.id_personne=personne_bien.id_personne    LEFT JOIN liste_demande_statut as joinliste_id_demande_statut ON  joinliste_id_demande_statut.id=demande.id_demande_statut  LEFT JOIN users as joinliste_utilisateur_createur ON  joinliste_utilisateur_createur.id_user=demande.id_user_create  LEFT JOIN users as joinliste_utilisateur_demande ON  joinliste_utilisateur_demande.id_user=demande.id_utilisateur  LEFT JOIN users as joinliste_utilisateur_demande_2 ON  joinliste_utilisateur_demande_2.id_user=demande.id_utilisateur_2  LEFT JOIN liste_demande_type as joinliste_id_type_demande ON  joinliste_id_type_demande.id=demande.id_type_demande  LEFT JOIN liste_th_visite as joinliste_demande_id_visite ON  joinliste_demande_id_visite.id=demande_caracteristique.id_visite  LEFT JOIN liste_type_accompagnement as joinliste_demande_id_type_accompagnement ON  joinliste_demande_id_type_accompagnement.id=demande_caracteristique.id_type_accompagnement  LEFT JOIN liste_thematique as joinliste_demande_id_thematique_principal ON  joinliste_demande_id_thematique_principal.id=demande_caracteristique.id_thematique_principal  LEFT JOIN liste_thematique as joinliste_demande_id_thematique_secondaire ON  joinliste_demande_id_thematique_secondaire.id=demande_caracteristique.id_thematique_secondaire  LEFT JOIN liste_th_prime as joinliste_demande_id_prime ON  joinliste_demande_id_prime.id=demande_caracteristique.id_th_prime  LEFT JOIN liste_bien_type as joinliste_id_type_bien_coche ON  joinliste_id_type_bien_coche.id=bien.id_type  LEFT JOIN liste_cp_brugis as joinliste_adresse_fr_cp ON  joinliste_adresse_fr_cp.cp=bien.adresse_fr_cp  LEFT JOIN liste_bien_nombre_logement as joinliste_id_nombre_bien ON  joinliste_id_nombre_bien.label=bien.id_nombre_logement  LEFT JOIN liste_langue as joinliste_langue_personne ON  joinliste_langue_personne.id=personne.id_langue  LEFT JOIN liste_civilite as joinliste_civilite_personne ON  joinliste_civilite_personne.id=personne.id_civilite  LEFT JOIN liste_rel_personne_bien as joinliste_rel_personne_bien ON  joinliste_rel_personne_bien.id=personne_bien.rel_personne_bien  WHERE ((demande.id_demande IS NOT NULL AND demande.id_demande!=\'\') AND (( demande_caracteristique.id_thematique_principal  LIKE  \'8\' OR  demande_caracteristique.id_thematique_principal  LIKE  \'8,%\'  OR  demande_caracteristique.id_thematique_principal  LIKE  \'%,8\'  OR  demande_caracteristique.id_thematique_principal  LIKE  \'%,8,%\') OR ( demande_caracteristique.id_thematique_secondaire  LIKE  \'8\' OR  demande_caracteristique.id_thematique_secondaire  LIKE  \'8,%\'  OR  demande_caracteristique.id_thematique_secondaire  LIKE  \'%,8\'  OR  demande_caracteristique.id_thematique_secondaire  LIKE  \'%,8,%\')) AND (personne.nom != \'Anonyme\' OR (personne.email IS NOT NULL AND personne.email!=\'\')) )  AND  (  YEAR(demande.date)=2021 OR  YEAR(demande.date)=2022 )  GROUP BY demande.id_demande ', 'id_demande_id,date_demande,id_demande_statut,utilisateur_createur,utilisateur_demande,utilisateur_demande_2,id_type_demande,demande_id_visite,demande_id_type_accompagnement,demande_id_thematique_principal,demande_id_thematique_secondaire,demande_id_prime,nom_demande,descriptif_demande,objet_note_interne,note_interne,count_rdv,count_tache,id_bien,id_type_bien_coche,adresse_fr_cp,adresse_fr_bien,adresse_nl_bien,adresse_bt,etage_logement_bien,id_nombre_bien,id_personne,prenom_personne,nom_personne,langue_personne,civilite_personne,email_personne,telephone_personne,rel_personne_bien,nb_demande_ouverte', '@@array[ou_et]=0@@array[entity]=demande@@array[champ]=id_demande_id@@array[operateur]=vide_pas@@array[choice]=@@array[par_ouvert]=0@@array[par_ferme]=0@@begin@@array[ou_et]=AND@@array[entity]=demande_detail@@array[champ]=demande_id_thematique_principal@@array[operateur]=contient@@array[choice_is_array]=8@@array[par_ouvert]=1@@array[par_ferme]=0@@begin@@array[ou_et]=OR@@array[entity]=demande_detail@@array[champ]=demande_id_thematique_secondaire@@array[operateur]=contient@@array[choice_is_array]=8@@array[par_ouvert]=0@@array[par_ferme]=1@@begin@@array[ou_et]=AND@@array[entity]=personne@@array[champ]=nom_personne@@array[operateur]=different@@array[choice]=Anonyme@@array[par_ouvert]=1@@array[par_ferme]=0@@begin@@array[ou_et]=OR@@array[entity]=personne@@array[champ]=email_personne@@array[operateur]=vide_pas@@array[choice]=@@array[par_ouvert]=0@@array[par_ferme]=1', 'ou_et_%23%231=0&entity_%23%231=demande&champ_%23%231=id_demande_id&operateur_%23%231=vide_pas&%23%231%23%23_value=&par_ouvert_%23%231=0&par_ferme_%23%231=0&ou_et_%23%232=AND&entity_%23%232=demande_caracteristique&champ_%23%232=demande_id_thematique_pr