tique.id_thematique_principal  LIKE  \'7\') OR ( demande_caracteristique.id_thematique_secondaire  LIKE  \'7\' OR  demande_caracteristique.id_thematique_secondaire  LIKE  \'7,%\'  OR  demande_caracteristique.id_thematique_secondaire  LIKE  \'%,7\'  OR  demande_caracteristique.id_thematique_secondaire  LIKE  \'%,7,%\') OR ( demande_caracteristique.id_type_accompagnement  LIKE  \'4\')) AND (personne.nom != \'Anonyme\' OR (personne.email IS NOT NULL AND personne.email!=\'\')) )  AND  (  YEAR(demande.date)=2021 OR  YEAR(demande.date)=2022 )  GROUP BY demande.id_demande ', 'id_demande_id,date_demande,id_demande_statut,utilisateur_createur,utilisateur_demande,utilisateur_demande_2,id_type_demande,demande_id_visite,demande_id_type_accompagnement,demande_id_thematique_principal,demande_id_thematique_secondaire,demande_id_prime,demande_id_th_acoustique,demande_id_th_energie,demande_id_th_logement,demande_id_th_patrimoine,demande_id_th_renovation,demande_id_th_urbanisme,demande_id_ths_batiment_durable,demande_id_type_projet,nom_demande,descriptif_demande,objet_note_interne,note_interne,count_rdv,count_tache,id_bien,id_type_bien_coche,adresse_fr_cp,adresse_fr_bien,adresse_nl_bien,adresse_bt,etage_logement_bien,id_personne,prenom_personne,nom_personne,langue_personne,civilite_personne,email_personne,telephone_personne,rel_personne_bien,nb_demande_ouverte', '@@array[ou_et]=0@@array[entity]=demande@@array[champ]=id_demande_id@@array[operateur]=vide_pas@@array[choice]=@@array[par_ouvert]=0@@array[par_ferme]=0@@begin@@array[ou_et]=AND@@array[entity]=demande_detail@@array[champ]=demande_id_thematique_principal@@array[operateur]=egal@@array[choice_is_array]=7@@array[par_ouvert]=1@@array[par_ferme]=0@@begin@@array[ou_et]=OR@@array[entity]=demande_detail@@array[champ]=demande_id_thematique_secondaire@@array[operateur]=contient@@array[choice_is_array]=7@@array[par_ouvert]=0@@array[par_ferme]=0@@begin@@array[ou_et]=OR@@array[entity]=demande_detail@@array[champ]=demande_id_type_accompagne