(225, 'SELECT demande.id_demande as id_demande_id, demande.date as date_demande, joinliste_id_demande_statut.label as id_demande_statut , CONCAT (joinliste_utilisateur_demande.nom,\' \',joinliste_utilisateur_demande.prenom) as utilisateur_demande , demande.nom as nom_demande, ( SELECT GROUP_CONCAT( liste_th_prime.label)  FROM liste_th_prime WHERE  FIND_IN_SET (liste_th_prime.id,demande_caracteristique.id_th_prime)) as demande_id_prime, ( SELECT GROUP_CONCAT( liste_objet_pvb.label)  FROM liste_objet_pvb WHERE  FIND_IN_SET (liste_objet_pvb.id,demande_caracteristique.id_objet_pvb)) as demande_id_objet_pvb, demande_caracteristique.date_pvb as demande_date_pvb, ( SELECT GROUP_CONCAT( liste_credit_pvb.label)  FROM liste_credit_pvb WHERE  FIND_IN_SET (liste_credit_pvb.id,demande_caracteristique.id_credit_pvb)) as demande_id_credit_pvb, joinliste_demande_id_revenu.label as demande_id_revenu , personne.prenom as prenom_personne, personne.nom as nom_personne, joinliste_langue_personne.label as langue_personne , CONCAT (joinliste_adresse_fr_cp.cp,\' \',joinliste_adresse_fr_cp.localite_fr,\' \',joinliste_adresse_fr_cp.localite_nl_select) as adresse_fr_cp , joinliste_rel_personne_bien.label as rel_personne_bien , bien.adresse_fr as adresse_fr_bien FROM demande LEFT JOIN personne_bien ON personne_bien.id_demande=demande.id_demande LEFT JOIN encodage ON encodage.id_encodage=demande.id_encodage   LEFT JOIN demande_caracteristique ON demande_caracteristique.id_demande=personne_bien.id_demande  LEFT JOIN personne ON personne.id_personne=personne_bien.id_personne    LEFT JOIN bien ON bien.id_bien=personne_bien.id_bien LEFT JOIN bien_caracteristique ON bien_caracteristique.id_bien=personne_bien.id_bien  LEFT JOIN liste_demande_statut as joinliste_id_demande_statut ON  joinliste_id_demande_statut.id=demande.id_demande_statut  LEFT JOIN users as joinliste_utilisateur_demande ON  joinliste_utilisateur_demande.id_user=demande.id_utilisateur  LEFT JOIN liste_th_prime as joinliste_demande_id_prime ON  joinliste_demande_id_prime.id=demande_caracteristique.id_th_prime  LEFT JOIN liste_objet_pvb as joinliste_demande_id_objet_pvb ON  joinliste_demande_id_objet_pvb.id=demande_caracteristique.id_objet_pvb  LEFT JOIN liste_credit_pvb as joinliste_demande_id_credit_pvb ON  joinliste_demande_id_credit_pvb.id=demande_caracteristique.id_credit_pvb  LEFT JOIN liste_revenu as joinliste_demande_id_revenu ON  joinliste_demande_id_revenu.id=demande_caracteristique.id_revenu  LEFT JOIN liste_langue as joinliste_langue_personne ON  joinliste_langue_personne.id=personne.id_langue  LEFT JOIN liste_cp_brugis as joinliste_adresse_fr_cp ON  joinliste_adresse_fr_cp.cp=bien.adresse_fr_cp  LEFT JOIN liste_rel_personne_bien as joinliste_rel_personne_bien ON  joinliste_rel_personne_bien.id=personne_bien.rel_personne_bien  WHERE (demande_caracteristique.date_pvb>\'2021-01-01\' AND demande_caracteristique.date_pvb<\'2022-01-01\' AND ( demande_caracteristique.id_type_accompagnement  LIKE  \'1\') )  AND  (  YEAR(demande.date)=2020 OR  YEAR(demande.date)=2021 ) ', 'id_demande_id,date_demande,id_demande_statut,utilisateur_demande,nom_demande,demande_id_prime,demande_id_objet_pvb,demande_date_pvb,demande_id_credit_pvb,demande_id_revenu,prenom_personne,nom_personne,langue_personne,adresse_fr_cp,rel_personne_bien,adresse_fr_bien', '@@array[ou_et]=0@@array[entity]=demande_detail@@array[champ]=demande_date_pvb@@array[operateur]=superieur@@array[choice]=01/01/2021@@array[par_ouvert]=0@@array[par_ferme]=0@@begin@@array[ou_et]=AND@@array[entity]=demande_detail@@array[champ]=demande_date_pvb@@array[operateur]=inferieur@@array[choice]=01/01/2022@@array[par_ouvert]=0@@array[par_ferme]=0@@begin@@array[ou_et]=AND@@array[entity]=demande_detail@@array[champ]=demande_id_type_accompagnement@@array[operateur]=egal@@array[choice_is_array]=1@@array[par_ouvert]=0@@array[par_ferme]=0', 'ou_et_%23%231=0&entity_%23%231=demande_caracteristique&champ_%23%231=demande_date_pvb&operateur_%23%231=superieur&%23%231%23%23_value=01%2F01%2F2021&par_ouvert_%23%231=0&par_ferme_%23%231=0&ou_et_%23%232=AND&entity_%23%232=demande_caracteristique&champ_%23%232=demande_date_pvb&operateur_%23%232=inferieur&%23%232%23%23_value=01%2F01%2F2022&par_ouvert_%23%232=0&par_ferme_%23%232=0&ou_et_%23%233=AND&entity_%23%233=demande_caracteristique&champ_%23%233=demande_id_type_accompagnement&operateur_%23%233=egal&%23%233%23%23_value%5B%5D=1&par_ouvert_%23%233=0&par_ferme_%23%233=0&number=3&fields_select%5B%5D=nom_personne&id_demande_id&fields_select[]=date_demande&fields_select[]=id_demande_statut&fields_select[]=utilisateur_demande&fields_select[]=nom_demande&fields_select[]=demande_id_prime&fields_select[]=demande_id_objet_pvb&fields_select[]=demande_date_pvb&fields_select[]=demande_id_credit_pvb&fields_select[]=demande_id_revenu&fields_select[]=prenom_personne&fields_select[]=nom_personne&fields_select[]=langue_personne&fields_select[]=adresse_fr_cp&fields_select[]=rel_personne_bien&fields_select[]=adresse_fr_bien', 65, '2021-01-19 19:33:56', 0, 'STAT PVB 2021 envois', 2020, 2021, '', ''),
(227, 'SELECT demande.id_demande as id_demande_id, demande.date as date_demande, joinliste_id_demande_statut.label as id_demande_statut , CONCAT (joinliste_utilisateur_createur.nom,\' \',joinliste_utilisateur_createur.prenom) as utilisateur_createur , CONCAT (joinliste_utilisateur_demande.nom,\' \',joinliste_utilisateur_demande.prenom) as utilisateur_demande , CONCAT (joinliste_utilisateur_demande_2.nom,\' \',joinliste_utilisateur_demande_2.prenom) as utilisateur_demande_2 , joinliste_id_type_demande.label as id_type_demande , ( SELECT GROUP_CONCAT( liste_th_visite.label)  FROM liste_th_visite WHERE  FIND_IN_SET (liste_th_visite.id,demande_caracteristique.id_visite)) as demande_id_visite, joinliste_demande_id_type_accompagnement.label as demande_id_type_accompagnement , joinliste_demande_id_thematique_principal.label as demande_id_thematique_principal , ( SELECT GROUP_CONCAT( liste_thematique.label)  FROM liste_thematique WHERE  FIND_IN_SET (liste_thematique.id,demande_caracteristique.id_thematique_secondaire)) as demande_id_thematique_secondaire, ( SELECT GROUP_CONCAT( liste_th_urbanisme.label)  FROM liste_th_urbanisme WHERE  FIND_IN_SET (liste_th_urbanisme.id,demande_caracteristique.id_th_urbanisme)) as demande_id_th_urbanisme, ( SELECT GROUP_CONCAT( liste_permis.label)  FROM liste_permis WHERE  FIND_IN_SET (liste_permis.id,demande_caracteristique.id_objet_permis)) as demande_id_objet_permis, ( SELECT GROUP_CONCAT( liste_permis_raison.label)  FROM liste_permis_raison WHERE  FIND_IN_SET (liste_permis_raison.id,demande_caracteristique.id_raison_permis)) as demande_id_raison_permis, joinliste_demande_th_regularisation.label as demande_th_regularisation , demande.nom as nom_demande, demande.descriptif as descriptif_demande, (SELECT content from fh_messagerie WHERE fh_messagerie.entity=\'demande\' AND fh_messagerie.id_entity=demande.id_demande ORDER BY fh_messagerie.date_created DESC LIMIT 1) as note_interne, bien.id_bien as id_bien, joinliste_id_type_bien_coche.label as id_type_bien_coche , CONCAT (joinliste_adresse_fr_cp.cp,\' \',joinliste_adresse_fr_cp.localite_fr,\' \',joinliste_adresse_fr_cp.localite_nl_select) as adresse_fr_cp , bien.adresse_fr as adresse_fr_bien, bien.adresse_nl as adresse_nl_bien, bien.bt as adresse_bt, bien.etage_logement as etage_logement_bien, personne.id_personne as id_personne, joinliste_civilite_personne.label as civilite_personne , personne.prenom as prenom_personne, personne.nom as nom_personne, joinliste_langue_personne.label as langue_personne , personne.email as email_personne, personne.telephone as telephone_personne, joinliste_rel_personne_bien.label as rel_personne_bien , (SELECT count(dem.id_demande) from demande as dem LEFT JOIN personne_bien as pb ON pb.id_demande=dem.id_demande WHERE (dem.id_demande_statut=1 OR dem.id_demande_statut=2 OR dem.id_demande_statut=3) AND pb.id_personne=personne.id_personne) as nb_demande_ouverte FROM demande LEFT JOIN personne_bien ON personne_bien.id_demande=demande.id_demande LEFT JOIN encodage ON encodage.id_encodage=demande.id_encodage   LEFT JOIN demande_caracteristique ON demande_caracteristique.id_demande=demande.id_demande  LEFT JOIN bien ON bien.id_bien=personne_bien.id_bien  LEFT JOIN personne ON personne.id_personne=personne_bien.id_personne    LEFT JOIN liste_demande_statut as joinliste_id_demande_statut ON  joinliste_id_demande_statut.id=demande.id_demande_statut  LEFT JOIN users as joinliste_utilisateur_createur ON  joinliste_utilisateur_createur.id_user=demande.id_user_create  LEFT JOIN users as joinliste_utilisateur_demande ON  joinliste_utilisateur_demande.id_user=demande.id_utilisateur  LEFT JOIN users as joinliste_utilisateur_demande_2 ON  joinliste_utilisateur_demande_2.id_user=demande.id_utilisateur_2  LEFT JOIN liste_demande_type as joinliste_id_type_demande ON  joinliste_id_type_demande.id=demande.id_type_demande  LEFT JOIN liste_th_visite as joinliste_demande_id_visite ON  joinliste_demande_id_visite.id=demande_caracteristique.id_visite  LEFT JOIN liste_type_accompagnement as joinliste_demande_id_type_accompagnement ON  joinliste_demande_id_type_accompagnement.id=demande_caracteristique.id_type_accompagnement  LEFT JOIN liste_thematique as joinliste_demande_id_thematique_principal ON  joinliste_demande_id_thematique_principal.id=demande_caracteristique.id_thematique_principal  LEFT JOIN liste_thematique as joinliste_demande_id_thematique_secondaire ON  joinliste_demande_id_thematique_secondaire.id=demande_caracteristique.id_thematique_secondaire  LEFT JOIN liste_th_urbanisme as joinliste_demande_id_th_urbanisme ON  joinliste_demande_id_th_urbanisme.id=demande_caracteristique.id_th_urbanisme  LEFT JOIN liste_permis as joinliste_demande_id_objet_permis ON  joinliste_demande_id_objet_permis.id=demande_caracteristique.id_objet_permis  LEFT JOIN liste_permis_raison as joinliste_demande_id_raison_permis ON  joinliste_demande_id_raison_permis.id=demande_caracteristique.id_raison_permis  LEFT JOIN liste_oui_non as joinliste_demande_th_regularisation ON  joinliste_demande_th_regularisation.id=demande_caracteristique.id_th_regularisation  LEFT JOIN liste_bien_type as joinliste_id_type_bien_coche ON  joinliste_id_type_bien_coche.id=bien.id_type  LEFT JOIN liste_cp_brugis as joinliste_adresse_fr_cp ON  joinliste_adresse_fr_cp.cp=bien.adresse_fr_cp  LEFT JOIN liste_civilite as joinliste_civilite_personne ON  joinliste_civilite_personne.id=personne.id_civilite  LEFT JOIN liste_langue as joinliste_langue_personne ON  joinliste_langue_personne.id=personne.id_langue  LEFT JOIN liste_rel_personne_bien as joinliste_rel_personne_bien ON  joinliste_rel_personne_bien.id=personne_bien.rel_personne_bien  WHERE ((demande.id_demande IS NOT NULL AND demande.id_demande!=\'\') AND (( demande_caracteristique.id_thematique_principal  LIKE  \'6\') OR ( demande_caracteristique.id_thematique_secondaire  LIKE  \'6\' OR  demande_caracteristique.id_thematique_secondaire  LIKE  \'6,%\'  OR  demande_caracteristique.id_thematique_secon