(272, 'SELECT CONCAT (joinliste_utilisateur_demande.nom,\' \',joinliste_utilisateur_demande.prenom) as utilisateur_demande , COUNT(DISTINCT demande.id_demande) as count_demande , COUNT(DISTINCT rdv.id_rdv) as count_rdv FROM demande LEFT JOIN personne_bien ON personne_bien.id_demande=demande.id_demande LEFT JOIN encodage ON encodage.id_encodage=demande.id_encodage   LEFT JOIN demande_rdv ON demande_rdv.id_demande=demande.id_demande LEFT JOIN rdv ON demande_rdv.id_rdv=rdv.id_rdv  LEFT JOIN demande_caracteristique ON demande_caracteristique.id_demande=demande.id_demande  LEFT JOIN users as joinliste_utilisateur_demande ON  joinliste_utilisateur_demande.id_user=demande.id_utilisateur  WHERE ((demande.id_demande IS NOT NULL AND demande.id_demande!=\'\') AND ( demande_caracteristique.id_th_patrimoine  LIKE  \'12\' OR  demande_caracteristique.id_th_patrimoine  LIKE  \'12,%\'  OR  demande_caracteristique.id_th_patrimoine  LIKE  \'%,12\'  OR  demande_caracteristique.id_th_patrimoine  LIKE  \'%,12,%\') )  AND  (  YEAR(demande.date)=2021 OR  YEAR(demande.date)=2022 )  GROUP BY demande.id_utilisateur ', 'utilisateur_demande,count_demande,count_rdv', '@@array[ou_et]=0@@array[entity]=demande@@array[champ]=id_demande_id@@array[operateur]=vide_pas@@array[choice]=@@array[par_ouvert]=0@@array[par_ferme]=0@@begin@@array[ou_et]=AND@@array[entity]=demande_detail@@array[champ]=demande_id_th_patrimoine@@array[operateur]=contient@@array[choice_is_array]=12@@array[par_ouvert]=0@@array[par_ferme]=0', 'ou_et_%23%231=0&entity_%23%231=demande&champ_%23%231=id_demande_id&operateur_%23%231=vide_pas&%23%231%23%23_value=&par_ouvert_%23%231=0&par_ferme_%23%231=0&ou_et_%23%232=AND&entity_%23%232=demande_caracteristique&champ_%23%232=demande_id_th_patrimoine&operateur_%23%232=contient&%23%232%23%23_value%5B%5D=12&par_ouvert_%23%232=0&par_ferme_%23%232=0&number=2&fields_select%5B%5D=nom_personne&utilisateur_demande&fields_select[]=count_demande&fields_select[]=count_rdv', 112, '2021-01-25 02:47:12', 1,