(341, 'SELECT encodage.date_insert as encodage_date, CONCAT (joinliste_encodage_user_create.nom,\' \',joinliste_encodage_user_create.prenom) as encodage_user_create , joinliste_encodage_moyen_contact.label as encodage_moyen_contact , joinliste_encodage_origine_default.label as encodage_origine_default , ( SELECT GROUP_CONCAT( liste_demande_type.label)  FROM liste_demande_type WHERE  FIND_IN_SET (liste_demande_type.id,encodage.id_demande_type)) as encodage_demande_type, joinliste_encodage_rel_personne_bien.label as encodage_rel_personne_bien , joinliste_encodage_contact_duree_default.label as encodage_contact_duree_default , joinliste_encodage_contact_premier_default.label as encodage_contact_premier_default , joinliste_encodage_langue.label as encodage_langue , CONCAT (joinliste_encodage_cp.cp,\' \',joinliste_encodage_cp.localite_fr,\' \',joinliste_encodage_cp.localite_nl_select) as encodage_cp , encodage.nombre_coche as encodage_nombre, joinliste_civilite_personne.label as civilite_personne , personne.prenom as prenom_personne, personne.nom as nom_personne, demande.id_demande as id_demande_id, joinliste_id_demande_statut.label as id_demande_statut , CONCAT (joinliste_utilisateur_demande.nom,\' \',joinliste_utilisateur_demande.prenom) as utilisateur_demande , demande.nom as nom_demande FROM encodage LEFT JOIN personne ON personne.id_personne=encodage.id_personne   LEFT JOIN demande ON encodage.id_encodage=demande.id_encodage  LEFT JOIN demande_caracteristique ON demande_caracteristique.id_demande=demande.id_demande  LEFT JOIN personne_bien ON personne_bien.id_demande=demande.id_demande  LEFT JOIN users as joinliste_encodage_user_create ON  joinliste_encodage_user_create.id_user=encodage.user_create  LEFT JOIN liste_moyen_contact as joinliste_encodage_moyen_contact ON  joinliste_encodage_moyen_contact.id=encodage.moyen_contact  LEFT JOIN liste_demande_origine as joinliste_encodage_origine_default ON  joinliste_encodage_origine_default.id=encodage.demande_origine  LEF