(343, 'SELECT demande.id_demande as id_demande_id, demande.date as date_demande, joinliste_id_demande_statut.label as id_demande_statut , CONCAT (joinliste_utilisateur_createur.nom,\' \',joinliste_utilisateur_createur.prenom) as utilisateur_createur , CONCAT (joinliste_utilisateur_demande.nom,\' \',joinliste_utilisateur_demande.prenom) as utilisateur_demande , demande.nom as nom_demande, joinliste_id_type_demande.label as id_type_demande , joinliste_demande_id_type_accompagnement.label as demande_id_type_accompagnement , joinliste_demande_id_thematique_principal.label as demande_id_thematique_principal , ( SELECT GROUP_CONCAT( liste_thematique.label)  FROM liste_thematique WHERE  FIND_IN_SET (liste_thematique.id,demande_caracteristique.id_thematique_secondaire)) as demande_id_thematique_secondaire, ( SELECT GROUP_CONCAT( liste_ths_aide_locative.label)  FROM liste_ths_aide_locative WHERE  FIND_IN_SET (liste_ths_aide_locative.id,demande_caracteristique.id_ths_aide_locative)) as demande_id_ths_aide_locative, joinliste_demande_moyen_contact.label as demande_moyen_contact  FROM demande LEFT JOIN personne_bien ON personne_bien.id_demande=demande.id_demande LEFT JOIN encodage ON encodage.id_encodage=demande.id_encodage   LEFT JOIN demande_caracteristique ON demande_caracteristique.id_demande=demande.id_demande  LEFT JOIN liste_demande_statut as joinliste_id_demande_statut ON  joinliste_id_demande_statut.id=demande.id_demande_statut  LEFT JOIN users as joinliste_utilisateur_createur ON  joinliste_utilisateur_createur.id_user=demande.id_user_create  LEFT JOIN users as joinliste_utilisateur_demande ON  joinliste_utilisateur_demande.id_user=demande.id_utilisateur  LEFT JOIN liste_demande_type as joinliste_id_type_demande ON  joinliste_id_type_demande.id=demande.id_type_demande  LEFT JOIN liste_type_accompagnement as joinliste_demande_id_type_accompagnement ON  joinliste_demande_id_type_accompagnement.id=demande_caracteristique.id_type_accompagnement  LEFT JOIN liste_thematique as joinliste_demande_id_thematique_principal ON  joinliste_demande_id_thematique_principal.id=demande_caracteristique.id_thematique_principal  LEFT JOIN liste_thematique as joinliste_demande_id_thematique_secondaire ON  joinliste_demande_id_thematique_secondaire.id=demande_caracteristique.id_thematique_secondaire  LEFT JOIN liste_ths_aide_locative as joinliste_demande_id_ths_aide_locative ON  joinliste_demande_id_ths_aide_locative.id=demande_caracteristique.id_ths_aide_locative  LEFT JOIN liste_moyen_contact as joinliste_demande_moyen_contact ON  joinliste_demande_moyen_contact.id=demande.moyen_contact  WHERE (demande.date>\'2021-01-01\' AND demande.date<\'2022-01-01\' AND ( demande_caracteristique.id_ths_aide_locative  LIKE  \'1\' OR  demande_caracteristique.id_ths_aide_locative  LIKE  \'1,%\'  OR  demande_caracteristique.id_ths_aide_locative  LIKE  \'%,1\'  OR  demande_caracteristique.id_ths_aide_locative  LIKE  \'%,1,%\' OR  demande_caracteristique.id_ths_aide_locative  LIKE  \'2\' OR  demande_caracteristique.id_ths_aide_locative  LIKE  \'2,%\'  OR  demande_caracteristique.id_ths_aide_locative  LIKE  \'%,2\'  OR  demande_caracteristique.id_ths_aide_locative  LIKE  \'%,2,%\') )  AND  (  YEAR(demande.date)=2021 ) ', 'id_demande_id,date_demande,id_demande_statut,utilisateur_createur,utilisateur_demande,nom_demande,id_type_demande,demande_id_type_accompagnement,demande_id_thematique_principal,demande_id_thematique_secondaire,demande_id_ths_aide_locative,demande_moyen_contact', '@@array[ou_et]=0@@array[entity]=demande@@array[champ]=date_demande@@array[operateur]=superieur@@array[choice]=01/01/2021@@array[par_ouvert]=0@@array[par_ferme]=0@@begin@@array[ou_et]=AND@@array[entity]=demande@@array[champ]=date_demande@@array[operateur]=inferieur@@array[choice]=01/01/2022@@array[par_ouvert]=0@@array[par_ferme]=0@@begin@@array[ou_et]=AND@@array[entity]=demande_detail@@array[champ]=demande_id_ths_aide_locative@@array[operateur]=contient@@array[choice_is_array]=1,2@@array[par_o