(344, 'SELECT demande.id_demande as id_demande_id, demande.date as date_demande, joinliste_id_demande_statut.label as id_demande_statut , CONCAT (joinliste_utilisateur_demande.nom,\' \',joinliste_utilisateur_demande.prenom) as utilisateur_demande , demande.nom as nom_demande, joinliste_demande_moyen_contact.label as demande_moyen_contact , joinliste_demande_contact_premier_default.label as demande_contact_premier_default , joinliste_demande_origine_default.label as demande_origine_default , ( SELECT GROUP_CONCAT( liste_th_visite.label)  FROM liste_th_visite WHERE  FIND_IN_SET (liste_th_visite.id,demande_caracteristique.id_visite)) as demande_id_visite, joinliste_demande_id_thematique_principal.label as demande_id_thematique_principal , ( SELECT GROUP_CONCAT( liste_thematique.label)  FROM liste_thematique WHERE  FIND_IN_SET (liste_thematique.id,demande_caracteristique.id_thematique_secondaire)) as demande_id_thematique_secondaire, joinliste_langue_personne.label as langue_personne , joinliste_civilite_personne.label as civilite_personne , joinliste_rel_personne_bien.label as rel_personne_bien , CONCAT (joinliste_adresse_fr_cp.cp,\' \',joinliste_adresse_fr_cp.localite_fr,\' \',joinliste_adresse_fr_cp.localite_nl_select) as adresse_fr_cp , joinliste_id_type_bien_coche.label as id_type_bien_coche , personne.nom as nom_personne, personne.prenom as prenom_personne, joinliste_type_rdv.label as type_rdv , joinliste_statut_rdv.label as statut_rdv , ( SELECT GROUP_CONCAT( CONCAT ( users.nom,\' \',users.prenom))  as label_affiche  FROM users WHERE  FIND_IN_SET (users.id_user,rdv.id_user_rdv)) as user_rdv_multi, rdv.date_rdv_debut as date_rdv_debut, CONCAT (joinliste_encodage_user_create.nom,\' \',joinliste_encodage_user_create.prenom) as encodage_user_create  FROM demande LEFT JOIN personne_bien ON personne_bien.id_demande=demande.id_demande LEFT JOIN encodage ON encodage.id_encodage=demande.id_encodage   LEFT JOIN demande_caracteristique ON demande_caracteristique.id_demande=demande.id_demande  LEFT JOIN personne ON personne.id_personne=personne_bien.id_personne    LEFT JOIN bien ON bien.id_bien=personne_bien.id_bien  LEFT JOIN demande_rdv ON demande_rdv.id_demande=demande.id_demande LEFT JOIN rdv ON demande_rdv.id_rdv=rdv.id_rdv  LEFT JOIN liste_demande_statut as joinliste_id_demande_statut ON  joinliste_id_demande_statut.id=demande.id_demande_statut  LEFT JOIN users as joinliste_utilisateur_demande ON  joinliste_utilisateur_demande.id_user=demande.id_utilisateur  LEFT JOIN liste_moyen_contact as joinliste_demande_moyen_contact ON  joinliste_demande_moyen_contact.id=demande.moyen_contact  LEFT JOIN liste_oui_non as joinliste_demande_contact_premier_default ON  joinliste_demande_contact_premier_default.id=demande.is_premier_contact  LEFT JOIN liste_demande_origine as joinliste_demande_origine_default ON  joinliste_demande_origine_default.id=demande.demande_origine  LEFT JOIN liste_th_visite as joinliste_demande_id_visite ON  joinliste_demande_id_visite.id=demande_caracteristique.id_visite  LEFT JOIN liste_thematique as joinliste_demande_id_thematique_principal ON  joinliste_demande_id_thematique_principal.id=demande_caracteristique.id_thematique_principal  LEFT JOIN liste_thematique as joinliste_demande_id_thematique_secondaire ON  joinliste_demande_id_thematique_secondaire.id=demande_caracteristique.id_thematique_secondaire  LEFT JOIN liste_langue as joinliste_langue_personne ON  joinliste_langue_personne.id=personne.id_langue  LEFT JOIN liste_civilite as joinliste_civilite_personne ON  joinliste_civilite_personne.id=personne.id_civilite  LEFT JOIN liste_rel_personne_bien as joinliste_rel_personne_bien ON  joinliste_rel_personne_bien.id=personne_bien.rel_personne_bien  LEFT JOIN liste_cp_brugis as joinliste_adresse_fr_cp ON  joinliste_adresse_fr_cp.cp=bien.adresse_fr_cp  LEFT JOIN liste_bien_type as joinliste_id_type_bien_coche ON  joinliste_id_type_bien_coche.id=bien.id_type  LEFT JOIN liste_rdv_type as joinliste_type_rdv ON  joinliste_type_rdv.id=rdv.id_type_rdv  LEFT JOIN liste_rdv_statut as joinliste_statut_rdv ON  joinliste_statut_rdv.id=rdv.id_statut_rdv  LEFT JOIN users as joinliste_user_rdv_multi ON  joinliste_user_rdv_multi.id_user=rdv.id_user_rdv  LEFT JOIN users as joinliste_encodage_user_create ON  joinliste_encodage_user_create.id_user=encodage.user_create  WHERE (demande.date>\'2021-01-01\' AND demande.date<\'2022-01-01\' AND ( demande.id_type_demande  LIKE  \'2\') )  AND  (  YEAR(demande.date)=2021 ) ', 'id_demande_id,date_demande,id_demande_statut,utilisateur_demande,nom_demande,demande_moyen_contact,demande_contact_premier_default,demande_origine_default,demande_id_visite,demande_id_thematique_principal,demande_id_thematique_secondaire,langue_personne,civilite_personne,rel_personne_bien,adresse_fr_cp,id_type_bien_coche,nom_personne,prenom_personne,type_rdv,statut_rdv,user_rdv_multi,date_rdv_debut,encodage_user_create', '@@array[ou_et]=0@@array[entity]=demande@@array[champ]=date_demande@@array[operateur]=superieur@@array[choice]=01/01/2021@@array[par_ouvert]=0@@array[par_ferme]=0@@begin@@array[ou_et]=AND@@array[entity]=demande@@array[champ]=date_demande@@array[operateur]=inferieur@@array[choice]=01/01/2022@@array[par_ouvert]=0@@array[par_ferme]=0@@begin@@array[ou_et]=AND@@array[entity]=demande_detail@@array[champ]=id_type_demande@@array[operateur]=egal@@array[choice_is_array]=2@@array[par_ouvert]=0@@array[par_ferme]=0', 'ou_et_%23%231=0&entity_%23%231=demande&champ_%23%231=date_demande&operateur_%23%231=superieur&%23%231%23%23_value=01%2F01%2F2021&par_ouvert_%23%231=0&par_ferme_%23%231=0&ou_et_%23%232=AND&entity_%23%232=demande&champ_%23%232=date_demande&operateur_%23%232=inferieur&%23%232%23%23_value=01%2F01%2F2022&par_ouvert_%23%232=0&par_ferme_%23%232=0&ou_et_%23%233=AND&entity_%23%233=demande_caracteristique&champ_%23%233=id_type_demande&operateur_%23%233=egal&%23%233%23%23_value%5B%5D=2&par_ouvert_%23%233=0&par_ferme_%23%233=0&number=3&fields_select%5B%5D=nom_personne&id_dema