(345, 'SELECT demande.id_demande as id_demande_id, demande.date as date_demande, CONCAT (joinliste_utilisateur_demande.nom,\' \',joinliste_utilisateur_demande.prenom) as utilisateur_demande , joinliste_id_type_demande.label as id_type_demande , ( SELECT GROUP_CONCAT( liste_th_visite.label)  FROM liste_th_visite WHERE  FIND_IN_SET (liste_th_visite.id,demande_caracteristique.id_visite)) as demande_id_visite, ( SELECT GROUP_CONCAT( liste_ths_geste.label)  FROM liste_ths_geste WHERE  FIND_IN_SET (liste_ths_geste.id,demande_caracteristique.id_geste)) as demande_id_geste, ( SELECT GROUP_CONCAT( liste_intervention.label)  FROM liste_intervention WHERE  FIND_IN_SET (liste_intervention.id,demande_caracteristique.id_intervention)) as demande_id_intervention, ( SELECT GROUP_CONCAT( liste_intervention_non.label)  FROM liste_intervention_non WHERE  FIND_IN_SET (liste_intervention_non.id,demande_caracteristique.id_intervention_non)) as demande_id_intervention_non, ( SELECT GROUP_CONCAT( liste_travaux.label)  FROM liste_travaux WHERE  FIND_IN_SET (liste_travaux.id,demande_caracteristique.id_travaux)) as demande_id_travaux FROM demande LEFT JOIN personne_bien ON personne_bien.id_demande=demande.id_demande LEFT JOIN encodage ON encodage.id_encodage=demande.id_encodage   LEFT JOIN demande_caracteristique ON demande_caracteristique.id_demande=demande.id_demande  LEFT JOIN users as joinliste_utilisateur_demande ON  joinliste_utilisateur_demande.id_user=demande.id_utilisateur  LEFT JOIN liste_demande_type as joinliste_id_type_demande ON  joinliste_id_type_demande.id=demande.id_type_demande  LEFT JOIN liste_th_visite as joinliste_demande_id_visite ON  joinliste_demande_id_visite.id=demande_caracteristique.id_visite  LEFT JOIN liste_ths_geste as joinliste_demande_id_geste ON  joinliste_demande_id_geste.id=demande_caracteristique.id_geste  LEFT JOIN liste_intervention as joinliste_demande_id_intervention ON  joinliste_demande_id_intervention.id=demande_caracteristique.id_intervention  LEFT JOIN liste_intervention_non as joinliste_demande_id_intervention_non ON  joinliste_demande_id_intervention_non.id=demande_caracteristique.id_intervention_non  LEFT JOIN liste_travaux as joinliste_demande_id_travaux ON  joinliste_demande_id_travaux.id=demande_caracteristique.id_travaux  WHERE ((demande.id_demande IS NOT NULL AND demande.id_demande!=\'\') AND ((demande_caracteristique.id_geste IS NOT NULL AND demande_caracteristique.id_geste!=\'\') OR (demande_caracteristique.id_intervention IS NOT NULL AND demande_caracteristique.id_intervention!=\'\') OR (demande_caracteristique.id_intervention_non IS NOT NULL AND demande_caracteristique.id_intervention_non!=\'\') OR (demande_caracteristique.id_travaux IS NOT NULL AND demande_caracteristique.id_travaux!=\'\')) AND ( demande.id_type_demande  LIKE  \'2\') )  AND  (  YEAR(demande.date)=2020 OR  YEAR(demande.date)=2021 ) ', 'id_demande_id,date_demande,utilisateur_demande,id_type_demande,demande_id_visite,demande_id_geste,demande_id_intervention,demande_id_intervention_non,demande_id_travaux', '@@array[ou_et]=0@@array[entity]=demande@@array[champ]=id_demande_id@@array[operateur]=vide_pas@@array[choice]=@@array[par_ouvert]=0@@array[par_ferme]=0@@begin@@array[ou_et]=AND@@array[entity]=demande_detail@@array[champ]=demande_id_geste@@array[operateur]=vide_pas@@array[par_ouvert]=1@@array[par_ferme]=0@@begin@@array[ou_et]=OR@@array[entity]=demande_detail@@array[champ]=demande_id_intervention@@array[operateur]=vide_pas@@array[par_ouvert]=0@@array[par_ferme]=0@@begin@@array[ou_et]=OR@@array[entity]=demande_detail@@array[champ]=demande_id_intervention_non@@array[operateur]=vide_pas@@array[par_ouvert]=0@@array[par_ferme]=0@@begin@@array[ou_et]=OR@@array[entity]=demande_detail@@array[champ]=demande_id_travaux@@array[operateur]=vide_pas@@array[par_ouvert]=0@@array[par_ferme]=1@@begin@@array[ou_et]=AND@@array[entity]=demande_detail@@array[champ]=id_type_demande@@array[operateur]=egal@@array[choice_is_array]=2@@array[par_ouvert]=0@@ar