(352, 'SELECT demande.id_demande as id_demande_id, demande.date as date_demande, joinliste_id_demande_statut.label as id_demande_statut , demande.nom as nom_demande, ( SELECT GROUP_CONCAT( liste_th_visite.label)  FROM liste_th_visite WHERE  FIND_IN_SET (liste_th_visite.id,demande_caracteristique.id_visite)) as demande_id_visite, ( SELECT GROUP_CONCAT( liste_th_prime.label)  FROM liste_th_prime WHERE  FIND_IN_SET (liste_th_prime.id,demande_caracteristique.id_th_prime)) as demande_id_prime, joinliste_demande_id_thematique_principal.label as demande_id_thematique_principal , ( SELECT GROUP_CONCAT( liste_thematique.label)  FROM liste_thematique WHERE  FIND_IN_SET (liste_thematique.id,demande_caracteristique.id_thematique_secondaire)) as demande_id_thematique_secondaire, ( SELECT GROUP_CONCAT( liste_th_patrimoine.label)  FROM liste_th_patrimoine WHERE  FIND_IN_SET (liste_th_patrimoine.id,demande_caracteristique.id_th_patrimoine)) as demande_id_th_patrimoine, personne.prenom as prenom_personne, personne.nom as nom_personne, joinliste_langue_personne.label as langue_personne , joinliste_rel_personne_bien.label as rel_personne_bien , bien.adresse_fr as adresse_fr_bien, CONCAT (joinliste_adresse_fr_cp.cp,\' \',joinliste_adresse_fr_cp.localite_fr,\' \',joinliste_adresse_fr_cp.localite_nl_select) as adresse_fr_cp , joinliste_id_type_bien_coche.label as id_type_bien_coche , ( SELECT GROUP_CONCAT( CONCAT ( users.nom,\' \',users.prenom))  as label_affiche  FROM users WHERE  FIND_IN_SET (users.id_user,rdv.id_user_rdv)) as user_rdv_multi, joinliste_type_rdv.label as type_rdv , joinliste_statut_rdv.label as statut_rdv , rdv.date_rdv_debut as date_rdv_debut, ( SELECT GROUP_CONCAT( liste_ths_petit_patrimoine.label)  FROM liste_ths_petit_patrimoine WHERE  FIND_IN_SET (liste_ths_petit_patrimoine.id,demande_caracteristique.id_ths_petit_patrimoine)) as demande_id_ths_petit_patrimoine FROM rdv LEFT JOIN demande_rdv ON demande_rdv.id_rdv=rdv.id_rdv   LEFT JOIN demande ON demande_rdv.id_demande=demande.id_demande  LEFT JOIN demande_caracteristique ON demande_caracteristique.id_demande=demande.id_demande  LEFT JOIN encodage ON encodage.id_encodage=demande.id_encodage   LEFT JOIN personne_bien ON personne_bien.id_demande=demande.id_demande  LEFT JOIN personne ON personne.id_personne=personne_bien.id_personne  LEFT JOIN bien ON bien.id_bien=personne_bien.id_bien LEFT JOIN bien_caracteristique ON bien_caracteristique.id_bien=bien.id_bien    LEFT JOIN liste_demande_statut as joinliste_id_demande_statut ON  joinliste_id_demande_statut.id=demande.id_demande_statut  LEFT JOIN liste_th_visite as joinliste_demande_id_visite ON  joinliste_demande_id_visite.id=demande_caracteristique.id_visite  LEFT JOIN liste_th_prime as joinliste_demande_id_prime ON  joinliste_demande_id_prime.id=demande_caracteristique.id_th_prime  LEFT JOIN liste_thematique as joinliste_demande_id_thematique_principal ON  joinliste_demande_id_thematique_principal.id=demande_caracteristique.id_thematique_principal  LEFT JOIN liste_thematique as joinliste_demande_id_thematique_secondaire ON  joinliste_demande_id_thematique_secondaire.id=demande_caracteristique.id_thematique_secondaire  LEFT JOIN liste_th_patrimoine as joinliste_demande_id_th_patrimoine ON  joinliste_demande_id_th_patrimoine.id=demande_caracteristique.id_th_patrimoine  LEFT JOIN liste_langue as joinliste_langue_personne ON  joinliste_langue_personne.id=personne.id_langue  LEFT JOIN liste_rel_personne_bien as joinliste_rel_personne_bien ON  joinliste_rel_personne_bien.id=personne_bien.rel_personne_bien  LEFT JOIN liste_cp_brugis as joinliste_adresse_fr_cp ON  joinliste_adresse_fr_cp.cp=bien.adresse_fr_cp  LEFT JOIN liste_bien_type as joinliste_id_type_bien_coche ON  joinliste_id_type_bien_coche.id=bien.id_type  LEFT JOIN users as joinliste_user_rdv_multi ON  joinliste_user_rdv_multi.id_user=rdv.id_user_rdv  LEFT JOIN liste_rdv_type as joinliste_type_rdv ON  joinliste_type_rdv.id=rdv.id_type_rdv  LEFT JOIN liste_rdv_statut as joinliste_statut_rdv ON  joinliste_statut_rdv.id=rdv.id_statut_rdv  LEFT JOIN liste_ths_petit_patrimoine as joinliste_demande_id_ths_petit_patrimoine ON  joinliste_demande_id_ths_petit_patrimoine.id=demande_caracteristique.id_ths_petit_patrimoine  WHERE (rdv.date_rdv_debut>\'2021-01-01\' AND rdv.date_rdv_debut<\'2022-01-01\' AND ( rdv.id_statut_rdv  LIKE  \'3\') AND ( demande.id_type_demande  LIKE  \'2\') AND ( rdv.id_type_rdv  LIKE  \'1\' OR  rdv.id_type_rdv  LIKE  \'8\') AND (( demande_caracteristique.id_th_patrimoine  LIKE  \'2\' OR  demande_caracteristique.id_th_patrimoine  LIKE  \'2,%\'  OR  demande_caracteristique.id_th_patrimoine  LIKE  \'%,2\'  OR  demande_caracteristique.id_th_patrimoine  LIKE  \'%,2,%\') OR ( demande_caracteristique.id_th_prime  LIKE  \'5\' OR  demande_caracteristique.id_th_prime  LIKE  \'5,%\'  OR  demande_caracteristique.id_th_prime  LIKE  \'%,5\'  OR  demande_caracteristique.id_th_prime  LIKE  \'%,5,%\')) )  AND  (  YEAR(rdv.date_insert)=2021 ) ', 'id_demande_id,date_demande,id_demande_statut,nom_demande,demande_id_visite,demande_id_prime,demande_id_thematique_principal,demande_id_thematique_secondaire,demande_id_th_patrimoine,prenom_personne,nom_personne,langue_personne,rel_personne_bien,adresse_fr_bien,adresse_fr_cp,id_type_bien_coche,user_rdv_multi,type_rdv,statut_rdv,date_rdv_debut,demande_id_ths_petit_patrimoine', '@@array[ou_et]=0@@array[entity]=rdv@@array[champ]=date_rdv_debut@@array[operateur]=superieur@@array[choice]=01/01/2021@@array[par_ouvert]=0@@array[par_ferme]=0@@begin@@array[ou_et]=AND@@array[entity]=rdv@@array[champ]=date_rdv_debut@@array[operateur]=inferieur@@array[choice]=01/01/2022@@array[par_ouvert]=0@@array[par_ferme]=0@@begin@@array[ou_et]=AND@@array[entity]=rdv@@array[champ]=statut_rdv@@array[operateur]=egal@@array[choice_is_array]=3@@array[par_ouvert]=0@@array[par_ferme]=0@@begin@@array[ou_et]=AND@@array[entity]=demande_detail@@array[champ]=id_type_demande@@array[operateur]=egal@@array[choice_is_array]=2@@array[par_o