(353, 'SELECT demande.id_demande as id_demande_id, demande.date as date_demande, joinliste_id_demande_statut.label as id_demande_statut , CONCAT (joinliste_utilisateur_demande.nom,\' \',joinliste_utilisateur_demande.prenom) as utilisateur_demande , demande.nom as nom_demande, joinliste_demande_moyen_contact.label as demande_moyen_contact , ( SELECT COUNT(rdvt_count.id_demande) FROM demande_rdv as rdvt_count WHERE rdvt_count.id_demande=demande.id_demande ) as total_rdv, ( SELECT GROUP_CONCAT( liste_th_visite.label)  FROM liste_th_visite WHERE  FIND_IN_SET (liste_th_visite.id,demande_caracteristique.id_visite)) as demande_id_visite, joinliste_demande_id_thematique_principal.label as demande_id_thematique_principal , ( SELECT GROUP_CONCAT( liste_thematique.label)  FROM liste_thematique WHERE  FIND_IN_SET (liste_thematique.id,demande_caracteristique.id_thematique_secondaire)) as demande_id_thematique_secondaire, CONCAT (joinliste_adresse_fr_cp.cp,\' \',joinliste_adresse_fr_cp.localite_fr,\' \',joinliste_adresse_fr_cp.localite_nl_select) as adresse_fr_cp , joinliste_id_nombre_bien.label as id_nombre_bien , joinliste_id_chauffage_bien.label as id_chauffage_bien  FROM demande LEFT JOIN personne_bien ON personne_bien.id_demande=demande.id_demande LEFT JOIN encodage ON encodage.id_encodage=demande.id_encodage   LEFT JOIN demande_rdv ON demande_rdv.id_demande=demande.id_demande LEFT JOIN rdv ON demande_rdv.id_rdv=rdv.id_rdv  LEFT JOIN demande_caracteristique ON demande_caracteristique.id_demande=personne_bien.id_demande  LEFT JOIN bien ON bien.id_bien=personne_bien.id_bien LEFT JOIN bien_caracteristique ON bien_caracteristique.id_bien=personne_bien.id_bien  LEFT JOIN liste_demande_statut as joinliste_id_demande_statut ON  joinliste_id_demande_statut.id=demande.id_demande_statut  LEFT JOIN users as joinliste_utilisateur_demande ON  joinliste_utilisateur_demande.id_user=demande.id_utilisateur  LEFT JOIN liste_moyen_contact as joinliste_demande_moyen_contact ON  joinliste_demande_moyen_contact.id=demande.moyen_contact  LEFT JOIN liste_th_visite as joinliste_demande_id_visite ON  joinliste_demande_id_visite.id=demande_caracteristique.id_visite  LEFT JOIN liste_thematique as joinliste_demande_id_thematique_principal ON  joinliste_demande_id_thematique_principal.id=demande_caracteristique.id_thematique_principal  LEFT JOIN liste_thematique as joinliste_demande_id_thematique_secondaire ON  joinliste_demande_id_thematique_secondaire.id=demande_caracteristique.id_thematique_secondaire  LEFT JOIN liste_cp_brugis as joinliste_adresse_fr_cp ON  joinliste_adresse_fr_cp.cp=bien.adresse_fr_cp  LEFT JOIN liste_bien_nombre_logement as joinliste_id_nombre_bien ON  joinliste_id_nombre_bien.label=bien.id_nombre_logement  LEFT JOIN liste_bien_chauffage as joinliste_id_chauffage_bien ON  joinliste_id_chauffage_bien.id=bien.id_chauffage  WHERE (( demande.id_type_demande  LIKE  \'2\') AND ( bien.id_type  LIKE  \'3\') )  AND  (  YEAR(demande.date)=2021 ) ', 'id_demande_id,date_demande,id_demande_statut,utilisateur_demande,nom_demande,demande_moyen_contact,count_rdv_demande,demande_id_visite,demande_id_thematique_principal,demande_id_thematique_secondaire,adresse_fr_cp,id_nombre_bien,id_chauffage_bien', '@@array[ou_et]=0@@array[entity]=demande_detail@@array[champ]=id_type_demande@@array[operateur]=egal@@array[choice_is_array]=2@@array[par_ouvert]=0@@array[par_ferme]=0@@begin@@array[ou_et]=AND@@array[entity]=bien@@array[champ]=id_type_bien_coche@@array[operateur]=egal@@array[choice_is_array]=3@@array[par_ouvert]=0@@array[par_ferme]=0', 'ou_et_%23%231=0&entity_%23%231=demande_caracteristique&champ_%23%231=id_type_demande&operateur_%23%231=egal&%23%231%23%23_value%5B%5D=2&par_ouvert_%23%231=0&par_ferme_%23%231=0&ou_et_%23%232=AND&entity_%23%232=bien&champ_%23%232=id_type_bien_coche&operateur_%23%232=egal&%23%232%23%23_value%5B%5D=3&par_ouvert_%23%232=0&par_ferme_%23%232=0&number=2&fields_select%5B%5D=nom_personne&id_demande_id&fields_select[]=date_demande&fields_se