(355, 'SELECT encodage.date_insert as encodage_date, CONCAT (joinliste_encodage_user_create.nom,\' \',joinliste_encodage_user_create.prenom) as encodage_user_create , ( SELECT GROUP_CONCAT( liste_demande_type.label)  FROM liste_demande_type WHERE  FIND_IN_SET (liste_demande_type.id,encodage.id_demande_type)) as encodage_demande_type, joinliste_encodage_moyen_contact.label as encodage_moyen_contact , joinliste_encodage_contact_duree_default.label as encodage_contact_duree_default , joinliste_encodage_contact_premier_default.label as encodage_contact_premier_default , (SELECT subject from fh_messagerie WHERE fh_messagerie.entity=\'demande\' AND fh_messagerie.id_entity=demande.id_demande ORDER BY fh_messagerie.date_created DESC LIMIT 1) as objet_note_interne, demande.nom as nom_demande, joinliste_id_demande_statut.label as id_demande_statut , demande.id_demande as id_demande_id FROM encodage LEFT JOIN demande ON encodage.id_encodage=demande.id_encodage  LEFT JOIN demande_caracteristique ON demande_caracteristique.id_demande=demande.id_demande  LEFT JOIN personne_bien ON personne_bien.id_demande=demande.id_demande  LEFT JOIN users as joinliste_encodage_user_create ON  joinliste_encodage_user_create.id_user=encodage.user_create  LEFT JOIN liste_demande_type as joinliste_encodage_demande_type ON  joinliste_encodage_demande_type.id=encodage.id_demande_type  LEFT JOIN liste_moyen_contact as joinliste_encodage_moyen_contact ON  joinliste_encodage_moyen_contact.id=encodage.moyen_contact  LEFT JOIN liste_contact_duree as joinliste_encodage_contact_duree_default ON  joinliste_encodage_contact_duree_default.id=encodage.duree_contact  LEFT JOIN liste_oui_non as joinliste_encodage_contact_premier_default ON  joinliste_encodage_contact_premier_default.id=encodage.is_premier_contact  LEFT JOIN liste_demande_statut as joinliste_id_demande_statut ON  joinliste_id_demande_statut.id=demande.id_demande_statut  WHERE (encodage.date_insert>\'2021-08-09\' )  AND  (  YEAR(encodage.date_insert)=2021 ) ', 'encodage_date,encodage_user_create,encodage_demande_type,encodage_moyen_contact,encodage_contact_duree_default,encodage_contact_premier_default,objet_note_interne,nom_demande,id_demande_statut,id_demande_id', '@@array[ou_et]=0@@array[entity]=encodage@@array[champ]=encodage_date@@array[operateur]=superieur@@array[choice]=09/08/2021@@array[par_ouvert]=0@@array[par_ferme]=0', 'ou_et_%23%231=0&entity_%23%231=encodage&champ_%23%231=encodage_date&operateur_%23%231=superieur&%23%231%23%23_value=09%2F08%2F2021&par_ouvert_%23%231=0&par_ferme_%23%231=0&number=1&fields_select%5B%5D=nom_personne&encodage_date&fields_select[]=encodage_user_create&fields_select[]=encodage_demande_type&fields_select[]=encodage_moyen_contact&fields_select[]=encodage_contact_duree_default&fields_select[]=encodage_contact_premier_default&fields_select[]=objet_note_interne&fields_select[]=nom_demande&fields_select[]=id_demande_statut&fields_select[]=id_demande_id', 112, '2021-08-31 14:09:56', 0, 'backtracking Paulina', 2021, 0, '', ''),
(356, 'SELECT encodage.date_insert as encodage_date, ( SELECT GROUP_CONCAT( liste_demande_type.label)  FROM liste_demande_type WHERE  FIND_IN_SET (liste_demande_type.id,encodage.id_demande_type)) as encodage_demande_type, joinliste_encodage_langue.label as encodage_langue , CONCAT (joinliste_encodage_user_create.nom,\' \',joinliste_encodage_user_create.prenom) as encodage_user_create , joinliste_encodage_rel_personne_bien.label as encodage_rel_personne_bien , CONCAT (joinliste_encodage_cp.cp,\' \',joinliste_encodage_cp.localite_fr,\' \',joinliste_encodage_cp.localite_nl_select) as encodage_cp , joinliste_encodage_origine_default.label as encodage_origine_default , joinliste_encodage_contact_premier_default.label as encodage_contact_premier_default , joinliste_encodage_contact_duree_default.label as encodage_contact_duree_default , joinliste_encodage_moyen_contact.label as encodage_moyen_contact , demande.id_demande as id_demande_id, CONCAT (joinliste_utilisateur_demande.nom,\' \',joinliste_utilisateur_demande.prenom) as utilisateur_demande , joinliste_id_demande_statut.label as id_demande_statut , demande.nom as nom_demande, demande.descriptif as descriptif_demande, (SELECT subject from fh_messagerie WHERE fh_messagerie.entity=\'demande\' AND fh_messagerie.id_entity=demande.id_demande ORDER BY fh_messagerie.date_created DESC LIMIT 1) as objet_note_interne, (SELECT content from fh_messagerie WHERE fh_messagerie.entity=\'demande\' AND fh_messagerie.id_entity=demande.id_demande ORDER BY fh_messagerie.date_created DESC LIMIT 1) as note_interne, joinliste_id_type_demande.label as id_type_demande , joinliste_demande_id_thematique_principal.label as demande_id_thematique_principal , joinliste_demande_id_type_accompagnement.label as demande_id_type_accompagnement , personne.id_personne as id_personne, personne.prenom as prenom_personne, personne.nom as nom_personne FROM encodage LEFT JOIN demande ON encodage.id_encodage=demande.id_encodage  LEFT JOIN demande_caracteristique ON demande_caracteristique.id_demande=demande.id_demande  LEFT JOIN personne_bien ON personne_bien.id_demande=demande.id_demande  LEFT JOIN personne ON personne.id_personne=encodage.id_personne   LEFT JOIN liste_demande_type as joinliste_encodage_demande_type ON  joinliste_encodage_demande_type.id=encodage.id_demande_type  LEFT JOIN liste_langue as joinliste_encodage_langue ON  joinliste_encodage_langue.id=encodage.lang_contact  LEFT JOIN users as joinliste_encodage_user_create ON  joinliste_encodage_user_create.id_user=encodage.user_create  LEFT JOIN liste_rel_personne_bien as joinliste_encodage_rel_personne_bien ON  joinliste_encodage_rel_personne_bien.id=encodage.rel_personne_bien  LEFT JOIN liste_cp_brugis as joinliste_encodage_cp ON  joinliste_encodage_cp.cp=encodage.localite  LEFT JOIN liste_demande_origine as joinliste_encodage_origine_default ON  joinliste_encodage_origine_default.id=encodage.demande_origine  LEFT JOIN liste_oui_non as joinliste_encodage_contact_premier_default ON  joinliste_encodage_contact_premier_default.id=encodage.is_premier_contact  LEFT JOIN liste_contact_duree as joinliste_encodage_contact_duree_default ON  joinliste_encodage_contact_duree_default.id=encodage.duree_contact  LEFT JOIN liste_moyen_contact as joinliste_encodage_moyen_contact ON  joinliste_encodage_moyen_contact.id=encodage.moyen_contact  LEFT JOIN users as joinliste_utilisateur_demande ON  joinliste_utilisateur_demande.id_user=demande.id_utilisateur  LEFT JOIN liste_demande_statut as joinliste_id_demande_statut ON  joinliste_id_demande_statut.id=demande.id_demande_statut  LEFT JOIN liste_demande_type as joinliste_id_type_demande ON  joinliste_id_type_demande.id=demande.id_type_demande  LEFT JOIN liste_thematique as joinliste_demande_id_thematique_principal ON  joinliste_demande_id_thematique_principal.id=demande_caracteristique.id_thematique_principal  LEFT JOIN liste_type_accompagnement as joinliste_demande_id_type_accompagnement ON  joinliste_demande_id_type_accompagnement.id=demande_caracteristique.id_type_accompagnement  WHERE (encodage.date_insert>\'2021-07-01\' )  AND  (  YEAR(encodage.date_insert)=2021 ) ', 'encodage_date,encodage_demande_type,encodage_langue,encodage_user_create,encodage_rel_personne_bien,encodage_cp,encodage_origine_default,encodage_contact_premier_default,encodage_contact_duree_default,encodage_moyen_contact,id_demande_id,utilisateur_demande,id_demande_statut,nom_demande,descriptif_demande,objet_note_interne,note_interne,id_type_demande,demande_id_thematique_principal,demande_id_type_accompagnement,id_personne,prenom_personne,nom_personne', '@@array[ou_et]=0@@array[entity]=encodage@@array[champ]=encodage_date@@array[operateur]=superieur@@array[choice]=01/07/2021@@array[par_ouvert]=0@@array[par_ferme]=0', 'ou_et_%23%231=0&entity_%23%231=encodage&champ_%23%231=encodage_date&operateur_%23%231=superieur&%23%231%23%23_value=01%2F07%2F2021&par_ouvert_%23%231=0&par_ferme_%23%231=0&number=1&fields_select%5B%5D=nom_personne&encodage_date&fields_select[]=encodage_demande_type&fields_select[]=encodage_langue&fields_select[]=encodage_user_create&fields_select[]=encodage_rel_personne_bien&fields_select[]=encodage_cp&fields_select[]=encodage_origine_default&fields_select[]=encodage_contact_premier_default&fields_select[]=encodage_contact_duree_default&fields_select[]=encodage_moyen_contact&fields_select[]=id_demande_id&fields_select[]=utilisateur_demande&fields_select[]=id_demande_statut&fields_select[]=nom_demande&fields_select[]=descriptif_demande&fields_select[]=objet_note_interne&fields_select[]=note_interne&fields_select[]=id_type_demande&fields_select[]=demande_id_thematique_principal&fields_select[]=demande_id_type_accompagnement&fields_select[]=id_personne&fields_select[]=prenom_personne&fields_select[]=nom_personne', 112, '2021-09-08 13:42:42', 0, 'TEST - nombre demande source \"autres\"', 2021, 0, '', ''),
(357, 'SELECT demande.id_demande as id_demande_id, demande.date as date_demande, joinliste_id_type_demande.label as id_type_demande , joinliste_id_demande_statut.label as id_demande_statut , CONCAT (joinliste_utilisateur_createur.nom,\' \',joinliste_utilisateur_createur.prenom) as utilisateur_createur , CONCAT (joinliste_utilisateur_demande.nom,\' \',joinliste_utilisateur_demande.prenom) as utilisateur_demande , demande.nom as nom_demande, personne.nom as nom_personne, personne.prenom as prenom_personne, personne.email as email_personne, personne.telephone as telephone_personne, bien.adresse_fr as adresse_fr_bien, CONCAT (joinliste_adresse_fr_cp.cp,\' \',joinliste_adresse_fr_cp.localite_fr,\' \',joinliste_adresse_fr_cp.localite_nl_select) as adresse_fr_cp , joinliste_demande_id_thematique_principal.label as demande_id_thematique_principal , ( SELECT GROUP_CONCAT( liste_th_patrimoine.label)  FROM liste_th_patrimoine WHERE  FIND_IN_SET (liste_th_patrimoine.id,demande_caracteristique.id_th_patrimoine)) as demande_id_th_patrimoine FROM demande LEFT JOIN personne_bien ON personne_bien.id_demande=demande.id_demande LEFT JOIN encodage ON encodage.id_encodage=demande.id_encodage   LEFT JOIN personne ON personne.id_personne=personne_bien.id_personne    LEFT JOIN bien ON bien.id_bien=personne_bien.id_bien LEFT JOIN bien_caracteristique ON bien_caracteristique.id_bien=personne_bien.id_bien  LEFT JOIN demande_caracteristique ON demande_caracteristique.id_demande=personne_bien.id_demande  LEFT JOIN liste_demande_type as joinliste_id_type_demande ON  joinliste_id_type_demande.id=demande.id_type_demande  LEFT JOIN liste_demande_statut as joinliste_id_demande_statut ON  joinliste_id_demande_statut.id=demande.id_demande_statut  LEFT JOIN users as joinliste_utilisateur_createur ON  joinliste_utilisateur_createur.id_user=demande.id_user_create  LEFT JOIN users as joinliste_utilisateur_demande ON  joinliste_utilisateur_demande.id_user=demande.id_utilisateur  LEFT JOIN liste_cp_brugis as joinliste_adresse_fr_cp ON  joinliste_adresse_fr_cp.cp=bien.adresse_fr_cp  LEFT JOIN liste_thematique as joinliste_demande_id_thematique_principal ON  joinliste_demande_id_thematique_principal.id=demande_caracteristique.id_thematique_principal  LEFT JOIN liste_th_patrimoine as joinliste_demande_id_th_patrimoine ON  joinliste_demande_id_th_patrimoine.id=demande_caracteristique.id_th_patrimoine  WHERE (( demande.id_type_demande  NOT LIKE  \'2\') AND ( demande_caracteristique.id_thematique_principal  LIKE  \'5\') AND ( demande_caracteristique.id_th_patrimoine  LIKE  \'13\') AND personne.nom NOT LIKE \'%Anonyme%\' )  AND  (  YEAR(demande.date)=2020 OR  YEAR(demande.date)=2021 ) ', 'id_demande_id,date_demande,id_type_demande,id_demande_statut,utilisateur_createur,utilisateur_demande,nom_demande,nom_personne,prenom_personne,email_personne,telephone_personne,adresse_fr_bien,adresse_fr_cp,demande_id_thematique_principal,demande_id_th_patrimoine', '@@array[ou_et]=0@@array[entity]=demande_detail@@array[champ]=id_type_demande@@array[operateur]=different@@array[choice_is_array]=2@@array[par_ouvert]=0@@array[par_ferme]=0@@begin@@array[ou_et]=AND@@array[entity]=demande_detail@@array[champ]=demande_id_thematique_principal@@array[operateur]=egal@@array[choice_is_array]=5@@array[par_ouvert]=0@@array[par_ferme]=0@@begin@@array[ou_et]=AND@@array[entity]=demande_detail@@array[champ]=demande_id_th_patrimoine@@array[operateur]=egal@@array[choice_is_array]=13@@array[par_ouvert]=0@@array[par_ferme]=0@@begin@@array[ou_et]=AND@@array[entity]=personne@@array[champ]=nom_personne@@array[operateur]=contient_pas@@array[choice]=Anonyme@@array[par_ouvert]=0@@array[par_ferme]=0', 'ou_et_%23%231=0&entity_%23%231=demande_caracteristique&champ_%23%231=id_type_demande&operateur_%23%231=different&%23%231%23%23_value%5B%5D=2&par_ouvert_%23%231=0&par_ferme_%23%231=0&ou_et_%23%232=AND&entity_%23%232=demande_caracteristique&champ_%23%232=demande_id_thematique_principal&operateur_%23%232=egal&%23%232%23%23_