(359, 'SELECT demande.id_demande as id_demande_id, demande.date as date_demande, demande.nom as nom_demande, joinliste_demande_th_regularisation.label as demande_th_regularisation , ( SELECT GROUP_CONCAT( liste_permis.label)  FROM liste_permis WHERE  FIND_IN_SET (liste_permis.id,demande_caracteristique.id_objet_permis)) as demande_id_objet_permis, ( SELECT GROUP_CONCAT( liste_permis_raison.label)  FROM liste_permis_raison WHERE  FIND_IN_SET (liste_permis_raison.id,demande_caracteristique.id_raison_permis)) as demande_id_raison_permis, CONCAT (joinliste_adresse_fr_cp.cp,\' \',joinliste_adresse_fr_cp.localite_fr,\' \',joinliste_adresse_fr_cp.localite_nl_select) as adresse_fr_cp , rdv.id_rdv as id_rdv, ( SELECT GROUP_CONCAT( CONCAT ( users.nom,\' \',users.prenom))  as label_affiche  FROM users WHERE  FIND_IN_SET (users.id_user,rdv.id_user_rdv)) as user_rdv_multi, joinliste_type_rdv.label as type_rdv , rdv.titre as titre_rdv, joinliste_statut_rdv.label as statut_rdv , rdv.date_rdv_debut as date_rdv_debut FROM rdv LEFT JOIN demande_rdv ON demande_rdv.id_rdv=rdv.id_rdv   LEFT JOIN demande ON demande_rdv.id_demande=demande.id_demande  LEFT JOIN demande_caracteristique ON demande_caracteristique.id_demande=demande.id_demande  LEFT JOIN encodage ON encodage.id_encodage=demande.id_encodage   LEFT JOIN personne_bien ON personne_bien.id_demande=demande.id_demande  LEFT JOIN personne ON personne.id_personne=personne_bien.id_personne  LEFT JOIN bien ON bien.id_bien=personne_bien.id_bien LEFT JOIN bien_caracteristique ON bien_caracteristique.id_bien=bien.id_bien    LEFT JOIN liste_oui_non as joinliste_demande_th_regularisation ON  joinliste_demande_th_regularisation.id=demande_caracteristique.id_th_regularisation  LEFT JOIN liste_permis as joinliste_demande_id_objet_permis ON  joinliste_demande_id_objet_permis.id=demande_caracteristique.id_objet_permis  LEFT JOIN liste_permis_raison as joinliste_demande_id_raison_permis ON  joinliste_demande_id_raison_permis.id=demande_caracteristique.id_raison_permis  LEFT JOIN liste_cp_brugis as joinliste_adresse_fr_cp ON  joinliste_adresse_fr_cp.cp=bien.adresse_fr_cp  LEFT JOIN users as joinliste_user_rdv_multi ON  joinliste_user_rdv_multi.id_user=rdv.id_user_rdv  LEFT JOIN liste_rdv_type as joinliste_type_rdv ON  joinliste_type_rdv.id=rdv.id_type_rdv  LEFT JOIN liste_rdv_statut as joinliste_statut_rdv ON  joinliste_statut_rdv.id=rdv.id_statut_rdv  WHERE (( rdv.id_statut_rdv  LIKE  \'3\') AND rdv.date_rdv_debut>\'2021-01-01\' AND rdv.date_rdv_debut<\'2022-01-01\' AND ( demande_caracteristique.id_type_accompagnement  LIKE  \'2\') )  AND  (  YEAR(rdv.date_insert)=2021 ) ', 'id_demande_id,date_demande,nom_demande,demande_th_regularisation,demande_id_objet_permis,demande_id_raison_permis,adresse_fr_cp,id_rdv,user_rdv_multi,type_rdv,titre_rdv,statut_rdv,date_rdv_debut', '@@array[ou_et]=0@@array[entity]=rdv@@array[champ]=statut_rdv@@array[operateur]=egal@@array[choice_is_array]=3@@array[par_ouvert]=0@@array[par_ferme]=0@@begin@@array[ou_et]=AND@@array[entity]=rdv@@array[champ]=date_rdv_debut@@array[operateur]=superieur@@array[choice]=01/01/2021@@array[par_ouvert]=0@@array[par_ferme]=0@@begin@@array[ou_et]=AND@@array[entity]=rdv@@array[champ]=date_rdv_debut@@array[operateur]=inferieur@@array[choice]=01/01/2022@@array[par_ouvert]=0@@array[par_ferme]=0@@begin@@array[ou_et]=AND@@array[entity]=demande_detail@@array[champ]=demande_id_type_accompagnement@@array[operateur]=egal@@array[choice_is_array]=2@@array[par_ouvert]=0@@array[par_ferme]=0', 'ou_et_%23%231=0&entity_%23%231=rdv&champ_%23%231=statut_rdv&operateur_%23%231=egal&%23%231%23%23_value%5B%5D=3&par_ouvert_%23%231=0&par_ferme_%23%231=0&ou_et_%23%232=AND&entity_%23%232=rdv&champ_%23%232=date_rdv_debut&operateur_%23%232=superieur&%23%232%23%23_value=01%2F01%2F2021&par_ouvert_%23%232=0&par_ferme_%23%232=0&ou_et_%23%233=AND&entity_%23%233=rdv&champ_%23%233=date_rdv_debut&operateur_%23%233=inferieur&%23%233%23%23_value=01%2F01%2F2022&par_ouvert_%23%233=0&par_ferme