_id_raison_permis.id=demande_caracteristique.id_raison_permis  LEFT JOIN liste_cp_brugis as joinliste_adresse_fr_cp ON  joinliste_adresse_fr_cp.cp=bien.adresse_fr_cp  LEFT JOIN users as joinliste_user_rdv_multi ON  joinliste_user_rdv_multi.id_user=rdv.id_user_rdv  LEFT JOIN liste_demande_statut as joinliste_id_demande_statut ON  joinliste_id_demande_statut.id=demande.id_demande_statut  LEFT JOIN users as joinliste_utilisateur_demande ON  joinliste_utilisateur_demande.id_user=demande.id_utilisateur  WHERE (( rdv.id_statut_rdv  LIKE  \'3\') AND rdv.date_rdv_debut>\'2021-01-01\' AND rdv.date_rdv_debut<\'2022-01-01\' AND ( demande_caracteristique.id_type_accompagnement  LIKE  \'2\') )  AND  (  YEAR(rdv.date_insert)=2021 ) ', 'id_demande_id,date_demande,nom_demande,demande_th_regularisation,demande_id_objet_permis,demande_id_raison_permis,adresse_fr_cp,date_rdv_debut,user_rdv_multi,id_demande_statut,utilisateur_demande', '@@array[ou_et]=0@@array[entity]=rdv@@array[champ]=statut_rdv@@array[operateur]=egal@@array[choice_is_array]=3@@array[par_ouvert]=0@@array[par_ferme]=0@@begin@@array[ou_et]=AND@@array[entity]=rdv@@array[champ]=date_rdv_debut@@array[operateur]=superieur@@array[choice]=01/01/2021@@array[par_ouvert]=0@@array[par_ferme]=0@@begin@@array[ou_et]=AND@@array[entity]=rdv@@array[champ]=date_rdv_debut@@array[operateur]=inferieur@@array[choice]=01/01/2022@@array[par_ouvert]=0@@array[par_ferme]=0@@begin@@array[ou_et]=AND@@array[entity]=demande_detail@@array[champ]=demande_id_type_accompagnement@@array[operateur]=egal@@array[choice_is_array]=2@@array[par_ouvert]=0@@array[par_ferme]=0', 'ou_et_%23%231=0&entity_%23%231=rdv&champ_%23%231=statut_rdv&operateur_%23%231=egal&%23%231%23%23_value%5B%5D=3&par_ouvert_%23%231=0&par_ferme_%23%231=0&ou_et_%23%232=AND&entity_%23%232=rdv&champ_%23%232=date_rdv_debut&operateur_%23%232=superieur&%23%232%23%23_value=01%2F01%2F2021&par_ouvert_%23%232=0&par_ferme_%23%232=0&ou_et_%23%233=AND&entity_%23%233=rdv&champ_%23%233=date_rdv_debut&o