(361, 'SELECT demande.id_demande as id_demande_id, demande.date as date_demande, joinliste_id_demande_statut.label as id_demande_statut , joinliste_id_type_demande.label as id_type_demande , ( SELECT GROUP_CONCAT( liste_th_visite.label)  FROM liste_th_visite WHERE  FIND_IN_SET (liste_th_visite.id,demande_caracteristique.id_visite)) as demande_id_visite, joinliste_demande_id_type_accompagnement.label as demande_id_type_accompagnement , joinliste_demande_id_thematique_principal.label as demande_id_thematique_principal , ( SELECT GROUP_CONCAT( liste_thematique.label)  FROM liste_thematique WHERE  FIND_IN_SET (liste_thematique.id,demande_caracteristique.id_thematique_secondaire)) as demande_id_thematique_secondaire, ( SELECT GROUP_CONCAT( liste_th_prime.label)  FROM liste_th_prime WHERE  FIND_IN_SET (liste_th_prime.id,demande_caracteristique.id_th_prime)) as demande_id_prime, ( SELECT GROUP_CONCAT( liste_th_energie.label)  FROM liste_th_energie WHERE  FIND_IN_SET (liste_th_energie.id,demande_caracteristique.id_th_energie)) as demande_id_th_energie, ( SELECT GROUP_CONCAT( liste_ths_energie_renouvable.label)  FROM liste_ths_energie_renouvable WHERE  FIND_IN_SET (liste_ths_energie_renouvable.id,demande_caracteristique.id_ths_energie_renouvelable)) as demande_id_ths_energie_renouvelable, demande.nom as nom_demande, COUNT(DISTINCT rdv.id_rdv) as count_rdv, CONCAT (joinliste_adresse_fr_cp.cp,\' \',joinliste_adresse_fr_cp.localite_fr,\' \',joinliste_adresse_fr_cp.localite_nl_select) as adresse_fr_cp , CONCAT (joinliste_encodage_user_create.nom,\' \',joinliste_encodage_user_create.prenom) as encodage_user_create , CONCAT (joinliste_utilisateur_demande.nom,\' \',joinliste_utilisateur_demande.prenom) as utilisateur_demande  FROM demande LEFT JOIN personne_bien ON personne_bien.id_demande=demande.id_demande LEFT JOIN encodage ON encodage.id_encodage=demande.id_encodage   LEFT JOIN demande_caracteristique ON demande_caracteristique.id_demande=demande.id_demande  LEFT JOIN demande_rdv ON demande_rdv.id_demande=demande.id_demande LEFT JOIN rdv ON demande_rdv.id_rdv=rdv.id_rdv  LEFT JOIN bien ON bien.id_bien=personne_bien.id_bien  LEFT JOIN liste_demande_statut as joinliste_id_demande_statut ON  joinliste_id_demande_statut.id=demande.id_demande_statut  LEFT JOIN liste_demande_type as joinliste_id_type_demande ON  joinliste_id_type_demande.id=demande.id_type_demande  LEFT JOIN liste_th_visite as joinliste_demande_id_visite ON  joinliste_demande_id_visite.id=demande_caracteristique.id_visite  LEFT JOIN liste_type_accompagnement as joinliste_demande_id_type_accompagnement ON  joinliste_demande_id_type_accompagnement.id=demande_caracteristique.id_type_accompagnement  LEFT JOIN liste_thematique as joinliste_demande_id_thematique_principal ON  joinliste_demande_id_thematique_principal.id=demande_caracteristique.id_thematique_principal  LEFT JOIN liste_thematique as joinliste_demande_id_thematique_secondaire ON  joinliste_demande_id_thematique_secondaire.id=demande_caracteristique.id_thematique_secondaire  LEFT JOIN liste_th_prime as joinliste_demande_id_prime ON  joinliste_demande_id_prime.id=demande_caracteristique.id_th_prime  LEFT JOIN liste_th_energie as joinliste_demande_id_th_energie ON  joinliste_demande_id_th_energie.id=demande_caracteristique.id_th_energie  LEFT JOIN liste_ths_energie_renouvable as joinliste_demande_id_ths_energie_renouvelable ON  joinliste_demande_id_ths_energie_renouvelable.id=demande_caracteristique.id_ths_energie_renouvelable  LEFT JOIN liste_cp_brugis as joinliste_adresse_fr_cp ON  joinliste_adresse_fr_cp.cp=bien.adresse_fr_cp  LEFT JOIN users as joinliste_encodage_user_create ON  joinliste_encodage_user_create.id_user=encodage.user_create  LEFT JOIN users as joinliste_utilisateur_demande ON  joinliste_utilisateur_demande.id_user=demande.id_utilisateur  WHERE ((demande.id_demande IS NOT NULL AND demande.id_demande!=\'\') AND ( demande_caracteristique.id_th_energie  LIKE  \'9\' OR  demande_caracteristique.id_th_energie  LIKE  \'9,%\'  OR  demande_caracteristique.id_th_energie  LIKE  \'%,9\'  OR  demande_caracteristique.id_th_energie  LIKE  \'%,9,%\') )  AND  (  YEAR(demande.date)=2020 )  GROUP BY demande.id_demande ', 'id_demande_id,date_demande,id_demande_statut,id_type_demande,demande_id_visite,demande_id_type_accompagnement,demande_id_thematique_principal,demande_id_thematique_secondaire,demande_id_prime,demande_id_th_energie,demande_id_ths_energie_renouvelable,nom_demande,count_rdv,adresse_fr_cp,encodage_user_create,utilisateur_demande', '@@array[ou_et]=0@@array[entity]=demande@@array[champ]=id_demande_id@@array[operateur]=vide_pas@@array[choice]=@@array[par_ouvert]=0@@array[par_ferme]=0@@begin@@array[ou_et]=AND@@array[entity]=demande_detail@@array[champ]=demande_id_th_energie@@array[operateur]=contient@@array[choice_is_array]=9@@array[par_ouvert]=0@@array[par_ferme]=0', 'ou_et_%23%231=0&entity_%23%231=demande&champ_%23%231=id_demande_id&operateur_%23%231=vide_pas&%23%231%23%23_value=&par_ouvert_%23%231=0&par_ferme_%23%231=0&ou_et_%23%232=AND&entity_%23%232=demande_caracteristique&champ_%23%232=demande_id_th_energie&operateur_%23%232=contient&%23%232%23%23_value%5B%5D=9&par_ouvert_%23%232=0&par_ferme_%23%232=0&number=2&fields_select%5B%5D=nom_personne&id_demande_id&fields_select[]=date_demande&fields_select[]=id_demande_statut&fields_select[]=id_type_demande&fields_select[]=demande_id_visite&fields_select[]=demande_id_type_accompagnement&fields_select[]=demande_id_thematique_principal&fields_select[]=demande_id_thematique_secondaire&fields_select[]=demande_id_prime&fields_select[]=demande_id_th_energie&fields_select[]=demande_id_ths_energie_renouvelable&fields_select[]=nom_demande&fields_select[]=count_rdv&fields_select[]=adresse_fr_cp&fields_select[]=encodage_user_create&fields_select[]=utilisateur_demande', 65, '2021-11-23 14:19:34', 0, 'STAT - Demandes ER 2021', 2020, 0, 'id_demande_id', 'demande.id_demande'),
