(383, 'SELECT demande.id_demande as id_demande_id, demande.date as date_demande, demande.nom as nom_demande, joinliste_demande_th_regularisation.label as demande_th_regularisation , ( SELECT GROUP_CONCAT( liste_permis.label)  FROM liste_permis WHERE  FIND_IN_SET (liste_permis.id,demande_caracteristique.id_objet_permis)) as demande_id_objet_permis, ( SELECT GROUP_CONCAT( liste_permis_raison.label)  FROM liste_permis_raison WHERE  FIND_IN_SET (liste_permis_raison.id,demande_caracteristique.id_raison_permis)) as demande_id_raison_permis, CONCAT (joinliste_adresse_fr_cp.cp,\' \',joinliste_adresse_fr_cp.localite_fr,\' \',joinliste_adresse_fr_cp.localite_nl_select) as adresse_fr_cp , rdv.id_rdv as id_rdv, ( SELECT GROUP_CONCAT( CONCAT ( users.nom,\' \',users.prenom))  as label_affiche  FROM users WHERE  FIND_IN_SET (users.id_user,rdv.id_user_rdv)) as user_rdv_multi, joinliste_type_rdv.label as type_rdv , rdv.titre as titre_rdv, joinliste_statut_rdv.label as statut_rdv , rdv.date_rdv_debut as date_rdv_debut FROM rdv LEFT JOIN demande_rdv ON demande_rdv.id_rdv=rdv.id_rdv   LEFT JOIN demande ON demande_rdv.id_demande=demande.id_demande  LEFT JOIN demande_caracteristique ON demande_caracteristique.id_demande=demande.id_demande  LEFT JOIN encodage ON encodage.id_encodage=demande.id_encodage   LEFT JOIN personne_bien ON personne_bien.id_demande=demande.id_demande  LEFT JOIN personne ON personne.id_personne=personne_bien.id_personne  LEFT JOIN bien ON bien.id_bien=personne_bien.id_bien LEFT JOIN bien_caracteristique ON bien_caracteristique.id_bien=bien.id_bien    LEFT JOIN liste_oui_non as joinliste_demande_th_regularisation ON  joinliste_demande_th_regularisation.id=demande_caracteristique.id_th_regularisation  LEFT JOIN liste_permis as joinliste_demande_id_objet_permis ON  joinliste_demande_id_objet_permis.id=demande_caracteristique.id_objet_permis  LEFT JOIN liste_permis_raison as joinliste_demande_id_raison_permis ON  joinliste_demande_id_raison_permis.id=demande_caracterist