(384, 'SELECT CONCAT (joinliste_utilisateur_demande.nom,\' \',joinliste_utilisateur_demande.prenom) as utilisateur_demande , COUNT(DISTINCT demande.id_demande) as count_demande , COUNT(DISTINCT rdv.id_rdv) as count_rdv FROM demande LEFT JOIN personne_bien ON personne_bien.id_demande=demande.id_demande LEFT JOIN encodage ON encodage.id_encodage=demande.id_encodage   LEFT JOIN demande_rdv ON demande_rdv.id_demande=demande.id_demande LEFT JOIN rdv ON demande_rdv.id_rdv=rdv.id_rdv  LEFT JOIN users as joinliste_utilisateur_demande ON  joinliste_utilisateur_demande.id_user=demande.id_utilisateur  WHERE ((demande.id_demande IS NOT NULL AND demande.id_demande!=\'\') )  AND  (  YEAR(demande.date)=2022 )  GROUP BY demande.id_utilisateur ', 'utilisateur_demande,count_demande,count_rdv', '@@array[ou_et]=0@@array[entity]=demande@@array[champ]=id_demande_id@@array[operateur]=vide_pas@@array[choice]=@@array[par_ouvert]=0@@array[par_ferme]=0', 'ou_et_%23%231=0&entity_%23%231=demande&champ_%23%231=id_demande_id&operateur_%23%231=vide_pas&%23%231%23%23_value=&par_ouvert_%23%231=0&par_ferme_%23%231=0&number=1&fields_select%5B%5D=nom_personne&utilisateur_demande&fields_select[]=count_demande&fields_select[]=count_rdv', 112, '2022-03-14 13:50:59', 1, 'GENE - Nombres Demandes (2022) / Conseiller', 2022, 0, 'utilisateur_demande', 'demande.id_utilisateur'),
