 joinliste_demande_id_prime ON  joinliste_demande_id_prime.id=demande_caracteristique.id_th_prime  LEFT JOIN liste_objet_pvb as joinliste_demande_id_objet_pvb ON  joinliste_demande_id_objet_pvb.id=demande_caracteristique.id_objet_pvb  LEFT JOIN liste_credit_pvb as joinliste_demande_id_credit_pvb ON  joinliste_demande_id_credit_pvb.id=demande_caracteristique.id_credit_pvb  LEFT JOIN liste_revenu as joinliste_demande_id_revenu ON  joinliste_demande_id_revenu.id=demande_caracteristique.id_revenu  LEFT JOIN liste_cp_brugis as joinliste_adresse_fr_cp ON  joinliste_adresse_fr_cp.cp=bien.adresse_fr_cp  LEFT JOIN liste_langue as joinliste_encodage_langue ON  joinliste_encodage_langue.id=encodage.lang_contact  WHERE (demande.date>\'2022-01-01\' AND demande.date<\'2023-01-01\' AND ( demande_caracteristique.id_type_accompagnement  LIKE  \'1\' OR  demande_caracteristique.id_type_accompagnement  LIKE  \'8\') )  AND  (  YEAR(demande.date)=2022 ) ', 'id_demande_id,date_demande,id_demande_statut,utilisateur_demande,nom_demande,id_type_demande,demande_id_prime,demande_id_objet_pvb,demande_date_pvb,demande_id_credit_pvb,demande_id_revenu,prenom_personne,nom_personne,adresse_fr_bien,adresse_fr_cp,encodage_langue', '@@array[ou_et]=0@@array[entity]=demande@@array[champ]=date_demande@@array[operateur]=superieur@@array[choice]=01/01/2022@@array[par_ouvert]=0@@array[par_ferme]=0@@begin@@array[ou_et]=AND@@array[entity]=demande@@array[champ]=date_demande@@array[operateur]=inferieur@@array[choice]=01/01/2023@@array[par_ouvert]=0@@array[par_ferme]=0@@begin@@array[ou_et]=AND@@array[entity]=demande_detail@@array[champ]=demande_id_type_accompagnement@@array[operateur]=egal@@array[choice_is_array]=1,8@@array[par_ouvert]=0@@array[par_ferme]=0', 'ou_et_%23%231=0&entity_%23%231=demande&champ_%23%231=date_demande&operateur_%23%231=superieur&%23%231%23%23_value=01%2F01%2F2022&par_ouvert_%23%231=0&par_ferme_%23%231=0&ou_et_%23%232=AND&entity_%23%232=demande&champ_%23%232=date_demande&operateur_%23%232=i