(399, 'SELECT demande.id_demande as id_demande_id, demande.nom as nom_demande, demande.descriptif as descriptif_demande, ( SELECT GROUP_CONCAT( liste_thematique.label)  FROM liste_thematique WHERE  FIND_IN_SET (liste_thematique.id,demande_caracteristique.id_thematique_secondaire)) as demande_id_thematique_secondaire, ( SELECT GROUP_CONCAT( liste_th_accompagnement.label)  FROM liste_th_accompagnement WHERE  FIND_IN_SET (liste_th_accompagnement.id,demande_caracteristique.id_th_accompagnement)) as demande_id_accompagnement, joinliste_langue_personne.label as langue_personne , personne.nom as nom_personne, CONCAT (joinliste_adresse_fr_cp.cp,\' \',joinliste_adresse_fr_cp.localite_fr,\' \',joinliste_adresse_fr_cp.localite_nl_select) as adresse_fr_cp , joinliste_id_type_bien_coche.label as id_type_bien_coche , bien.adresse_fr as adresse_fr_bien, joinliste_id_type_demande.label as id_type_demande , ( SELECT GROUP_CONCAT( liste_th_visite.label)  FROM liste_th_visite WHERE  FIND_IN_SET (liste_th_visite.id,demande_caracteristique.id_visite)) as demande_id_visite, joinliste_id_demande_statut.label as id_demande_statut , joinliste_demande_pole.label as demande_pole , (SELECT dem.date_modification FROM demande_h as dem WHERE dem.index=\'demande_pole\' AND dem.id_entity=demande.id_demande ORDER BY dem.date_modification ASC LIMIT 1) as date_attribution , CONCAT (joinliste_utilisateur_demande.nom,\' \',joinliste_utilisateur_demande.prenom) as utilisateur_demande , \r\n        CASE\r\n            WHEN (SELECT dem.date_modification FROM demande_h as dem WHERE dem.value_old = \'Homegrade\' AND dem.index=\'utilisateur_demande\' AND dem.id_entity=demande.id_demande ORDER BY dem.date_modification ASC LIMIT 1) \r\n                IS NOT NULL\r\n            THEN (SELECT dem.date_modification FROM demande_h as dem WHERE dem.value_old = \'Homegrade\' AND dem.index=\'utilisateur_demande\' AND dem.id_entity=demande.id_demande ORDER BY dem.date_modification ASC LIMIT 1) \r\n         ELSE \r\n            (SELECT dem.date FROM demande as dem WHERE dem.id_utilisateur != 25 AND dem.id_demande=demande.id_demande ORDER BY dem.date ASC LIMIT 1) \r\n         END as date_assignation \r\n        \r\n    , CONCAT (joinliste_utilisateur_createur.nom,\' \',joinliste_utilisateur_createur.prenom) as utilisateur_createur , demande.date as date_demande, joinliste_demande_moyen_contact.label as demande_moyen_contact , joinliste_demande_id_type_accompagnement.label as demande_id_type_accompagnement , joinliste_demande_id_thematique_principal.label as demande_id_thematique_principal , ( SELECT GROUP_CONCAT( liste_th_acoustique.label)  FROM liste_th_acoustique WHERE  FIND_IN_SET (liste_th_acoustique.id,demande_caracteristique.id_th_acoustique)) as demande_id_th_acoustique, ( SELECT GROUP_CONCAT( liste_th_energie.label)  FROM liste_th_energie WHERE  FIND_IN_SET (liste_th_energie.id,demande_caracteristique.id_th_energie)) as demande_id_th_energie, ( SELECT GROUP_CONCAT( liste_th_logement.label)  FROM liste_th_logement WHERE  FIND_IN_SET (liste_th_logement.id,demande_caracteristique.id_th_logement)) as demande_id_th_logement, ( SELECT GROUP_CONCAT( liste_th_patrimoine.label)  FROM liste_th_patrimoine WHERE  FIND_IN_SET (liste_th_patrimoine.id,demande_caracteristique.id_th_patrimoine)) as demande_id_th_patrimoine, ( SELECT GROUP_CONCAT( liste_th_renovation.label)  FROM liste_th_renovation WHERE  FIND_IN_SET (liste_th_renovation.id,demande_caracteristique.id_th_renovation)) as demande_id_th_renovation, ( SELECT GROUP_CONCAT( liste_th_urbanisme.label)  FROM liste_th_urbanisme WHERE  FIND_IN_SET (liste_th_urbanisme.id,demande_caracteristique.id_th_urbanisme)) as demande_id_th_urbanisme, ( SELECT GROUP_CONCAT( liste_ths_batiment_durable.label)  FROM liste_ths_batiment_durable WHERE  FIND_IN_SET (liste_ths_batiment_durable.id,demande_caracteristique.id_ths_batiment_durable)) as demande_id_ths_batiment_durable, ( SELECT GROUP_CONCAT( liste_ths_petit_patrimoine_acc.label)  FROM liste_ths_petit_patrimoine_acc WHERE  FIND_IN_SET (liste_ths_petit_patrimoine_acc.id,demande_caracteristique.id_ths_petit_patrimoine_acc)) as demande_id_ths_petit_patrimoine_acc, joinliste_demande_origine_default.label as demande_origine_default , personne.prenom as prenom_personne, personne.telephone as telephone_personne, joinliste_id_type_info_conseil.label as id_type_info_conseil , joinliste_id_type_suivi_accompagnement.label as id_type_suivi_accompagnement  FROM demande LEFT JOIN personne_bien ON personne_bien.id_demande=demande.id_demande LEFT JOIN encodage ON encodage.id_encodage=demande.id_encodage   LEFT JOIN demande_caracteristique ON demande_caracteristique.id_demande=demande.id_demande  LEFT JOIN personne ON personne.id_personne=personne_bien.id_personne    LEFT JOIN bien ON bien.id_bien=personne_bien.id_bien  LEFT JOIN liste_thematique as joinliste_demande_id_thematique_secondaire ON  joinliste_demande_id_thematique_secondaire.id=demande_caracteristique.id_thematique_secondaire  LEFT JOIN liste_th_accompagnement as joinliste_demande_id_accompagnement ON  joinliste_demande_id_accompagnement.id=demande_caracteristique.id_th_accompagnement  LEFT JOIN liste_langue as joinliste_langue_personne ON  joinliste_langue_personne.id=personne.id_langue  LEFT JOIN liste_cp_brugis as joinliste_adresse_fr_cp ON  joinliste_adresse_fr_cp.cp=bien.adresse_fr_cp  LEFT JOIN liste_bien_type as joinliste_id_type_bien_coche ON  joinliste_id_type_bien_coche.id=bien.id_type  LEFT JOIN liste_demande_type as joinliste_id_type_demande ON  joinliste_id_type_demande.id=demande.id_type_demande  LEFT JOIN liste_th_visite as joinliste_demande_id_visite ON  joinliste_demande_id_visite.id=demande_caracteristique.id_visite  LEFT JOIN liste_demande_statut as joinliste_id_demande_statut ON  joinliste_id_demande_statut.id=demande.id_demande_statut  LEFT JOIN liste_pole as joinliste_demande_pole ON  joinliste_demande_pole.id=demande.id_pole  LEFT JOIN users as joinliste_utilisateur_demande ON  joinliste_utilisateur_demande.id_user=demande.id_utilisateur  LEFT JOIN users as joinliste_utilisateur_createur ON  joinliste_utilisateur_createur.id_user=demande.id_user_create  LEFT JOIN liste_moyen_contact as joinliste_demande_moyen_contact ON  joinliste_demande_moyen_contact.id=demande.moyen_contact  LEFT JOIN liste_type_accompagnement as joinliste_demande_id_type_accompagnement ON  joinliste_demande_id_type_accompagnement.id=demande_caracteristique.id_type_accompagnement  LEFT JOIN liste_thematique as joinliste_demande_id_thematique_principal ON  joinliste_demande_id_thematique_principal.id=demande_caracteristique.id_thematique_principal  LEFT JOIN liste_th_acoustique as joinliste_demande_id_th_acoustique ON  joinliste_demande_id_th_acoustique.id=demande_caracteristique.id_th_acoustique  LEFT JOIN liste_th_energie as joinliste_demande_id_th_energie ON  joinliste_demande_id_th_energie.id=demande_caracteristique.id_th_energie  LEFT JOIN liste_th_logement as joinliste_demande_id_th_logement ON  joinliste_demande_id_th_logement.id=demande_caracteristique.id_th_logement  LEFT JOIN liste_th_patrimoine as joinliste_demande_id_th_patrimoine ON  joinliste_demande_id_th_patrimoine.id=demande_caracteristique.id_th_patrimoine  LEFT JOIN liste_th_renovation as joinliste_demande_id_th_renovation ON  joinliste_demande_id_th_renovation.id=demande_caracteristique.id_th_renovation  LEFT JOIN liste_th_urbanisme as joinliste_demande_id_th_urbanisme ON  joinliste_demande_id_th_urbanisme.id=demande_caracteristique.id_th_urbanisme  LEFT JOIN liste_ths_batiment_durable as joinliste_demande_id_ths_batiment_durable ON  joinliste_demande_id_ths_batiment_durable.id=demande_caracteristique.id_ths_batiment_durable  LEFT JOIN liste_ths_petit_patrimoine_acc as joinliste_demande_id_ths_petit_patrimoine_acc ON  joinliste_demande_id_ths_petit_patrimoine_acc.id=demande_caracteristique.id_ths_petit_patrimoine_acc  LEFT JOIN liste_demande_origine as joinliste_demande_origine_default ON  joinliste_demande_origine_default.id=demande.demande_origine  LEFT JOIN liste_type_info_conseil as joinliste_id_type_info_conseil ON  joinliste_id_type_info_conseil.id=demande.id_type_info_conseil  LEFT JOIN liste_type_suivi_accompagnement as joinliste_id_type_suivi_accompagnement ON  joinliste_id_type_suivi_accompagnement.id=demande.id_type_suivi_accompagnement  WHERE ((demande.id_demande IS NOT NULL AND demande.id_demande!=\'\') AND ( demande.id_utilisateur  LIKE  \'25\') AND ( demande.id_demande_statut  LIKE  \'1\') AND personne.nom != \'ANONYME\' )  AND  (  YEAR(demande.date)=2022 OR  YEAR(demande.date)=2023 ) ', 'id_demande_id,nom_demande,descriptif_demande,demande_id_thematique_secondaire,demande_id_accompagnement,langue_personne,nom_personne,adresse_fr_cp,id_type_bien_coche,adresse_fr_bien,id_type_demande,demande_id_visite,id_demande_statut,demande_pole,date_attribution,utilisateur_demande,date_assignation,utilisateur_createur,date_demande,demande_moyen_contact,demande_id_type_accompagnement,demande_id_thematique_principal,demande_id_th_acoustique,demande_id_th_energie,demande_id_th_logement,demande_id_th_patrimoine,demande_id_th_renovation,demande_id_th_urbanisme,demande_id_ths_batiment_durable,demande_id_ths_petit_patrimoine_acc,demande_origine_default,prenom_personne,telephone_personne,id_type_info_conseil,id_type_suivi_accompagnement', '@@array[ou_et]=0@@array[entity]=demande@@array[champ]=id_demande_id@@array[operateur]=vide_pas@@array[choice]=@@array[par_ouvert]=0@@array[par_ferme]=0@@begin@@array[ou_et]=AND@@array[entity]=demande@@array[champ]=utilisateur_demande@@array[operateur]=egal@@array[choice_is_array]=25@@array[par_ouvert]=0@@array[par_ferme]=0@@begin@@array[ou_et]=AND@@array[entity]=demande@@array[champ]=id_demande_statut@@array[operateur]=egal@@array[choice_is_array]=1@@array[par_ouvert]=0@@array[par_ferme]=0@@begin@@array[ou_et]=AND@@array[entity]=personne@@array[champ]=nom_personne@@array[operateur]=different@@array[choice]=ANONYME@@array[par_ouvert]=0@@array[