(400, 'SELECT COUNT(DISTINCT demande.id_demande) as count_demande , COUNT(DISTINCT email_outlook.id_primary) as count_email  FROM email_outlook LEFT JOIN  email_outlook_lien ON email_outlook_lien.id_email=email_outlook.id_primary  LEFT JOIN demande ON email_outlook_lien.id_demande=demande.id_demande  LEFT JOIN demande_caracteristique ON demande_caracteristique.id_demande=demande.id_demande  LEFT JOIN encodage ON encodage.id_encodage=demande.id_encodage  LEFT JOIN personne_bien ON personne_bien.id_demande=demande.id_demande  LEFT JOIN personne ON personne.id_personne=personne_bien.id_personne  LEFT JOIN bien ON bien.id_bien=personne_bien.id_bien LEFT JOIN bien_caracteristique ON bien_caracteristique.id_bien=bien.id_bien   WHERE ((email_outlook.received_datetime IS NOT NULL AND email_outlook.received_datetime!=\'\') )  AND  (  YEAR(email_outlook.created_datetime)=2020 OR  YEAR(email_outlook.created_datetime)=2021 ) ', 'count_demande,count_email', '@@array[ou_et]=0@@array[entity]=email_outlook@@array[champ]=email_received_date@@array[operateur]=vide_pas@@array[choice]=@@array[par_ouvert]=0@@array[par_ferme]=0', 'ou_et_%23%231=0&entity_%23%231=email_outlook&champ_%23%231=email_received_date&operateur_%23%231=vide_pas&%23%231%23%23_value=&par_ouvert_%23%231=0&par_ferme_%23%231=0&number=1&fields_select%5B%5D=nom_personne&count_demande&fields_select[]=count_email', 24, '2022-06-23 20:08:47', 0, 'ADMIN-Nombre emails recus', 2020, 2021, '', ''),
