(405, 'SELECT demande.id_demande as id_demande_id, demande.date as date_demande, joinliste_id_demande_statut.label as id_demande_statut , CONCAT (joinliste_utilisateur_createur.nom,\' \',joinliste_utilisateur_createur.prenom) as utilisateur_createur , CONCAT (joinliste_utilisateur_demande.nom,\' \',joinliste_utilisateur_demande.prenom) as utilisateur_demande , joinliste_id_type_demande.label as id_type_demande , joinliste_demande_moyen_contact.label as demande_moyen_contact  FROM demande LEFT JOIN personne_bien ON personne_bien.id_demande=demande.id_demande LEFT JOIN encodage ON encodage.id_encodage=demande.id_encodage   LEFT JOIN liste_demande_statut as joinliste_id_demande_statut ON  joinliste_id_demande_statut.id=demande.id_demande_statut  LEFT JOIN users as joinliste_utilisateur_createur ON  joinliste_utilisateur_createur.id_user=demande.id_user_create  LEFT JOIN users as joinliste_utilisateur_demande ON  joinliste_utilisateur_demande.id_user=demande.id_utilisateur  LEFT JOIN liste_demande_type as joinliste_id_type_demande ON  joinliste_id_type_demande.id=demande.id_type_demande  LEFT JOIN liste_moyen_contact as joinliste_demande_moyen_contact ON  joinliste_demande_moyen_contact.id=demande.moyen_contact  WHERE (( demande.id_utilisateur  LIKE  \'25\') AND ( demande.id_demande_statut  LIKE  \'6\') AND ( demande.id_type_demande  LIKE  \'1\') AND ( encodage.moyen_contact  LIKE  \'4\') )  AND  (  YEAR(demande.date)=2022 ) ', 'id_demande_id,date_demande,id_demande_statut,utilisateur_createur,utilisateur_demande,id_type_demande,demande_moyen_contact', '@@array[ou_et]=0@@array[entity]=demande@@array[champ]=utilisateur_demande@@array[operateur]=egal@@array[choice_is_array]=25@@array[par_ouvert]=0@@array[par_ferme]=0@@begin@@array[ou_et]=AND@@array[entity]=demande@@array[champ]=id_demande_statut@@array[operateur]=egal@@array[choice_is_array]=6@@array[par_ouvert]=0@@array[par_ferme]=0@@begin@@array[ou_et]=AND@@array[entity]=demande_detail@@array[champ]=id_type_demande@@array[operateur]=egal@@array[choice_is_array]=1@@array[par_ouvert]=0@@array[par_ferme]=0@@begin@@array[ou_et]=AND@@array[entity]=encodage@@array[champ]=encodage_moyen_contact@@array[operateur]=egal@@array[choice_is_array]=4@@array[par_ouvert]=0@@array[par_ferme]=0', 'ou_et_%23%231=0&entity_%23%231=demande&champ_%23%231=utilisateur_demande&operateur_%23%231=egal&%23%231%23%23_value%5B%5D=25&par_ouvert_%23%231=0&par_ferme_%23%231=0&ou_et_%23%232=AND&entity_%23%232=demande&champ_%23%232=id_demande_statut&operateur_%23%232=egal&%23%232%23%23_value%5B%5D=6&par_ouvert_%23%232=0&par_ferme_%23%232=0&ou_et_%23%233=AND&entity_%23%233=demande_caracteristique&champ_%23%233=id_type_demande&operateur_%23%233=egal&%23%233%23%23_value%5B%5D=1&par_ouvert_%23%233=0&par_ferme_%23%233=0&ou_et_%23%234=AND&entity_%23%234=encodage&champ_%23%234=encodage_moyen_contact&operateur_%23%234=egal&%23%234%23%23_value%5B%5D=4&par_ouvert_%23%234=0&par_ferme_%23%234=0&number=4&fields_select%5B%5D=nom_personne&id_demande_id&fields_select[]=date_demande&fields_select[]=id_demande_statut&fields_select[]=utilisateur_createur&fields_select[]=utilisateur_demande&fields_select[]=id_type_demande&fields_select[]=demande_moyen_contact', 65, '2022-07-07 08:55:50', 0, 'ADMIN - Info clôturée venant mail assigné Homegrade', 2022, 0, '', ''),
(409, 'SELECT demande.id_demande as id_demande_id, demande.date as date_demande, CONCAT (joinliste_utilisateur_demande.nom,\' \',joinliste_utilisateur_demande.prenom) as utilisateur_demande , joinliste_id_type_demande.label as id_type_demande , ( SELECT GROUP_CONCAT( liste_th_visite.label)  FROM liste_th_visite WHERE  FIND_IN_SET (liste_th_visite.id,demande_caracteristique.id_visite)) as demande_id_visite, joinliste_demande_id_type_accompagnement.label as demande_id_type_accompagnement , joinliste_id_demande_statut.label as id_demande_statut , joinliste_langue_personne.label as langue_personne , joinliste_type_rdv.label as type_rdv , joinliste_statut_rdv.label as statut_rdv , joinliste_type_tache.label as type_tache , joinliste_statut_tache.label as statut_tache , COUNT(DISTINCT rdv.id_rdv) as count_rdv, COUNT(DISTINCT tache.id_tache) as count_tache, COUNT(DISTINCT email_outlook.id_primary) as count_email  FROM demande LEFT JOIN personne_bien ON personne_bien.id_demande=demande.id_demande LEFT JOIN encodage ON encodage.id_encodage=demande.id_encodage   LEFT JOIN demande_caracteristique ON demande_caracteristique.id_demande=demande.id_demande  LEFT JOIN personne ON personne.id_personne=personne_bien.id_personne    LEFT JOIN demande_rdv ON demande_rdv.id_demande=demande.id_demande LEFT JOIN rdv ON demande_rdv.id_rdv=rdv.id_rdv  LEFT JOIN demande_tache ON demande_tache.id_demande=demande.id_demande LEFT JOIN tache ON demande_tache.id_tache=tache.id_tache  LEFT JOIN email_outlook_lien ON email_outlook_lien.id_demande=demande.id_demande LEFT JOIN email_outlook ON email_outlook.id_primary=email_outlook_lien.id_email  LEFT JOIN users as joinliste_utilisateur_demande ON  joinliste_utilisateur_demande.id_user=demande.id_utilisateur  LEFT JOIN liste_demande_type as joinliste_id_type_demande ON  joinliste_id_type_demande.id=demande.id_type_demande  LEFT JOIN liste_th_visite as joinliste_demande_id_visite ON  joinliste_demande_id_visite.id=demande_caracteristique.id_visite  LEFT JOIN liste_type_accompagnement as joinliste_demande_id_type_accompagnement ON  joinliste_demande_id_type_accompagnement.id=demande_caracteristique.id_type_accompagnement  LEFT JOIN liste_demande_statut as joinliste_id_demande_statut ON  joinliste_id_demande_statut.id=demande.id_demande_statut  LEFT JOIN liste_langue as joinliste_langue_personne ON  joinliste_langue_personne.id=personne.id_langue  LEFT JOIN liste_rdv_type as joinliste_type_rdv ON  joinliste_type_rdv.id=rdv.id_type_rdv  LEFT JOIN liste_rdv_statut as joinliste_statut_rdv ON  joinliste_statut_rdv.id=rdv.id_statut_rdv  LEFT JOIN liste_tache_type as joinliste_type_tache ON  joinliste_type_tache.id=tache.id_type_tache  LEFT JOIN liste_tache_statut as joinliste_statut_tache ON  joinliste_statut_tache.id=tache.id_statut_tache  WHERE ((demande.id_demande IS NOT NULL AND demande.id_demande!=\'\') AND ( demande.id_utilisateur  NOT LIKE  \'25\') )  AND  (  YEAR(demande.date)=2022 )  GROUP BY demande.id_demande,demande.date,demande.id_utilisateur,demande.id_type_demande,demande_caracteristique.id_visite,demande_caracteristique.id_type_accompagnement,demande.id_demande_statut,personne.id_langue,rdv.id_type_rdv,rdv.id_statut_rdv,tache.id_type_tache,tache.id_statut_tache ', 'id_demande_id,date_demande,utilisateur_demande,id_type_demande,demande_id_visite,demande_id_type_accompagnement,id_demande_statut,langue_personne,type_rdv,statut_rdv,type_tache,statut_tache,count_rdv,count_tache,count_email', '@@array[ou_et]=0@@array[entity]=demande@@array[champ]=id_demande_id@@array[operateur]=vide_pas@@array[choice]=@@array[par_ouvert]=0@@array[par_ferme]=0@@begin@@array[ou_et]=AND@@array[entity]=demande@@array[champ]=utilisateur_demande@@array[operateur]=different@@array[choice_is_array]=25@@array[par_ouvert]=0@@array[par_ferme]=0', 'ou_et_%23%231=0&entity_%23%231=demande&champ_%23%231=id_demande_id&operateur_%23%231=vide_pas&%23%231%23%23_value=&par_ouvert_%23%231=0&par_ferme_%23%231=0&ou_et_%23%232=AND&entity_%23%232=dema