(433, 'SELECT encodage.date_insert as encodage_date, demande.id_demande as id_demande_id, personne.id_personne as id_personne, personne.prenom as prenom_personne, personne.nom as nom_personne, personne.email as email_personne, joinliste_langue_personne.label as langue_personne , bien.id_bien as id_bien, bien.adresse_fr as adresse_fr_bien, bien.adresse_nl as adresse_nl_bien, CONCAT (joinliste_adresse_fr_cp.cp,\' \',joinliste_adresse_fr_cp.localite_fr,\' \',joinliste_adresse_fr_cp.localite_nl_select) as adresse_fr_cp , joinliste_id_type_bien_coche.label as id_type_bien_coche , personne.telephone as telephone_personne, joinliste_id_type_demande.label as id_type_demande , joinliste_demande_id_thematique_principal.label as demande_id_thematique_principal , ( SELECT GROUP_CONCAT( liste_thematique.label)  FROM liste_thematique WHERE  FIND_IN_SET (liste_thematique.id,demande_caracteristique.id_thematique_secondaire)) as demande_id_thematique_secondaire, joinliste_id_demande_statut.label as id_demande_statut , joinliste_demande_pole.label as demande_pole , demande.nom as nom_demande, (SELECT content from fh_messagerie WHERE fh_messagerie.entity=\'demande\' AND fh_messagerie.id_entity=demande.id_demande ORDER BY fh_messagerie.date_created DESC LIMIT 1) as note_interne, CONCAT (joinliste_utilisateur_demande.nom,\' \',joinliste_utilisateur_demande.prenom) as utilisateur_demande , demande.descriptif as descriptif_demande, (SELECT subject from fh_messagerie WHERE fh_messagerie.entity=\'demande\' AND fh_messagerie.id_entity=demande.id_demande ORDER BY fh_messagerie.date_created DESC LIMIT 1) as objet_note_interne, joinliste_encodage_langue.label as encodage_langue , ( SELECT GROUP_CONCAT( liste_th_accompagnement.label)  FROM liste_th_accompagnement WHERE  FIND_IN_SET (liste_th_accompagnement.id,demande_caracteristique.id_th_accompagnement)) as demande_id_accompagnement, joinliste_id_type_info_conseil.label as id_type_info_conseil , joinliste_id_type_suivi_accompagnement.label as id_type_suivi_accompagnement , ( SELECT GROUP_CONCAT( liste_th_energie.label)  FROM liste_th_energie WHERE  FIND_IN_SET (liste_th_energie.id,demande_caracteristique.id_th_energie)) as demande_id_th_energie, ( SELECT GROUP_CONCAT( liste_th_renovation.label)  FROM liste_th_renovation WHERE  FIND_IN_SET (liste_th_renovation.id,demande_caracteristique.id_th_renovation)) as demande_id_th_renovation, ( SELECT GROUP_CONCAT( liste_ths_batiment_durable.label)  FROM liste_ths_batiment_durable WHERE  FIND_IN_SET (liste_ths_batiment_durable.id,demande_caracteristique.id_ths_batiment_durable)) as demande_id_ths_batiment_durable, ( SELECT GROUP_CONCAT( liste_th_acoustique.label)  FROM liste_th_acoustique WHERE  FIND_IN_SET (liste_th_acoustique.id,demande_caracteristique.id_th_acoustique)) as demande_id_th_acoustique, ( SELECT GROUP_CONCAT( liste_ths_isolation.label)  FROM liste_ths_isolation WHERE  FIND_IN_SET (liste_ths_isolation.id,demande_caracteristique.id_ths_isolation)) as demande_id_ths_isolation, ( SELECT GROUP_CONCAT( liste_ths_energie_renouvable.label)  FROM liste_ths_energie_renouvable WHERE  FIND_IN_SET (liste_ths_energie_renouvable.id,demande_caracteristique.id_ths_energie_renouvelable)) as demande_id_ths_energie_renouvelable, ( SELECT GROUP_CONCAT( liste_ths_peb.label)  FROM liste_ths_peb WHERE  FIND_IN_SET (liste_ths_peb.id,demande_caracteristique.id_ths_peb)) as demande_id_ths_peb, ( SELECT GROUP_CONCAT( liste_th_logement.label)  FROM liste_th_logement WHERE  FIND_IN_SET (liste_th_logement.id,demande_caracteristique.id_th_logement)) as demande_id_th_logement, ( SELECT GROUP_CONCAT( liste_ths_aide_locative.label)  FROM liste_ths_aide_locative WHERE  FIND_IN_SET (liste_ths_aide_locative.id,demande_caracteristique.id_ths_aide_locative)) as demande_id_ths_aide_locative, ( SELECT GROUP_CONCAT( liste_ths_aide_achat.label)  FROM liste_ths_aide_achat WHERE  FIND_IN_SET (liste_ths_aide_achat.id,demande_caracteristique.id_ths_aide_achat)) as demande_id_ths_aide_achat, ( SELE