bel as id_type_info_conseil  FROM demande LEFT JOIN personne_bien ON personne_bien.id_demande=demande.id_demande LEFT JOIN encodage ON encodage.id_encodage=demande.id_encodage   LEFT JOIN personne ON personne.id_personne=personne_bien.id_personne    LEFT JOIN bien ON bien.id_bien=personne_bien.id_bien  LEFT JOIN demande_caracteristique ON demande_caracteristique.id_demande=demande.id_demande  LEFT JOIN liste_langue as joinliste_langue_personne ON  joinliste_langue_personne.id=personne.id_langue  LEFT JOIN liste_cp_brugis as joinliste_adresse_fr_cp ON  joinliste_adresse_fr_cp.cp=bien.adresse_fr_cp  LEFT JOIN liste_bien_type as joinliste_id_type_bien_coche ON  joinliste_id_type_bien_coche.id=bien.id_type  LEFT JOIN liste_demande_type as joinliste_id_type_demande ON  joinliste_id_type_demande.id=demande.id_type_demande  LEFT JOIN liste_thematique as joinliste_demande_id_thematique_principal ON  joinliste_demande_id_thematique_principal.id=demande_caracteristique.id_thematique_principal  LEFT JOIN liste_thematique as joinliste_demande_id_thematique_secondaire ON  joinliste_demande_id_thematique_secondaire.id=demande_caracteristique.id_thematique_secondaire  LEFT JOIN liste_demande_statut as joinliste_id_demande_statut ON  joinliste_id_demande_statut.id=demande.id_demande_statut  LEFT JOIN liste_pole as joinliste_demande_pole ON  joinliste_demande_pole.id=demande.id_pole  LEFT JOIN users as joinliste_utilisateur_demande ON  joinliste_utilisateur_demande.id_user=demande.id_utilisateur  LEFT JOIN liste_langue as joinliste_encodage_langue ON  joinliste_encodage_langue.id=encodage.lang_contact  LEFT JOIN liste_th_accompagnement as joinliste_demande_id_accompagnement ON  joinliste_demande_id_accompagnement.id=demande_caracteristique.id_th_accompagnement  LEFT JOIN liste_type_suivi_accompagnement as joinliste_id_type_suivi_accompagnement ON  joinliste_id_type_suivi_accompagnement.id=demande.id_type_suivi_accompagnement  LEFT JOIN liste_type_info_conseil as joinliste_id_type_info_conseil ON  joinliste_id_type_info_conseil.id=demande.id_type_info_conseil  WHERE (( demande.id_pole  LIKE  \'6\') AND (( demande_caracteristique.id_th_accompagnement  LIKE  \'3\' OR  demande_caracteristique.id_th_accompagnement  LIKE  \'3,%\'  OR  demande_caracteristique.id_th_accompagnement  LIKE  \'%,3\'  OR  demande_caracteristique.id_th_accompagnement  LIKE  \'%,3,%\') OR ( demande.id_type_suivi_accompagnement  LIKE  \'3\' OR  demande.id_type_suivi_accompagnement  LIKE  \'3,%\'  OR  demande.id_type_suivi_accompagnement  LIKE  \'%,3\'  OR  demande.id_type_suivi_accompagnement  LIKE  \'%,3,%\')) )  AND  (  YEAR(demande.date)=2022 OR  YEAR(demande.date)=2023 ) ', 'encodage_date,id_demande_id,id_personne,prenom_personne,nom_personne,email_personne,langue_personne,id_bien,adresse_fr_bien,adresse_nl_bien,adresse_fr_cp,id_type_bien_coche,telephone_personne,id_type_demande,demande_id_thematique_principal,demande_id_thematique_secondaire,id_demande_statut,demande_pole,nom_demande,note_interne,utilisateur_demande,descriptif_demande,objet_note_interne,encodage_langue,demande_id_accompagnement,id_type_suivi_accompagnement,id_type_info_conseil', '@@array[ou_et]=0@@array[entity]=demande@@array[champ]=demande_pole@@array[operateur]=egal@@array[choice_is_array]=6@@array[par_ouvert]=0@@array[par_ferme]=0@@begin@@array[ou_et]=AND@@array[entity]=demande_detail@@array[champ]=demande_id_accompagnement@@array[operateur]=contient@@array[choice_is_array]=3@@array[par_ouvert]=1@@array[par_ferme]=0@@begin@@array[ou_et]=OR@@array[entity]=demande_detail@@array[champ]=id_type_suivi_accompagnement@@array[operateur]=contient@@array[choice_is_array]=3@@array[par_ouvert]=0@@array[par_ferme]=1', 'ou_et_%23%231=0&entity_%23%231=demande&champ_%23%231=demande_pole&operateur_%23%231=egal&%23%231%23%23_value%5B%5D=6&par_ouvert_%23%231=0&par_ferme_%23%231=0&ou_et_%23%232=AND&entity_%23%232=demande_caracteristique&champ_%23%232=demande_id_accompagnement&operateur_%23%232=contient&%23%232%23%23_valu