(462, 'SELECT encodage.date_insert as encodage_date, demande.id_demande as id_demande_id, personne.id_personne as id_personne, personne.prenom as prenom_personne, personne.nom as nom_personne, personne.email as email_personne, joinliste_langue_personne.label as langue_personne , bien.id_bien as id_bien, bien.adresse_fr as adresse_fr_bien, bien.adresse_nl as adresse_nl_bien, CONCAT (joinliste_adresse_fr_cp.cp,\' \',joinliste_adresse_fr_cp.localite_fr,\' \',joinliste_adresse_fr_cp.localite_nl_select) as adresse_fr_cp , joinliste_id_type_bien_coche.label as id_type_bien_coche , personne.telephone as telephone_personne, joinliste_id_type_demande.label as id_type_demande , joinliste_demande_id_thematique_principal.label as demande_id_thematique_principal , ( SELECT GROUP_CONCAT( liste_thematique.label)  FROM liste_thematique WHERE  FIND_IN_SET (liste_thematique.id,demande_caracteristique.id_thematique_secondaire)) as demande_id_thematique_secondaire, joinliste_id_demande_statut.label as id_demande_statut , joinliste_demande_pole.label as demande_pole , demande.nom as nom_demande, (SELECT content from fh_messagerie WHERE fh_messagerie.entity=\'demande\' AND fh_messagerie.id_entity=demande.id_demande ORDER BY fh_messagerie.date_created DESC LIMIT 1) as note_interne, CONCAT (joinliste_utilisateur_demande.nom,\' \',joinliste_utilisateur_demande.prenom) as utilisateur_demande , demande.descriptif as descriptif_demande, (SELECT subject from fh_messagerie WHERE fh_messagerie.entity=\'demande\' AND fh_messagerie.id_entity=demande.id_demande ORDER BY fh_messagerie.date_created DESC LIMIT 1) as objet_note_interne, joinliste_encodage_langue.label as encodage_langue , ( SELECT GROUP_CONCAT( liste_th_accompagnement.label)  FROM liste_th_accompagnement WHERE  FIND_IN_SET (liste_th_accompagnement.id,demande_caracteristique.id_th_accompagnement)) as demande_id_accompagnement, joinliste_id_type_suivi_accompagnement.label as id_type_suivi_accompagnement , joinliste_id_type_info_conseil.label as id_type_info_conseil  FROM demande LEFT JOIN personne_bien ON personne_bien.id_demande=demande.id_demande LEFT JOIN encodage ON encodage.id_encodage=demande.id_encodage   LEFT JOIN personne ON personne.id_personne=personne_bien.id_personne    LEFT JOIN bien ON bien.id_bien=personne_bien.id_bien  LEFT JOIN demande_caracteristique ON demande_caracteristique.id_demande=demande.id_demande  LEFT JOIN liste_langue as joinliste_langue_personne ON  joinliste_langue_personne.id=personne.id_langue  LEFT JOIN liste_cp_brugis as joinliste_adresse_fr_cp ON  joinliste_adresse_fr_cp.cp=bien.adresse_fr_cp  LEFT JOIN liste_bien_type as joinliste_id_type_bien_coche ON  joinliste_id_type_bien_coche.id=bien.id_type  LEFT JOIN liste_demande_type as joinliste_id_type_demande ON  joinliste_id_type_demande.id=demande.id_type_demande  LEFT JOIN liste_thematique as joinliste_demande_id_thematique_principal ON  joinliste_demande_id_thematique_principal.id=demande_caracteristique.id_thematique_principal  LEFT JOIN liste_thematique as joinliste_demande_id_thematique_secondaire ON  joinliste_demande_id_thematique_secondaire.id=demande_caracteristique.id_thematique_secondaire  LEFT JOIN liste_demande_statut as joinliste_id_demande_statut ON  joinliste_id_demande_statut.id=demande.id_demande_statut  LEFT JOIN liste_pole as joinliste_demande_pole ON  joinliste_demande_pole.id=demande.id_pole  LEFT JOIN users as joinliste_utilisateur_demande ON  joinliste_utilisateur_demande.id_user=demande.id_utilisateur  LEFT JOIN liste_langue as joinliste_encodage_langue ON  joinliste_encodage_langue.id=encodage.lang_contact  LEFT JOIN liste_th_accompagnement as joinliste_demande_id_accompagnement ON  joinliste_demande_id_accompagnement.id=demande_caracteristique.id_th_accompagnement  LEFT JOIN liste_type_suivi_accompagnement as joinliste_id_type_suivi_accompagnement ON  joinliste_id_type_suivi_accompagnement.id=demande.id_type_suivi_accompagnement  LEFT JOIN liste_type_info_conseil as joinliste_id_type_info_conseil ON  joinliste_id_type_info_conseil.id=demande.id_type_info_conseil  WHERE (( demande.id_pole  LIKE  \'8\') AND (( demande_caracteristique.id_th_accompagnement  LIKE  \'1\' OR  demande_caracteristique.id_th_accompagnement  LIKE  \'1,%\'  OR  demande_caracteristique.id_th_accompagnement  LIKE  \'%,1\'  OR  demande_caracteristique.id_th_accompagnement  LIKE  \'%,1,%\' OR  demande_caracteristique.id_th_accompagnement  LIKE  \'2\' OR  demande_caracteristique.id_th_accompagnement  LIKE  \'2,%\'  OR  demande_caracteristique.id_th_accompagnement  LIKE  \'%,2\'  OR  demande_caracteristique.id_th_accompagnement  LIKE  \'%,2,%\' OR  demande_caracteristique.id_th_accompagnement  LIKE  \'4\' OR  demande_caracteristique.id_th_accompagnement  LIKE  \'4,%\'  OR  demande_caracteristique.id_th_accompagnement  LIKE  \'%,4\'  OR  demande_caracteristique.id_th_accompagnement  LIKE  \'%,4,%\' OR  demande_caracteristique.id_th_accompagnement  LIKE  \'5\' OR  demande_caracteristique.id_th_accompagnement  LIKE  \'5,%\'  OR  demande_caracteristique.id_th_accompagnement  LIKE  \'%,5\'  OR  demande_caracteristique.id_th_accompagnement  LIKE  \'%,5,%\') OR ( demande.id_type_suivi_accompagnement  LIKE  \'1\' OR  demande.id_type_suivi_accompagnement  LIKE  \'1,%\'  OR  demande.id_type_suivi_accompagnement  LIKE  \'%,1\'  OR  demande.id_type_suivi_accompagnement  LIKE  \'%,1,%\' OR  demande.id_type_suivi_accompagnement  LIKE  \'2\' OR  demande.id_type_suivi_accompagnement  LIKE  \'2,%\'  OR  demande.id_type_suivi_accompagnement  LIKE  \'%,2\'  OR  demande.id_type_suivi_accompagnement  LIKE  \'%,2,%\' OR  demande.id_type_suivi_accompagnement  LIKE  \'4\' OR  demande.id_type_suivi_accompagnement  LIKE  \'4,%\'  OR  demande.id_type_suivi_accompagnement  LIKE  \'%,4\'  OR  demande.id_type_suivi_accompagnement  LIKE  \'%,4,%\')) AND (demande.id_demande IS NOT NULL AND demande.id_demande!=\'\') AND (demande.date IS NOT NULL AND demande.date!=\'\') )  AND  (  YEAR(demande.date)=2022 OR  YEAR(d