(472, 'SELECT demande.id_demande as id_demande_id, demande.date as date_demande, joinliste_id_demande_statut.label as id_demande_statut , CONCAT (joinliste_utilisateur_demande.nom,\' \',joinliste_utilisateur_demande.prenom) as utilisateur_demande , encodage.date_insert as encodage_date, CONCAT (joinliste_encodage_user_create.nom,\' \',joinliste_encodage_user_create.prenom) as encodage_user_create , joinliste_encodage_moyen_contact.label as encodage_moyen_contact , encodage.nombre_coche as encodage_nombre, joinliste_id_type_demande.label as id_type_demande  FROM demande LEFT JOIN personne_bien ON personne_bien.id_demande=demande.id_demande LEFT JOIN encodage ON encodage.id_encodage=demande.id_encodage   LEFT JOIN liste_demande_statut as joinliste_id_demande_statut ON  joinliste_id_demande_statut.id=demande.id_demande_statut  LEFT JOIN users as joinliste_utilisateur_demande ON  joinliste_utilisateur_demande.id_user=demande.id_utilisateur  LEFT JOIN users as joinliste_encodage_user_create ON  joinliste_encodage_user_create.id_user=encodage.user_create  LEFT JOIN liste_moyen_contact as joinliste_encodage_moyen_contact ON  joinliste_encodage_moyen_contact.id=encodage.moyen_contact  LEFT JOIN liste_demande_type as joinliste_id_type_demande ON  joinliste_id_type_demande.id=demande.id_type_demande  WHERE (( demande.id_utilisateur  LIKE  \'25\') AND ( demande.id_demande_statut  LIKE  \'6\') AND (( demande.id_type_demande  LIKE  \'3\') OR ( demande.id_type_demande  LIKE  \'2\') OR ( demande.moyen_contact  NOT LIKE  \'1\' AND  demande.moyen_contact  NOT LIKE  \'2\' AND  demande.moyen_contact  NOT LIKE  \'11\' AND  demande.moyen_contact  NOT LIKE  \'12\')) )  AND  (  YEAR(demande.date)=2022 ) ', 'id_demande_id,date_demande,id_demande_statut,utilisateur_demande,encodage_date,encodage_user_create,encodage_moyen_contact,encodage_nombre,id_type_demande', '@@array[ou_et]=0@@array[entity]=demande@@array[champ]=utilisateur_demande@@array[operateur]=egal@@array[choice_is_array]=25@@array[par_ouvert]=0@@array[par_ferme]=0@@begin@@array[ou_et]=AND@@array[entity]=demande@@array[champ]=id_demande_statut@@array[operateur]=egal@@array[choice_is_array]=6@@array[par_ouvert]=0@@array[par_ferme]=0@@begin@@array[ou_et]=AND@@array[entity]=demande_detail@@array[champ]=id_type_demande@@array[operateur]=egal@@array[choice_is_array]=3@@array[par_ouvert]=1@@array[par_ferme]=0@@begin@@array[ou_et]=OR@@array[entity]=demande_detail@@array[champ]=id_type_demande@@array[operateur]=egal@@array[choice_is_array]=2@@array[par_ouvert]=0@@array[par_ferme]=0@@begin@@array[ou_et]=OR@@array[entity]=demande@@array[champ]=demande_moyen_contact@@array[operateur]=different@@array[choice_is_array]=1,2,11,12@@array[par_ouvert]=0@@array[par_ferme]=1', 'ou_et_%23%231=0&entity_%23%231=demande&champ_%23%231=utilisateur_demande&operateur_%23%231=egal&%23%231%23%23_value%5B%5D=25&par_ouvert_%23%231=0&par_ferme_%23%231=0&ou_et_%23%232=AND&entity_%23%232=demande&champ_%23%232=id_demande_statut&operateur_%23%232=egal&%23%232%23%23_value%5B%5D=6&par_ouvert_%23%232=0&par_ferme_%23%232=0&ou_et_%23%233=AND&entity_%23%233=demande_caracteristique&champ_%23%233=id_type_demande&operateur_%23%233=egal&%23%233%23%23_value%5B%5D=3&par_ouvert_%23%233=1&par_ferme_%23%233=0&ou_et_%23%234=OR&entity_%23%234=demande_caracteristique&champ_%23%234=id_type_demande&operateur_%23%234=egal&%23%234%23%23_value%5B%5D=2&par_ouvert_%23%234=0&par_ferme_%23%234=0&ou_et_%23%235=OR&entity_%23%235=demande&champ_%23%235=demande_moyen_contact&operateur_%23%235=different&%23%235%23%23_value%5B%5D=1%2C2%2C11%2C12&par_ouvert_%23%235=0&par_ferme_%23%235=1&number=5&fields_select%5B%5D=nom_personne&id_demande_id&fields_select[]=date_demande&fields_select[]=id_demande_statut&fields_select[]=utilisateur_demande&fields_select[]=encodage_date&fields_select[]=encodage_user_create&fields_select[]=encodage_moyen_contact&fields_select[]=encodage_nombre&fields_select[]=id_type_demande', 24, '2022-09-06 09:44:55', 1, 'STATLU - BUG formulair