(475, 'SELECT demande.id_demande as id_demande_id, email_outlook.created_datetime as email_created_date FROM demande LEFT JOIN personne_bien ON personne_bien.id_demande=demande.id_demande LEFT JOIN encodage ON encodage.id_encodage=demande.id_encodage   LEFT JOIN email_outlook_lien ON email_outlook_lien.id_demande=demande.id_demande LEFT JOIN email_outlook ON email_outlook.id_primary=email_outlook_lien.id_email  WHERE (demande.date>\'2022-01-01\' AND demande.date<\'2022-02-01\' AND email_outlook.subject LIKE \'%# Enquête de satisfaction%\' )  AND  (  YEAR(demande.date)=2022 ) ', 'id_demande_id,email_created_date', '@@array[ou_et]=0@@array[entity]=demande@@array[champ]=date_demande@@array[operateur]=superieur@@array[choice]=01/01/2022@@array[par_ouvert]=0@@array[par_ferme]=0@@begin@@array[ou_et]=AND@@array[entity]=demande@@array[champ]=date_demande@@array[operateur]=inferieur@@array[choice]=01/02/2022@@array[par_ouvert]=0@@array[par_ferme]=0@@begin@@array[ou_et]=AND@@array[entity]=email_outlook@@array[champ]=email_subject@@array[operateur]=contient@@array[choice]=# Enquête de satisfaction@@array[par_ouvert]=0@@array[par_ferme]=0', 'ou_et_%23%231=0&entity_%23%231=demande&champ_%23%231=date_demande&operateur_%23%231=superieur&%23%231%23%23_value=01%2F01%2F2022&par_ouvert_%23%231=0&par_ferme_%23%231=0&ou_et_%23%232=AND&entity_%23%232=demande&champ_%23%232=date_demande&operateur_%23%232=inferieur&%23%232%23%23_value=01%2F02%2F2022&par_ouvert_%23%232=0&par_ferme_%23%232=0&ou_et_%23%233=AND&entity_%23%233=email_outlook&champ_%23%233=email_subject&operateur_%23%233=contient&%23%233%23%23_value=%23+Enqu%C3%AAte+de+satisfaction&par_ouvert_%23%233=0&par_ferme_%23%233=0&number=3&fields_select%5B%5D=nom_personne&id_demande_id&fields_select[]=email_created_date', 24, '2022-09-12 15:11:14', 0, 'STATLU - mail enquete de satisfaction', 2022, 0, '', ''),
(476, 'SELECT encodage.date_insert as encodage_date, ( SELECT GROUP_CONCAT( liste_demande_type.label)  FROM liste_demande_type WHERE  FIND_IN_SET (liste_demande_type.id,encodage.id_demande_type)) as encodage_demande_type, demande.id_demande as id_demande_id, joinliste_encodage_langue.label as encodage_langue , CONCAT (joinliste_utilisateur_demande.nom,\' \',joinliste_utilisateur_demande.prenom) as utilisateur_demande , (SELECT content from fh_messagerie WHERE fh_messagerie.entity=\'demande\' AND fh_messagerie.id_entity=demande.id_demande ORDER BY fh_messagerie.date_created DESC LIMIT 1) as note_interne, demande.nom as nom_demande, joinliste_demande_pole.label as demande_pole , demande.descriptif as descriptif_demande, CONCAT (joinliste_utilisateur_createur.nom,\' \',joinliste_utilisateur_createur.prenom) as utilisateur_createur , \r\n        CASE\r\n            WHEN (SELECT dem.date_modification FROM demande_h as dem WHERE dem.value_old = \'Homegrade\' AND dem.index=\'utilisateur_demande\' AND dem.id_entity=demande.id_demande ORDER BY dem.date_modification ASC LIMIT 1) \r\n                IS NOT NULL\r\n            THEN (SELECT dem.date_modification FROM demande_h as dem WHERE dem.value_old = \'Homegrade\' AND dem.index=\'utilisateur_demande\' AND dem.id_entity=demande.id_demande ORDER BY dem.date_modification ASC LIMIT 1) \r\n         ELSE \r\n            (SELECT dem.date FROM demande as dem WHERE dem.id_utilisateur != 25 AND dem.id_demande=demande.id_demande ORDER BY dem.date ASC LIMIT 1) \r\n         END as date_assignation \r\n        \r\n    , (SELECT dem.date_modification FROM demande_h as dem WHERE dem.index=\'demande_pole\' AND dem.id_entity=demande.id_demande ORDER BY dem.date_modification ASC LIMIT 1) as date_attribution , (SELECT subject from fh_messagerie WHERE fh_messagerie.entity=\'demande\' AND fh_messagerie.id_entity=demande.id_demande ORDER BY fh_messagerie.date_created DESC LIMIT 1) as objet_note_interne, joinliste_id_type_demande.label as id_type_demande , joinliste_demande_id_thematique_principal.label as demande_id_thematique_principal , ( SELECT GROUP_CONCAT( liste_thematique.label)  FROM liste_thematique WHERE  FIND_IN_SET (liste_thematique.id,demande_caracteristique.id_thematique_secondaire)) as demande_id_thematique_secondaire, ( SELECT GROUP_CONCAT( liste_th_accompagnement.label)  FROM liste_th_accompagnement WHERE  FIND_IN_SET (liste_th_accompagnement.id,demande_caracteristique.id_th_accompagnement)) as demande_id_accompagnement, personne.id_personne as id_personne, personne.telephone as telephone_personne, personne.prenom as prenom_personne, personne.nom as nom_personne, personne.email as email_personne, joinliste_civilite_personne.label as civilite_personne , joinliste_langue_personne.label as langue_personne , bien.id_bien as id_bien, bien.adresse_fr as adresse_fr_bien, bien.adresse_nl as adresse_nl_bien, joinliste_id_type_bien_coche.label as id_type_bien_coche , CONCAT (joinliste_adresse_fr_cp.cp,\' \',joinliste_adresse_fr_cp.localite_fr,\' \',joinliste_adresse_fr_cp.localite_nl_select) as adresse_fr_cp  FROM encodage LEFT JOIN demande ON encodage.id_encodage=demande.id_encodage  LEFT JOIN demande_caracteristique ON demande_caracteristique.id_demande=demande.id_demande  LEFT JOIN personne_bien ON personne_bien.id_demande=demande.id_demande  LEFT JOIN personne ON personne.id_personne=encodage.id_personne   LEFT JOIN bien ON bien.id_bien=encodage.id_bien LEFT JOIN bien_caracteristique ON bien_caracteristique.id_bien=bien.id_bien  LEFT JOIN liste_demande_type as joinliste_encodage_demande_type ON  joinliste_encodage_demande_type.id=encodage.id_demande_type  LEFT JOIN liste_langue as joinliste_encodage_langue ON  joinliste_encodage_langue.id=encodage.lang_contact  LEFT JOIN users as joinliste_utilisateur_demande ON  joinliste_utilisateur_demande.id_user=demande.id_utilisateur  LEFT JOIN liste_pole as joinliste_demande_pole ON  joinliste_demande_pole.id=demande.id_pole  LEFT JOIN users as joinliste_utilisateur_createur ON  joinliste_utilisateur_createur.id_user=demande.id_user_create  LEFT JOIN liste_demande_type as joinliste_id_type_demande ON  joinliste_id_type_demande.id=demande.id_type_demande  LEFT JOIN liste_thematique as joinliste_demande_id_thematique_principal ON  joinliste_demande_id_thematique_principal.id=demande_caracteristique.id_thematique_principal  LEFT JOIN liste_thematique as joinliste_demande_id_thematique_secondaire ON  joinliste_demande_id_thematique_secondaire.id=demande_caracteristique.id_thematique_secondaire  LEFT JOIN liste_th_accompagnement as joinliste_demande_id_accompagnement ON  joinliste_demande_id_accompagnement.id=demande_caracteristique.id_th_accompagnement  LEFT JOIN liste_civilite as joinliste_civilite_personne ON  joinliste_civilite_personne.id=personne.id_civilite  LEFT JOIN liste_langue as joinliste_langue_personne ON  joinliste_langue_personne.id=personne.id_langue  LEFT JOIN liste_bien_type as joinliste_id_type_bien_coche ON  joinliste_id_type_bien_coche.id=bien.id_type  LEFT JOIN liste_cp_brugis as joinliste_adresse_fr_cp ON  joinliste_adresse_fr_cp.cp=bien.adresse_fr_cp  WHERE (encodage.date_insert>\'2022-09-01\' AND (demande.id_pole IS NULL OR demande.id_pole=\'\') )  AND  (  YEAR(encodage.date_insert)=2022 OR  YEAR(encodage.date_insert)=2023 ) ', 'encodage_date,encodage_demande_type,id_demande_id,encodage_langue,utilisateur_demande,note_interne,nom_demande,demande_pole,descriptif_demande,utilisateur_createur,date_assignation,date_attribution,objet_note_interne,id_type_demande,demande_id_thematique_principal,demande_id_thematique_secondaire,demande_id_accompagnement,id_personne,telephone_personne,prenom_personne,nom_personne,email_personne,civilite_personne,langue_personne,id_bien,adresse_fr_bien,adresse_nl_bien,id_type_bien_coche,adresse_fr_cp', '@@array[ou_et]=0@@array[entity]=encodage@@array[champ]=encodage_date@@array[operateur]=superieur@@array[choice]=01/09/2022@@array[par_ouvert]=0@@array[par_ferme]=0@@begin@@