(479, 'SELECT demande.id_demande as id_demande_id, demande.date as date_demande, joinliste_id_demande_statut.label as id_demande_statut , CONCAT (joinliste_utilisateur_createur.nom,\' \',joinliste_utilisateur_createur.prenom) as utilisateur_createur , CONCAT (joinliste_utilisateur_demande.nom,\' \',joinliste_utilisateur_demande.prenom) as utilisateur_demande , demande.nom as nom_demande, joinliste_demande_id_type_accompagnement.label as demande_id_type_accompagnement , joinliste_demande_id_thematique_principal.label as demande_id_thematique_principal , ( SELECT GROUP_CONCAT( liste_thematique.label)  FROM liste_thematique WHERE  FIND_IN_SET (liste_thematique.id,demande_caracteristique.id_thematique_secondaire)) as demande_id_thematique_secondaire, ( SELECT GROUP_CONCAT( liste_th_accompagnement.label)  FROM liste_th_accompagnement WHERE  FIND_IN_SET (liste_th_accompagnement.id,demande_caracteristique.id_th_accompagnement)) as demande_id_accompagnement, CONCAT (joinliste_adresse_fr_cp.cp,\' \',joinliste_adresse_fr_cp.localite_fr,\' \',joinliste_adresse_fr_cp.localite_nl_select) as adresse_fr_cp , joinliste_id_type_bien_coche.label as id_type_bien_coche , joinliste_demande_moyen_contact.label as demande_moyen_contact , joinliste_type_rdv.label as type_rdv , ( SELECT GROUP_CONCAT( CONCAT ( users.nom,\' \',users.prenom))  as label_affiche  FROM users WHERE  FIND_IN_SET (users.id_user,rdv.id_user_rdv)) as user_rdv_multi, joinliste_statut_rdv.label as statut_rdv , rdv.date_rdv_debut as date_rdv_debut, joinliste_encodage_langue.label as encodage_langue  FROM demande LEFT JOIN personne_bien ON personne_bien.id_demande=demande.id_demande LEFT JOIN encodage ON encodage.id_encodage=demande.id_encodage   LEFT JOIN demande_caracteristique ON demande_caracteristique.id_demande=demande.id_demande  LEFT JOIN bien ON bien.id_bien=personne_bien.id_bien  LEFT JOIN demande_rdv ON demande_rdv.id_demande=demande.id_demande LEFT JOIN rdv ON demande_rdv.id_rdv=rdv.id_rdv  LEFT JOIN liste_demande_statut as joinliste_id_demande_statut ON  joinliste_id_demande_statut.id=demande.id_demande_statut  LEFT JOIN users as joinliste_utilisateur_createur ON  joinliste_utilisateur_createur.id_user=demande.id_user_create  LEFT JOIN users as joinliste_utilisateur_demande ON  joinliste_utilisateur_demande.id_user=demande.id_utilisateur  LEFT JOIN liste_type_accompagnement as joinliste_demande_id_type_accompagnement ON  joinliste_demande_id_type_accompagnement.id=demande_caracteristique.id_type_accompagnement  LEFT JOIN liste_thematique as joinliste_demande_id_thematique_principal ON  joinliste_demande_id_thematique_principal.id=demande_caracteristique.id_thematique_principal  LEFT JOIN liste_thematique as joinliste_demande_id_thematique_secondaire ON  joinliste_demande_id_thematique_secondaire.id=demande_caracteristique.id_thematique_secondaire  LEFT JOIN liste_th_accompagnement as joinliste_demande_id_accompagnement ON  joinliste_demande_id_accompagnement.id=demande_caracteristique.id_th_accompagnement  LEFT JOIN liste_cp_brugis as joinliste_adresse_fr_cp ON  joinliste_adresse_fr_cp.cp=bien.adresse_fr_cp  LEFT JOIN liste_bien_type as joinliste_id_type_bien_coche ON  joinliste_id_type_bien_coche.id=bien.id_type  LEFT JOIN liste_moyen_contact as joinliste_demande_moyen_contact ON  joinliste_demande_moyen_contact.id=demande.moyen_contact  LEFT JOIN liste_rdv_type as joinliste_type_rdv ON  joinliste_type_rdv.id=rdv.id_type_rdv  LEFT JOIN users as joinliste_user_rdv_multi ON  joinliste_user_rdv_multi.id_user=rdv.id_user_rdv  LEFT JOIN liste_rdv_statut as joinliste_statut_rdv ON  joinliste_statut_rdv.id=rdv.id_statut_rdv  LEFT JOIN liste_langue as joinliste_encodage_langue ON  joinliste_encodage_langue.id=encodage.lang_contact  WHERE (demande.date>\'2022-01-01\' AND demande.date<\'2023-01-01\' AND ( demande_caracteristique.id_type_accompagnement  LIKE  \'5\') )  AND  (  YEAR(demande.date)=2022 ) ', 'id_demande_id,date_demande,id_demande_statut,utilisateur_createur,utilisateur_demande,nom_demande,demande_id_type_accompagnement,demande_id_thematique_principal,demande_id_thematique_secondaire,demande_id_accompagnement,adresse_fr_cp,id_type_bien_coche,demande_moyen_contact,type_rdv,user_rdv_multi,statut_rdv,date_rdv_debut,encodage_langue', '@@array[ou_et]=0@@array[entity]=demande@@array[champ]=date_demande@@array[operateur]=superieur@@array[choice]=01/01/2022@@array[par_ouvert]=0@@array[par_ferme]=0@@begin@@array[ou_et]=AND@@array[entity]=demande@@array[champ]=date_demande@@array[operateur]=inferieur@@array[choice]=01/01/2023@@array[par_ouvert]=0@@array[par_ferme]=0@@begin@@array[ou_et]=AND@@array[entity]=demande_detail@@array[champ]=demande_id_type_accompagnement@@array[operateur]=egal@@array[choice_is_array]=5@@array[par_ouvert]=0@@array[par_ferme]=0', 'ou_et_%23%231=0&entity_%23%231=demande&champ_%23%231=date_demande&operateur_%23%231=superieur&%23%231%23%23_value=01%2F01%2F2022&par_ouvert_%23%231=0&par_ferme_%23%231=0&ou_et_%23%232=AND&entity_%23%232=demande&champ_%23%232=date_demande&operateur_%23%232=inferieur&%23%232%23%23_value=01%2F01%2F2023&par_ouvert_%23%232=0&par_ferme_%23%232=0&ou_et_%23%233=AND&entity_%23%233=demande_caracteristique&champ_%23%233=demande_id_type_accompagnement&operateur_%23%233=egal&%23%233%23%23_value%5B%5D=5&par_ouvert_%23%233=0&par_ferme_%23%233=0&number=3&fields_select%5B%5D=nom_personne&id_demande_id&fields_select[]=date_demande&fields_select[]=id_demande_statut&fields_select[]=utilisateur_createur&fields_select[]=utilisateur_demande&fields_select[]=nom_demande&fields_select[]=demande_id_type_accompagnement&fields_select[]=demande_id_thematique_principal&fields_select[]=demande_id_thematique_secondaire&fields_select[]=demande_id_accompagnement&fields_select[]=adresse_fr_cp&fields_select[]=id_type_bien_coche&fields_select[]=demande_moyen_contact&fields_select[]=type_rdv&fields_select[]=user_rdv_multi&fields_select[]=statut_rdv&fields_select[]=date_rdv_debut&fields_select[]=encodage_langue', 65, '2022-09