(480, 'SELECT demande.id_demande as id_demande_id, demande.date as date_demande, joinliste_id_demande_statut.label as id_demande_statut , CONCAT (joinliste_utilisateur_createur.nom,\' \',joinliste_utilisateur_createur.prenom) as utilisateur_createur , CONCAT (joinliste_utilisateur_demande.nom,\' \',joinliste_utilisateur_demande.prenom) as utilisateur_demande , demande.nom as nom_demande, ( SELECT GROUP_CONCAT( liste_ths_petit_patrimoine_acc.label)  FROM liste_ths_petit_patrimoine_acc WHERE  FIND_IN_SET (liste_ths_petit_patrimoine_acc.id,demande_caracteristique.id_ths_petit_patrimoine_acc)) as demande_id_ths_petit_patrimoine_acc, joinliste_demande_id_thematique_principal.label as demande_id_thematique_principal , ( SELECT GROUP_CONCAT( liste_thematique.label)  FROM liste_thematique WHERE  FIND_IN_SET (liste_thematique.id,demande_caracteristique.id_thematique_secondaire)) as demande_id_thematique_secondaire, ( SELECT GROUP_CONCAT( liste_th_prime.label)  FROM liste_th_prime WHERE  FIND_IN_SET (liste_th_prime.id,demande_caracteristique.id_th_prime)) as demande_id_prime, ( SELECT GROUP_CONCAT( liste_th_patrimoine.label)  FROM liste_th_patrimoine WHERE  FIND_IN_SET (liste_th_patrimoine.id,demande_caracteristique.id_th_patrimoine)) as demande_id_th_patrimoine, ( SELECT GROUP_CONCAT( liste_th_accompagnement.label)  FROM liste_th_accompagnement WHERE  FIND_IN_SET (liste_th_accompagnement.id,demande_caracteristique.id_th_accompagnement)) as demande_id_accompagnement, CONCAT (joinliste_adresse_fr_cp.cp,\' \',joinliste_adresse_fr_cp.localite_fr,\' \',joinliste_adresse_fr_cp.localite_nl_select) as adresse_fr_cp , joinliste_demande_moyen_contact.label as demande_moyen_contact , joinliste_encodage_langue.label as encodage_langue  FROM demande LEFT JOIN personne_bien ON personne_bien.id_demande=demande.id_demande LEFT JOIN encodage ON encodage.id_encodage=demande.id_encodage   LEFT JOIN demande_caracteristique ON demande_caracteristique.id_demande=demande.id_demande  LEFT JOIN bien ON bien.id_bien=personne_bien.id_bien  LEFT JOIN liste_demande_statut as joinliste_id_demande_statut ON  joinliste_id_demande_statut.id=demande.id_demande_statut  LEFT JOIN users as joinliste_utilisateur_createur ON  joinliste_utilisateur_createur.id_user=demande.id_user_create  LEFT JOIN users as joinliste_utilisateur_demande ON  joinliste_utilisateur_demande.id_user=demande.id_utilisateur  LEFT JOIN liste_ths_petit_patrimoine_acc as joinliste_demande_id_ths_petit_patrimoine_acc ON  joinliste_demande_id_ths_petit_patrimoine_acc.id=demande_caracteristique.id_ths_petit_patrimoine_acc  LEFT JOIN liste_thematique as joinliste_demande_id_thematique_principal ON  joinliste_demande_id_thematique_principal.id=demande_caracteristique.id_thematique_principal  LEFT JOIN liste_thematique as joinliste_demande_id_thematique_secondaire ON  joinliste_demande_id_thematique_secondaire.id=demande_caracteristique.id_thematique_secondaire  LEFT JOIN liste_th_prime as joinliste_demande_id_prime ON  joinliste_demande_id_prime.id=demande_caracteristique.id_th_prime  LEFT JOIN liste_th_patrimoine as joinliste_demande_id_th_patrimoine ON  joinliste_demande_id_th_patrimoine.id=demande_caracteristique.id_th_patrimoine  LEFT JOIN liste_th_accompagnement as joinliste_demande_id_accompagnement ON  joinliste_demande_id_accompagnement.id=demande_caracteristique.id_th_accompagnement  LEFT JOIN liste_cp_brugis as joinliste_adresse_fr_cp ON  joinliste_adresse_fr_cp.cp=bien.adresse_fr_cp  LEFT JOIN liste_moyen_contact as joinliste_demande_moyen_contact ON  joinliste_demande_moyen_contact.id=demande.moyen_contact  LEFT JOIN liste_langue as joinliste_encodage_langue ON  joinliste_encodage_langue.id=encodage.lang_contact  WHERE (demande.date>\'2022-01-01\' AND demande.date<\'2023-01-01\' AND ( demande_caracteristique.id_type_accompagnement  LIKE  \'6\') )  AND  (  YEAR(demande.date)=2022 ) ', 'id_demande_id,date_demande,id_demande_statut,utilisateur_createur,utilisateur_demande,nom_demande,demande_id_ths_petit_patrimoine_acc,demande_id_thematique_principal,demande_id_thematique_secondaire,demande_id_prime,demande_id_th_patrimoine,demande_id_accompagnement,adresse_fr_cp,demande_moyen_contact,encodage_langue', '@@array[ou_et]=0@@array[entity]=demande@@array[champ]=date_demande@@array[operateur]=superieur@@array[choice]=01/01/2022@@array[par_ouvert]=0@@array[par_ferme]=0@@begin@@array[ou_et]=AND@@array[entity]=demande@@array[champ]=date_demande@@array[operateur]=inferieur@@array[choice]=01/01/2023@@array[par_ouvert]=0@@array[par_ferme]=0@@begin@@array[ou_et]=AND@@array[entity]=demande_detail@@array[champ]=demande_id_type_accompagnement@@array[operateur]=egal@@array[choice_is_array]=6@@array[par_ouvert]=0@@array[par_ferme]=0', 'ou_et_%23%231=0&entity_%23%231=demande&champ_%23%231=date_demande&operateur_%23%231=superieur&%23%231%23%23_value=01%2F01%2F2022&par_ouvert_%23%231=0&par_ferme_%23%231=0&ou_et_%23%232=AND&entity_%23%232=demande&champ_%23%232=date_demande&operateur_%23%232=inferieur&%23%232%23%23_value=01%2F01%2F2023&par_ouvert_%23%232=0&par_ferme_%23%232=0&ou_et_%23%233=AND&entity_%23%233=demande_caracteristique&champ_%23%233=demande_id_type_accompagnement&operateur_%23%233=egal&%23%233%23%23_value%5B%5D=6&par_ouvert_%23%233=0&par_ferme_%23%233=0&number=3&fields_select%5B%5D=nom_personne&id_demande_id&fields_select[]=date_demande&fields_select[]=id_demande_statut&fields_select[]=utilisateur_createur&fields_select[]=utilisateur_demande&fields_select[]=nom_demande&fields_select[]=demande_id_ths_petit_patrimoine_acc&fields_select[]=demande_id_thematique_principal&fields_select[]=demande_id_thematique_secondaire&fields_select[]=demande_id_prime&fields_select[]=demande_id_th_patrimoine&fields_select[]=demande_id_accompagnement&fields_select[]=adresse_fr_cp&fields_select[]=demande_moyen_contact&fields_select[]=encodage_langue', 65, '2022-09-15 10:41:26', 0, 'STATEXCEL - Acc S Petit Patrimoine demandes 2022', 2022, 0, '', ''),
(483, 'SELECT demande.id_demande as id_demande_id, personne.prenom as prenom_personne, personne.nom as nom_personne, joinliste_langue_personne.label as langue_personne , demande.date as date_demande, joinliste_id_type_demande.label as id_type_demande , ( SELECT GROUP_CONCAT( liste_th_accompagnement.label)  FROM liste_th_accompagnement WHERE  FIND_IN_SET (liste_th_accompagnement.id,demande_caracteristique.id_th_accompagnement)) as demande_id_accompagnement, joinliste_demande_id_type_accompagnement.label as demande_id_type_accompagnement , ( SELECT GROUP_CONCAT( liste_th_visite.label)  FROM liste_th_visite WHERE  FIND_IN_SET (liste_th_visite.id,demande_caracteristique.id_visite)) as demande_id_visite, joinliste_demande_id_thematique_principal.label as demande_id_thematique_principal , ( SELECT GROUP_CONCAT( liste_thematique.label)  FROM liste_thematique WHERE  FIND_IN_SET (liste_thematique.id,demande_caracteristique.id_thematique_secondaire)) as demande_id_thematique_secondaire, ( SELECT GROUP_CONCAT( liste_th_acoustique.label)  FROM liste_th_acoustique WHERE  FIND_IN_SET (liste_th_acoustique.id,demande_caracteristique.id_th_acoustique)) as demande_id_th_acoustique, ( SELECT GROUP_CONCAT( liste_th_energie.label)  FROM liste_th_energie WHERE  FIND_IN_SET (liste_th_energie.id,demande_caracteristique.id_th_energie)) as demande_id_th_energie, ( SELECT GROUP_CONCAT( liste_th_logement.label)  FROM liste_th_logement WHERE  FIND_IN_SET (liste_th_logement.id,demande_caracteristique.id_th_logement)) as demande_id_th_logement, ( SELECT GROUP_CONCAT( liste_th_patrimoine.label)  FROM liste_th_patrimoine WHERE  FIND_IN_SET (liste_th_patrimoine.id,demande_caracteristique.id_th_patrimoine)) as demande_id_th_patrimoine, ( SELECT GROUP_CONCAT( liste_th_renovation.label)  FROM liste_th_renovation WHERE  FIND_IN_SET (liste_th_renovation.id,demande_caracteristique.id_th_renovation)) as demande_id_th_renovation, ( SELECT GROUP_CONCAT( liste_th_urbanisme.label)  FROM liste_th_urbanisme WHERE  FIND_IN_SET (liste_th_urbanisme.id,demande_caracteristique.id_th_urbanisme)) as demande_id_th_urbanisme, ( SELECT GROUP_CONCAT( liste_ths_batiment_durable.label)  FROM liste_ths_batiment_durable WHERE  FIND_IN_SET (liste_ths_batiment_durable.id,demande_caracteristique.id_ths_batiment_durable)) as demande_id_ths_batiment_durable, ( SELECT GROUP_CONCAT( liste_ths_petit_patrimoine_acc.label)  FROM liste_ths_petit_patrimoine_acc WHERE  FIND_IN_SET (liste_ths_petit_patrimoine_acc.id,demande_caracteristique.id_ths_petit_patrimoine_acc)) as demande_id_ths_petit_patrimoine_acc, joinliste_id_type_bien_coche.label as id_type_bien_coche , CONCAT (joinliste_encodage_cp.cp,\' \',joinliste_encodage_cp.localite_fr,\' \',joinliste_encodage_cp.localite_nl_select) as encodage_cp , bien.adresse_fr as adresse_fr_bien, demande.nom as nom_demande, demande.descriptif as descriptif_demande, (SELECT subject from fh_messagerie WHERE fh_messagerie.entity=\'demande\' AND fh_messagerie.id_entity=demande.id_demande ORDER BY fh_messagerie.date_created DESC LIMIT 1) as objet_note_interne, CONCAT (joinliste_utilisateur_createur.nom,\' \',joinliste_utilisateur_createur.prenom) as utilisateur_createur , joinliste_demande_moyen_contact.label as demande_moyen_contact , joinliste_demande_contact_duree_default.label as demande_contact_duree_default , joinliste_demande_pole.label as demande_pole , (SELECT dem.date_modification FROM demande_h as dem WHERE dem.index=\'demande_pole\' AND dem.id_entity=demande.id_demande ORDER BY dem.date_modification ASC LIMIT 1) as date_attribution , CONCAT (joinliste_utilisateur_demande.nom,\' \',joinliste_utilisateur_demande.prenom) as utilisateur_demande , \r\n        CASE\r\n            WHEN (SELECT dem.date_modification FROM demande_h as dem WHERE dem.value_old = \'Homegrade\' AND dem.index=\'utilisateur_demande\' AND dem.id_entity=demande.id_demande ORDER BY dem.date_modification ASC LIMIT 1) \r\n                IS NOT NULL\r\n            THEN (SELECT dem.date_modification FROM demande_h as dem WHERE dem.value_old = \'Homegrade\' AND dem.index=\'utilisateur_demande\' AND dem.id_entity=demande.id_demande ORDER BY dem.date_modification ASC LIMIT 1) \r\n         ELSE \r\n            (SELECT dem.date FROM demande as dem WHERE dem.id_utilisateur != 25 AND dem.id_demande=demande.id_demande ORDER BY dem.date ASC LIMIT 1) \r\n         END as date_assignation \r\n        \r\n    , joinliste_id_demande_statut.label as id_demande_statut , COUNT(DISTINCT email_outlook.id_primary) as count_email , COUNT(DISTINCT tache.id_tache) as count_tache, COUNT(DISTINCT rdv.id_rdv) as count_rdv, COUNT(DISTINCT personne.id_personne) as count_personne , demande.date_cloture as demande_date_cloture, joinliste_id_type_suivi_accompagnement.label as id_type_suivi_accompagnement , joinliste_id_type_info_conseil.label as id_type_info_conseil  FROM demande LEFT JOIN personne_bien ON personne_bien.id_demande=demande.id_demande LEFT JOIN encodage ON encodage.id_encodage=demande.id_encodage   LEFT JOIN personne ON personne.id_personne=personne_bien.id_personne    LEFT JOIN demande_caracteristique ON demande_caracteristique.id_demande=demande.id_demande  LEFT JOIN bien ON bien.id_bien=personne_bien.id_bien  LEFT JOIN email_outlook_lien ON email_outlook_lien.id_demande=demande.id_demande LEFT JOIN email_outlook ON email_outlook.id_primary=email_outlook_lien.id_email  LEFT JOIN demande_tache ON demande_tache.id_demande=demande.id_demande LEFT JOIN tache ON demande_tache.id_tache=tache.id_tache  LEFT JOIN demande_rdv ON demande_rdv.id_demande=demande.id_demande LEFT JOIN rdv ON demande_rdv.id_rdv=rdv.id_rdv  LEFT JOIN liste_langue as joinliste_langue_personne ON  joinliste_langue_personne.id=personne.id_langue  LEFT JOIN liste_demande_type as joinliste_id_type_demande ON  joinliste_id_type_demande.id=demande.id_type_demande  LEFT JOIN liste_th_accompagnement as joinliste_demande_id_accompagnement ON  joinliste_demande_id_accompagnement.id=demande_caracteristique.id_