_id_type_bien_coche.id=bien.id_type  LEFT JOIN liste_cp_brugis as joinliste_encodage_cp ON  joinliste_encodage_cp.cp=encodage.localite  LEFT JOIN users as joinliste_utilisateur_createur ON  joinliste_utilisateur_createur.id_user=demande.id_user_create  LEFT JOIN liste_moyen_contact as joinliste_demande_moyen_contact ON  joinliste_demande_moyen_contact.id=demande.moyen_contact  LEFT JOIN liste_contact_duree as joinliste_demande_contact_duree_default ON  joinliste_demande_contact_duree_default.id=demande.contact_duree  LEFT JOIN liste_pole as joinliste_demande_pole ON  joinliste_demande_pole.id=demande.id_pole  LEFT JOIN users as joinliste_utilisateur_demande ON  joinliste_utilisateur_demande.id_user=demande.id_utilisateur  LEFT JOIN liste_demande_statut as joinliste_id_demande_statut ON  joinliste_id_demande_statut.id=demande.id_demande_statut  LEFT JOIN liste_type_suivi_accompagnement as joinliste_id_type_suivi_accompagnement ON  joinliste_id_type_suivi_accompagnement.id=demande.id_type_suivi_accompagnement  LEFT JOIN liste_type_info_conseil as joinliste_id_type_info_conseil ON  joinliste_id_type_info_conseil.id=demande.id_type_info_conseil  WHERE (demande.date>\'2022-05-01\' AND demande.date<\'2022-06-01\' )  AND  (  YEAR(demande.date)=2022 )  GROUP BY demande.id_demande ', 'id_demande_id,prenom_personne,nom_personne,langue_personne,date_demande,id_type_demande,demande_id_accompagnement,demande_id_type_accompagnement,demande_id_visite,demande_id_thematique_principal,demande_id_thematique_secondaire,demande_id_th_acoustique,demande_id_th_energie,demande_id_th_logement,demande_id_th_patrimoine,demande_id_th_renovation,demande_id_th_urbanisme,demande_id_ths_batiment_durable,demande_id_ths_petit_patrimoine_acc,id_type_bien_coche,encodage_cp,adresse_fr_bien,nom_demande,descriptif_demande,objet_note_interne,utilisateur_createur,demande_moyen_contact,demande_contact_duree_default,demande_pole,date_attribution,utilisateur_demande,date_assignation,id_demande_statut,count_em