INSERT INTO `user_requete` (`id_requete`, `query`, `field`, `string_where`, `uri`, `id_user`, `date_create`, `is_dasboard`, `nom`, `annee_select`, `annee_select2`, `group_by_sidebar`, `group_by_sidebar_sql`) VALUES
(513, 'SELECT demande.id_demande as id_demande_id, personne.prenom as prenom_personne, personne.nom as nom_personne, joinliste_langue_personne.label as langue_personne , demande.date as date_demande, joinliste_id_type_demande.label as id_type_demande , ( SELECT GROUP_CONCAT( liste_th_accompagnement.label)  FROM liste_th_accompagnement WHERE  FIND_IN_SET (liste_th_accompagnement.id,demande_caracteristique.id_th_accompagnement)) as demande_id_accompagnement, joinliste_demande_id_type_accompagnement.label as demande_id_type_accompagnement , ( SELECT GROUP_CONCAT( liste_th_visite.label)  FROM liste_th_visite WHERE  FIND_IN_SET (liste_th_visite.id,demande_caracteristique.id_visite)) as demande_id_visite, joinliste_demande_id_thematique_principal.label as demande_id_thematique_principal , ( SELECT GROUP_CONCAT( liste_thematique.label)  FROM liste_thematique WHERE  FIND_IN_SET (liste_thematique.id,demande_caracteristique.id_thematique_secondaire)) as demande_id_thematique_secondaire, ( SELECT GROUP_CONCAT( liste_th_acoustique.label)  FROM liste_th_acoustique WHERE  FIND_IN_SET (liste_th_acoustique.id,demande_caracteristique.id_th_acoustique)) as demande_id_th_acoustique, ( SELECT GROUP_CONCAT( liste_th_energie.label)  FROM liste_th_energie WHERE  FIND_IN_SET (liste_th_energie.id,demande_caracteristique.id_th_energie)) as demande_id_th_energie, ( SELECT GROUP_CONCAT( liste_th_logement.label)  FROM liste_th_logement WHERE  FIND_IN_SET (liste_th_logement.id,demande_caracteristique.id_th_logement)) as demande_id_th_logement, ( SELECT GROUP_CONCAT( liste_th_patrimoine.label)  FROM liste_th_patrimoine WHERE  FIND_IN_SET (liste_th_patrimoine.id,demande_caracteristique.id_th_patrimoine)) as demande_id_th_patrimoine, ( SELECT GROUP_CONCAT( liste_th_renovation.label)  FROM liste_th_renovation WHERE  FIND_IN_SET (liste_th_renovation.id,demande_caracteristique.id_th_renovation)) as demande_id_th_renovation, ( SELECT GROUP_CONCAT( liste_th_urbanisme.label)  FROM liste_th_urbanisme WHERE  FIND_IN_SET (liste_th_urbanisme.id,demande_caracteristique.id_th_urbanisme)) as demande_id_th_urbanisme, ( SELECT GROUP_CONCAT( liste_ths_batiment_durable.label)  FROM liste_ths_batiment_durable WHERE  FIND_IN_SET (liste_ths_batiment_durable.id,demande_caracteristique.id_ths_batiment_durable)) as demande_id_ths_batiment_durable, ( SELECT GROUP_CONCAT( liste_ths_petit_patrimoine_acc.label)  FROM liste_ths_petit_patrimoine_acc WHERE  FIND_IN_SET (liste_ths_petit_patrimoine_acc.id,demande_caracteristique.id_ths_petit_patrimoine_acc)) as demande_id_ths_petit_patrimoine_acc, joinliste_id_type_bien_coche.label as id_type_bien_coche , CONCAT (joinliste_encodage_cp.cp,\' \',joinliste_encodage_cp.localite_fr,\' \',joinliste_encodage_cp.localite_nl_select) as encodage_cp , bien.adresse_fr as adresse_fr_bien, demande.nom as nom_demande, demande.descriptif as descriptif_demande, (SELECT subject from fh_messagerie WHERE fh_messagerie.entity=\'demande\' AND fh_messagerie.id_entity=demande.id_demande ORDER BY fh_messagerie.date_created DESC LIMIT 1) as objet_note_interne, CONCAT (joinliste_utilisateur_createur.nom,\' \',joinliste_utilisateur_createur.prenom) as utilisateur_createur , joinliste_demande_moyen_contact.label as demande_moyen_contact , joinliste_demande_contact_duree_default.label as demande_contact_duree_default , joinliste_demande_pole.label as demande_pole , (SELECT dem.date_modification FROM demande_h as dem WHERE dem.index=\'demande_pole\' AND dem.id_entity=demande.id_demande ORDER BY dem.date_modification ASC LIMIT 1) as date_attribution , CONCAT (joinliste_utilisateur_demande.nom,\' \',joinliste_utilisateur_demande.prenom) as utilisateur_demande , \r\n        CASE\r\n            WHEN (SELECT dem.date_modification FROM demande_h as dem WHERE dem.value_old = \'Homegrade\' AND dem.index=\'utilisateur_demande\' AND dem.id_entity=demande.id_demande ORDER BY dem.date_modification ASC LIMIT 1) \r\n                IS NOT NULL\r\n            THEN (SELECT dem.date_modification FROM demande_h as dem WHERE dem.value_old = \'Homegrade\' AND dem.index=\'utilisateur_demande\' AND dem.id_entity=demande.id_demande ORDER BY dem.date_modification ASC LIMIT 1) \r\n         ELSE \r\n            (SELECT dem.date FROM demande as dem WHERE dem.id_utilisateur != 25 AND dem.id_demande=demande.id_demande ORDER BY dem.date ASC LIMIT 1) \r\n         END as date_assignation \r\n        \r\n    , joinliste_id_demande_statut.label as id_demande_statut , COUNT(DISTINCT email_outlook.id_primary) as count_email , COUNT(DISTINCT tache.id_tache) as count_tache, COUNT(DISTINCT rdv.id_rdv) as count_rdv, COUNT(DISTINCT personne.id_personne) as count_personne , demande.date_cloture as demande_date_cloture, joinliste_id_type_suivi_accompagnement.label as id_type_suivi_accompagnement , joinliste_id_type_info_conseil.label as id_type_info_conseil  FROM demande LEFT JOIN personne_bien ON personne_bien.id_demande=demande.id_demande LEFT JOIN encodage ON encodage.id_encodage=demande.id_encodage   LEFT JOIN personne ON personne.id_personne=personne_bien.id_personne    LEFT JOIN demande_caracteristique ON demande_caracteristique.id_demande=demande.id_demande  LEFT JOIN bien ON bien.id_bien=personne_bien.id_bien  LEFT JOIN email_outlook_lien ON email_outlook_lien.id_demande=demande.id_demande LEFT JOIN email_outlook ON email_outlook.id_primary=email_outlook_lien.id_email  LEFT JOIN demande_tache ON demande_tache.id_demande=demande.id_demande LEFT JOIN tache ON demande_tache.id_tache=tache.id_tache  LEFT JOIN demande_rdv ON demande_rdv.id_demande=demande.id_demande LEFT JOIN rdv ON demande_rdv.id_rdv=rdv.id_rdv  LEFT JOIN liste_langue as joinliste_langue_personne ON  joinliste_langue_personne.id=personne.id_langue  LEFT JOIN liste_demande_type as joinliste_id_type_demande ON  joinliste_id_type_demande.id=demande.id_type_demande  LEFT JOIN liste_th_accompagnement as joinliste_demande_id_accompagnement ON  joinliste_demande_id_accompagnement.id=demande_caracteristique.id_th_accompagnement  LEFT JOIN liste_type_accompagnement as joinliste_demande_id_type_accompagnement ON  joinliste_demande_id_type_accompagnement.id=demande_caracteristique.id_type_accompagnement  LEFT JOIN liste_th_visite as joinliste_demande_id_visite ON  joinliste_demande_id_visite.id=demande_caracteristique.id_visite  LEFT JOIN liste_thematique as joinliste_demande_id_thematique_principal ON  joinliste_demande_id_thematique_principal.id=demande_caracteristique.id_thematique_principal  LEFT JOIN liste_thematique as joinliste_demande_id_thematique_secondaire ON  joinliste_demande_id_thematique_secondaire.id=demande_caracteristique.id_thematique_secondaire  LEFT JOIN liste_th_acoustique as joinliste_demande_id_th_acoustique ON  joinliste_demande_id_th_acoustique.id=demande_caracteristique.id_th_acoustique  LEFT JOIN liste_th_energie as joinliste_demande_id_th_energie ON  joinliste_demande_id_th_energie.id=demande_caracteristique.id_th_energie  LEFT JOIN liste_th_logement as joinliste_demande_id_th_logement ON  joinliste_demande_id_th_logement.id=demande_caracteristique.id_th_logement  LEFT JOIN liste_th_patrimoine as joinliste_demande_id_th_patrimoine ON  joinliste_demande_id_th_patrimoine.id=demande_caracteristique.id_th_patrimoine  LEFT JOIN liste_th_renovation as joinliste_demande_id_th_renovation ON  joinliste_demande_id_th_renovation.id=demande_caracteristique.id_th_renovation  LEFT JOIN liste_th_urbanisme as joinliste_demande_id_th_urbanisme ON  joinliste_demande_id_th_urbanisme.id=demande_caracteristique.id_th_urbanisme  LEFT JOIN liste_ths_batiment_durable as joinliste_demande_id_ths_batiment_durable ON  joinliste_demande_id_ths_batiment_durable.id=demande_caracteristique.id_ths_batiment_durable  LEFT JOIN liste_ths_petit_patrimoine_acc as joinliste_demande_id_ths_petit_patrimoine_acc ON  joinliste_demande_id_ths_petit_patrimoine_acc.id=demande_caracteristique.id_ths_petit_patrimoine_acc  LEFT JOIN liste_bien_type as joinliste_id_type_bien_coche ON  joinliste_id_type_bien_coche.id=bien.id_type  LEFT JOIN liste_cp_brugis as joinliste_encodage_cp ON  joinliste_encodage_cp.cp=encodage.localite  LEFT JOIN users as joinliste_utilisateur_createur ON  joinliste_utilisateur_createur.id_user=demande.id_user_create  LEFT JOIN liste_moyen_contact as joinliste_demande_moyen_contact ON  joinliste_demande_moyen_contact.id=demande.moyen_contact  LEFT JOIN liste_contact_duree as joinliste_demande_contact_duree_default ON  joinliste_demande_contact_duree_default.id=demande.contact_duree  LEFT JOIN liste_pole as joinliste_demande_pole ON  joinliste_demande_pole.id=demande.id_pole  LEFT JOIN users as joinliste_utilisateur_demande ON  joinliste_utilisateur_demande.id_user=demande.id_utilisateur  LEFT JOIN liste_demande_statut as joinliste_id_demande_statut ON  joinliste_id_demande_statut.id=demande.id_demande_statut  LEFT JOIN liste_type_suivi_accompagnement as joinliste_id_type_suivi_accompagnement ON  joinliste_id_type_suivi_accompagnement.id=demande.id_type_suivi_accompagnement  LEFT JOIN liste_type_info_conseil as joinliste_id_type_info_conseil ON  joinliste_id_type_info_conseil.id=demande.id_type_info_conseil  WHERE (demande.date>\'2022-09-01\' AND demande.date<\'2022-10-01\' )  AND  (  YEAR(demande.date)=2022 )  GROUP BY demande.id_demande ', 'id_demande_id,prenom_personne,nom_personne,langue_personne,date_demande,id_type_demande,demande_id_accompagnement,demande_id_type_accompagnement,demande_id_visite,demande_id_thematique_principal,demande_id_thematique_secondaire,demande_id_th_acoustique,demande_id_th_energie,demande_id_th_logement,demande_id_th_patrimoine,demande_id_th_renovation,demande_id_th_urbanisme,demande_id_ths_batiment_durable,demande_id_ths_petit_patrimoine_acc,id_type_bien_coche,encodage_cp,adresse_fr_bien,nom_demande,descriptif_demande,objet_note_interne,utilisateur_createur,demande_moyen_contact,demande_contact_duree_default,demande_pole,date_attribution,utilisateur_demande,date_assignation,id_demande_statut,count_em