(517, 'SELECT bien.id_bien as id_bien, bien.adresse_fr as adresse_fr_bien, bien.bt as adresse_bt, bien.etage_logement as etage_logement_bien, joinliste_id_type_bien_coche.label as id_type_bien_coche , demande.id_demande as id_demande_id, demande.date as date_demande, CONCAT (joinliste_utilisateur_demande.nom,\' \',joinliste_utilisateur_demande.prenom) as utilisateur_demande , demande.nom as nom_demande, joinliste_id_type_demande.label as id_type_demande , joinliste_id_type_suivi_accompagnement.label as id_type_suivi_accompagnement , ( SELECT GROUP_CONCAT( liste_th_visite.label)  FROM liste_th_visite WHERE  FIND_IN_SET (liste_th_visite.id,demande_caracteristique.id_visite)) as demande_id_visite, rdv.id_rdv as id_rdv, joinliste_type_rdv.label as type_rdv , rdv.titre as titre_rdv, joinliste_statut_rdv.label as statut_rdv  FROM demande LEFT JOIN personne_bien ON personne_bien.id_demande=demande.id_demande LEFT JOIN encodage ON encodage.id_encodage=demande.id_encodage   LEFT JOIN bien ON bien.id_bien=personne_bien.id_bien  LEFT JOIN demande_caracteristique ON demande_caracteristique.id_demande=demande.id_demande  LEFT JOIN demande_rdv ON demande_rdv.id_demande=demande.id_demande LEFT JOIN rdv ON demande_rdv.id_rdv=rdv.id_rdv  LEFT JOIN liste_bien_type as joinliste_id_type_bien_coche ON  joinliste_id_type_bien_coche.id=bien.id_type  LEFT JOIN users as joinliste_utilisateur_demande ON  joinliste_utilisateur_demande.id_user=demande.id_utilisateur  LEFT JOIN liste_demande_type as joinliste_id_type_demande ON  joinliste_id_type_demande.id=demande.id_type_demande  LEFT JOIN liste_type_suivi_accompagnement as joinliste_id_type_suivi_accompagnement ON  joinliste_id_type_suivi_accompagnement.id=demande.id_type_suivi_accompagnement  LEFT JOIN liste_th_visite as joinliste_demande_id_visite ON  joinliste_demande_id_visite.id=demande_caracteristique.id_visite  LEFT JOIN liste_rdv_type as joinliste_type_rdv ON  joinliste_type_rdv.id=rdv.id_type_rdv  LEFT JOIN liste_rdv_statut as joinliste_statut_rdv ON  joinliste_statut_rdv.id=rdv.id_statut_rdv  WHERE ((demande.id_demande IS NOT NULL AND demande.id_demande!=\'\') AND ( bien.adresse_fr_cp  LIKE  \'1200\') )  AND  (  YEAR(demande.date)=2022 ) ', 'id_bien,adresse_fr_bien,adresse_bt,etage_logement_bien,id_type_bien_coche,id_demande_id,date_demande,utilisateur_demande,nom_demande,id_type_demande,id_type_suivi_accompagnement,demande_id_visite,id_rdv,type_rdv,titre_rdv,statut_rdv', '@@array[ou_et]=0@@array[entity]=demande@@array[champ]=id_demande_id@@array[operateur]=vide_pas@@array[choice]=@@array[par_ouvert]=0@@array[par_ferme]=0@@begin@@array[ou_et]=AND@@array[entity]=bien@@array[champ]=adresse_fr_cp@@array[operateur]=egal@@array[choice_is_array]=1200@@array[par_ouvert]=0@@array[par_ferme]=0', 'ou_et_%23%231=0&entity_%23%231=demande&champ_%23%231=id_demande_id&operateur_%23%231=vide_pas&%23%231%23%23_value=&par_ouvert_%23%231=0&par_ferme_%23%231=0&ou_et_%23%232=AND&entity_%23%232=bien&champ_%23%232=adresse_fr_cp&operateur_%23%232=egal&%23%232%23%23_value%5B%5D=1200&par_ouvert_%23%232=0&par_ferme_%23%232=0&number=2&fields_select%5B%5D=nom_personne&id_bien&fields_select[]=adresse_fr_bien&fields_select[]=adresse_bt&fields_select[]=etage_logement_bien&fields_select[]=id_type_bien_coche&fields_select[]=id_demande_id&fields_select[]=date_demande&fields_select[]=utilisateur_demande&fields_select[]=nom_demande&fields_select[]=id_type_demande&fields_select[]=id_type_suivi_accompagnement&fields_select[]=demande_id_visite&fields_select[]=id_rdv&fields_select[]=type_rdv&fields_select[]=titre_rdv&fields_select[]=statut_rdv', 24, '2022-12-06 17:18:21', 0, 'TESTA - CP1200', 2022, 0, '', ''),
(518, 'SELECT encodage.date_insert as encodage_date, demande.id_demande as id_demande_id, personne.id_personne as id_personne, bien.id_bien as id_bien, CONCAT (joinliste_encodage_user_create.nom,\' \',joinliste_encodage_user_create.prenom) as encodage_user_create , CONCAT (joinliste_utilisateur_demande.nom,\' \',joinliste_utilisateur_demande.prenom) as utilisateur_demande , joinliste_demande_pole.label as demande_pole , joinliste_encodage_moyen_contact.label as encodage_moyen_contact , joinliste_encodage_origine_default.label as encodage_origine_default , joinliste_id_type_suivi_accompagnement.label as id_type_suivi_accompagnement , joinliste_id_type_demande.label as id_type_demande , joinliste_id_type_info_conseil.label as id_type_info_conseil , ( SELECT GROUP_CONCAT( liste_th_accompagnement.label)  FROM liste_th_accompagnement WHERE  FIND_IN_SET (liste_th_accompagnement.id,demande_caracteristique.id_th_accompagnement)) as demande_id_accompagnement, ( SELECT GROUP_CONCAT( liste_thematique.label)  FROM liste_thematique WHERE  FIND_IN_SET (liste_thematique.id,demande_caracteristique.id_thematique_secondaire)) as demande_id_thematique_secondaire, joinliste_demande_id_thematique_principal.label as demande_id_thematique_principal , CONCAT (joinliste_adresse_fr_cp.cp,\' \',joinliste_adresse_fr_cp.localite_fr,\' \',joinliste_adresse_fr_cp.localite_nl_select) as adresse_fr_cp , bien.adresse_fr as adresse_fr_bien, bien.adresse_nl as adresse_nl_bien, joinliste_langue_personne.label as langue_personne , personne.prenom as prenom_personne, personne.nom as nom_personne, personne.email as email_personne, personne.telephone as telephone_personne, joinliste_id_type_bien_coche.label as id_type_bien_coche , demande.nom as nom_demande, (SELECT subject from fh_messagerie WHERE fh_messagerie.entity=\'demande\' AND fh_messagerie.id_entity=demande.id_demande ORDER BY fh_messagerie.date_created DESC LIMIT 1) as objet_note_interne, joinliste_id_demande_statut.label as id_demande_statut  FROM demande LEFT JOIN personne_bien ON personne_bien.id_demande=demande.id_demande LEFT JOIN encodage ON encodage.id_encodage=demande.id_encodage   LEFT JOIN personne ON personne.id_personne=personne_bien.id_personne    LEFT JOIN bien ON bien.id_bien=personne_bien.id_bien  LEFT JOIN demande_caracteristique ON demande_caracteristique.id_demande=demande.id_demande  LEFT JOIN users as joinliste_encodage_user_create ON  joinliste_encodage_user_create.id_user=encodage.user_create  LEFT JOIN users as joinliste_utilisateur_demande ON  joinliste_utilisateur_demande.id_user=demande.id_utilisateur  LEFT JOIN liste_pole as joinliste_demande_pole ON  joinliste_demande_pole.id=demande.id_pole  LEFT JOIN liste_moyen_contact as joinliste_encodage_moyen_contact ON  joinliste_encodage_moyen_contact.id=encodage.moyen_contact  LEFT JOIN liste_demande_origine as joinliste_encodage_origine_default ON  joinliste_encodage_origine_default.id=encodage.demande_origine  LEFT JOIN liste_type_suivi_accompagnement as joinliste_id_type_suivi_accompagnement ON  joinliste_id_type_suivi_accompagnement.id=demande.id_type_suivi_accompagnement  LEFT JOIN liste_demande_type as joinliste_id_type_demande ON  joinliste_id_type_demande.id=demande.id_type_demande  LEFT JOIN liste_type_info_conseil as joinliste_id_type_info_conseil ON  joinliste_id_type_info_conseil.id=demande.id_type_info_conseil  LEFT JOIN liste_th_accompagnement as joinliste_demande_id_accompagnement ON  joinliste_demande_id_accompagnement.id=demande_caracteristique.id_th_accompagnement  LEFT JOIN liste_thematique as joinliste_demande_id_thematique_secondaire ON  joinliste_demande_id_thematique_secondaire.id=demande_caracteristique.id_thematique_secondaire  LEFT JOIN liste_thematique as joinliste_demande_id_thematique_principal ON  joinliste_demande_id_thematique_principal.id=demande_caracteristique.id_thematique_principal  LEFT JOIN liste_cp_brugis as joinliste_adresse_fr_cp ON  joinliste_adresse_fr_cp.cp=bien.adresse_fr_cp  LEFT JOIN liste_langue as joinliste_langue_personne ON  joinliste_langue_personne.id=personne.id_langue  LEFT JOIN liste_bien_type as joinliste_id_type_bien_coche ON  joinliste_id_type_bien_coche.id=bien.id_type  LEFT JOIN liste_demande_statut as joinliste_id_demande_statut ON  joinliste_id_demande_statut.id=demande.id_demande_statut  WHERE (( demande.id_pole  LIKE  \'9\' OR  demande.id_pole  LIKE  \'9,%\'  OR  demande.id_pole  LIKE  \'%,9\'  OR  demande.id_pole  LIKE  \'%,9,%\') )  AND  (  YEAR(demande.date)=2022 OR  YEAR(demande.date)=2023 ) ', 'encodage_date,id_demande_id,id_personne,id_bien,encodage_user_create,utilisateur_demande,demande_pole,encodage_moyen_contact,encodage_origine_default,id_type_suivi_accompagnement,id_type_demande,id_type_info_conseil,demande_id_accompagnement,demande_id_thematique_secondaire,demande_id_thematique_principal,adresse_fr_cp,adresse_fr_bien,adresse_nl_bien,langue_personne,prenom_personne,nom_personne,email_personne,telephone_personne,id_type_bien_coche,nom_demande,objet_note_interne,id_demande_statut', '@@array[ou_et]=0@@array[entity]=demande@@array[champ]=demande_pole@@array[operateur]=contient@@array[choice_is_array]=9@@array[par_ouvert]=0@@array[par_ferme]=0', 'ou_et_%23%231=0&entity_%23%231=demande&champ_%23%231=demande_pole&operateur_%23%231=contient&%23%231%23%23_value%5B%5D=9&par_ouvert_%23%231=0&par_ferme_%23%231=0&number=1&fields_select%5B%5D=nom_personne&encodage_date&fields_select[]=id_demande_id&fields_select[]=id_personne&fields_select[]=id_bien&fields_select[]=encodage_user_create&fields_select[]=utilisateur_demande&fields_select[]=demande_pole&fields_select[]=encodage_moyen_contact&fields_select[]=encodage_origine_default&fields_select[]=id_type_suivi_accompagnement&fields_select[]=id_type_demande&fields_select[]=id_type_info_conseil&fields_select[]=demande_id_accompagnement&fields_select[]=demande_id_thematique_secondaire&fields_select[]=demande_id_thematique_principal&fields_select[]=adresse_fr_cp&fields_select[]=adresse_fr_b