(534, 'SELECT trim(demande.id_demande) as demande_id_visite, trim(demande.date) as date_demande, ( SELECT GROUP_CONCAT( liste_moyen_contact.label SEPARATOR \', \' )  FROM liste_moyen_contact WHERE  FIND_IN_SET (liste_moyen_contact.id, demande.moyen_contact)) as demande_moyen_contact, ( SELECT GROUP_CONCAT( liste_oui_non.label SEPARATOR \', \' )  FROM liste_oui_non WHERE  FIND_IN_SET (liste_oui_non.id, demande.demande_origine)) as demande_origine_default, ( SELECT GROUP_CONCAT( CONCAT ( user_accounts.nom, \' \', user_accounts.prenom) SEPARATOR \', \' )  as label_affiche  FROM user_accounts WHERE  FIND_IN_SET (user_accounts.id, demande.id_user_create)) as utilisateur_createur, ( SELECT GROUP_CONCAT( liste_demande_type.label SEPARATOR \', \' )  FROM liste_demande_type WHERE  FIND_IN_SET (liste_demande_type.id, demande.id_type_demande)) as id_type_demande, ( SELECT GROUP_CONCAT( liste_langue.label SEPARATOR \', \' )  FROM liste_langue WHERE  FIND_IN_SET (liste_langue.id, encodage.lang_contact)) as encodage_langue, ( SELECT GROUP_CONCAT( liste_contact_duree.label SEPARATOR \', \' )  FROM liste_contact_duree WHERE  FIND_IN_SET (liste_contact_duree.id, demande.contact_duree)) as demande_contact_duree_default, ( SELECT GROUP_CONCAT( liste_pole.label SEPARATOR \', \' )  FROM liste_pole WHERE  FIND_IN_SET (liste_pole.id, demande.id_pole)) as demande_pole, ( SELECT GROUP_CONCAT( user_accounts.nom SEPARATOR \', \' )  FROM user_accounts WHERE  FIND_IN_SET (user_accounts.id, demande.id_utilisateur)) as utilisateur_demande, ( SELECT GROUP_CONCAT( liste_type_suivi_accompagnement.label SEPARATOR \', \' )  FROM liste_type_suivi_accompagnement WHERE  FIND_IN_SET (liste_type_suivi_accompagnement.id, demande.id_type_suivi_accompagnement)) as id_type_suivi_accompagnement, ( SELECT GROUP_CONCAT( liste_type_info_conseil.label SEPARATOR \', \' )  FROM liste_type_info_conseil WHERE  FIND_IN_SET (liste_type_info_conseil.id, demande.id_type_info_conseil)) as id_type_info_conseil, trim(demande.nom) as nom_demande, ( SELECT GROUP_CONCAT( liste_demande_statut.label SEPARATOR \', \' )  FROM liste_demande_statut WHERE  FIND_IN_SET (liste_demande_statut.id, demande.id_demande_statut)) as id_demande_statut, ( SELECT GROUP_CONCAT( CONCAT ( liste_cp_brugis.cp, \' \', `liste_cp_brugis`.`localite_fr`, \' \', liste_cp_brugis.localite_nl_select) SEPARATOR \', \' )  as label_affiche  FROM liste_cp_brugis WHERE  FIND_IN_SET (liste_cp_brugis.cp, encodage.localite)) as encodage_cp, ( SELECT GROUP_CONCAT( liste_cp_brugis.cp SEPARATOR \', \' )  FROM liste_cp_brugis WHERE  FIND_IN_SET (liste_cp_brugis.cp, bien.adresse_fr_cp)) as adresse_fr_cp, ( SELECT GROUP_CONCAT( liste_thematique.label SEPARATOR \', \' )  FROM liste_thematique WHERE  FIND_IN_SET (liste_thematique.id, demande_caracteristique.id_thematique_principal)) as demande_id_thematique_principal\r\nFROM `demande`\r\nLEFT JOIN `encodage` ON `encodage`.`id_encodage`=`demande`.`id_encodage`\r\nLEFT JOIN `personne_bien` ON `personne_bien`.`id_demande`=`demande`.`id_demande`\r\nLEFT JOIN `bien` ON `bien`.`id_bien`=`personne_bien`.`id_bien`\r\nLEFT JOIN `demande_caracteristique` ON `demande_caracteristique`.`id_demande`=`demande`.`id_demande`\r\nWHERE `demande`.`date` > ', 'demande_id_visite,date_demande,demande_moyen_contact,demande_origine_default,utilisateur_createur,id_type_demande,encodage_langue,demande_contact_duree_default,demande_pole,utilisateur_demande,id_type_suivi_accompagnement,id_type_info_conseil,nom_demande,id_demande_statut,encodage_cp,adresse_fr_cp,demande_id_thematique_principal', '@@array[ou_et]=0@@array[entity]=demande@@array[champ]=date_demande@@array[operateur]=superieur@@array[choice]=01/01/2023@@array[par_ouvert]=0@@array[par_ferme]=0@@begin@@array[ou_et]=AND@@array[entity]=demande@@array[champ]=date_demande@@array[operateur]=inferieur@@array[choice]=01/01/2024@@array[par_ouvert]=0@@array[par_ferme]=0', '/queries/execute/534?//queries/execute/534?ou_et_%23%231=AND&par_ouvert_%23%231=0&entity_%23%231=demande&champ_%23%231=date_demande&operateur_%23%231=superieur&%23%231%23%23_value=2023-01-01&par_ferme_%23%231=0&ou_et_%23%232=AND&par_ouvert_%23%232=0&entity_%23%232=demande&champ_%23%232=date_demande&operateur_%23%232=inferieur&%23%232%23%23_value=2024-01-01&par_ferme_%23%232=0&number=2&fields_select%5B%5D=demande_id_visite&group_by%5B%5D=demande_id_visite&fields_select%5B%5D=date_demande&fields_select%5B%5D=demande_moyen_contact&fields_select%5B%5D=demande_origine_default&fields_select%5B%5D=utilisateur_createur&fields_select%5B%5D=id_type_demande&fields_select%5B%5D=encodage_langue&fields_select%5B%5D=demande_contact_duree_default&fields_select%5B%5D=demande_pole&fields_select%5B%5D=utilisateur_demande&fields_select%5B%5D=id_type_suivi_accompagnement&fields_select%5B%5D=id_type_info_conseil&fields_select%5B%5D=nom_demande&fields_select%5B%5D=id_demande_statut&fields_select%5B%5D=encodage_cp&fields_select%5B%5D=adresse_fr_cp&fields_select%5B%5D=demande_id_thematique_principal', 24, '2023-09-13 20:54:06', 0, 'GEST - Comptabilisation Nouvelles Demandes 2023', 2023, 0, 'id_demande_id', 'demande.id_demande');
