_contact_duree_default.id=encodage.duree_contact  LEFT JOIN liste_oui_non as joinliste_encodage_contact_premier_default ON  joinliste_encodage_contact_premier_default.id=encodage.is_premier_contact  LEFT JOIN liste_langue as joinliste_encodage_langue ON  joinliste_encodage_langue.id=encodage.lang_contact  LEFT JOIN liste_cp_brugis as joinliste_encodage_cp ON  joinliste_encodage_cp.cp=encodage.localite  WHERE (encodage.date_insert>\'2023-01-01\' AND encodage.date_insert<\'2023-02-01\' )  AND  (  YEAR(encodage.date_insert)=2023 )  GROUP BY encodage.date_insert ', 'encodage_date,encodage_user_create,encodage_moyen_contact,encodage_origine_default,encodage_demande_type,encodage_rel_personne_bien,encodage_contact_duree_default,encodage_contact_premier_default,encodage_langue,encodage_cp,encodage_nombre,count_demande', '@@array[ou_et]=0@@array[entity]=encodage@@array[champ]=encodage_date@@array[operateur]=superieur@@array[choice]=01/01/2023@@array[par_ouvert]=0@@array[par_ferme]=0@@begin@@array[ou_et]=AND@@array[entity]=encodage@@array[champ]=encodage_date@@array[operateur]=inferieur@@array[choice]=01/02/2023@@array[par_ouvert]=0@@array[par_ferme]=0', 'ou_et_%23%231=0&entity_%23%231=encodage&champ_%23%231=encodage_date&operateur_%23%231=superieur&%23%231%23%23_value=01%2F01%2F2023&par_ouvert_%23%231=0&par_ferme_%23%231=0&ou_et_%23%232=AND&entity_%23%232=encodage&champ_%23%232=encodage_date&operateur_%23%232=inferieur&%23%232%23%23_value=01%2F02%2F2023&par_ouvert_%23%232=0&par_ferme_%23%232=0&number=2&fields_select%5B%5D=nom_personne&encodage_date&fields_select[]=encodage_user_create&fields_select[]=encodage_moyen_contact&fields_select[]=encodage_origine_default&fields_select[]=encodage_demande_type&fields_select[]=encodage_rel_personne_bien&fields_select[]=encodage_contact_duree_default&fields_select[]=encodage_contact_premier_default&fields_select[]=encodage_langue&fields_select[]=encodage_cp&fields_select[]=encodage_nombre&fields_select[]=count_demande', 24, '2023-02-02