(552, 'SELECT trim(demande.id_demande) as demande_id_visite, trim(demande.date) as date_demande, ( SELECT GROUP_CONCAT( CONCAT ( user_accounts.nom, \' \', user_accounts.prenom) SEPARATOR \', \' )  as label_affiche  FROM user_accounts WHERE  FIND_IN_SET (user_accounts.id, demande.id_user_create)) as utilisateur_createur, ( SELECT GROUP_CONCAT( liste_demande_statut.label SEPARATOR \', \' )  FROM liste_demande_statut WHERE  FIND_IN_SET (liste_demande_statut.id, demande.id_demande_statut)) as id_demande_statut, ( SELECT GROUP_CONCAT( user_accounts.nom SEPARATOR \', \' )  FROM user_accounts WHERE  FIND_IN_SET (user_accounts.id, demande.id_utilisateur)) as utilisateur_demande, ( SELECT GROUP_CONCAT( liste_pole.label SEPARATOR \', \' )  FROM liste_pole WHERE  FIND_IN_SET (liste_pole.id, demande.id_pole)) as demande_pole, ( SELECT GROUP_CONCAT( liste_moyen_contact.label SEPARATOR \', \' )  FROM liste_moyen_contact WHERE  FIND_IN_SET (liste_moyen_contact.id, demande.moyen_contact)) as demande_moyen_contact, ( SELECT GROUP_CONCAT( liste_demande_type.label SEPARATOR \', \' )  FROM liste_demande_type WHERE  FIND_IN_SET (liste_demande_type.id, demande.id_type_demande)) as id_type_demande, ( SELECT GROUP_CONCAT( liste_type_suivi_accompagnement.label SEPARATOR \', \' )  FROM liste_type_suivi_accompagnement WHERE  FIND_IN_SET (liste_type_suivi_accompagnement.id, demande.id_type_suivi_accompagnement)) as id_type_suivi_accompagnement, ( SELECT GROUP_CONCAT( liste_type_info_conseil.label SEPARATOR \', \' )  FROM liste_type_info_conseil WHERE  FIND_IN_SET (liste_type_info_conseil.id, demande.id_type_info_conseil)) as id_type_info_conseil, (SELECT dem.date_modification FROM demande_h as dem WHERE dem.index=\'demande_pole\' AND dem.id_entity=demande.id_demande ORDER BY dem.date_modification ASC LIMIT 1) as date_attribution, CASE\r\n            WHEN (SELECT dem.date_modification FROM demande_h as dem WHERE dem.value_old = \'Homegrade\' AND dem.index=\'utilisateur_demande\' AND dem.id_entity=demande.id_demande ORDER BY dem.date_modification ASC LIMIT 1) \r\n                IS NOT NULL\r\n            THEN (SELECT dem.date_modification FROM demande_h as dem WHERE dem.value_old = \'Homegrade\' AND dem.index=\'utilisateur_demande\' AND dem.id_entity=demande.id_demande ORDER BY dem.date_modification ASC LIMIT 1) \r\n         ELSE \r\n            (SELECT dem.date FROM demande as dem WHERE dem.id_utilisateur != 25 AND dem.id_demande=demande.id_demande ORDER BY dem.date ASC LIMIT 1) \r\n         END as date_assignation, ( SELECT GROUP_CONCAT( liste_langue.label SEPARATOR \', \' )  FROM liste_langue WHERE  FIND_IN_SET (liste_langue.id, encodage.lang_contact)) as encodage_langue, ( SELECT GROUP_CONCAT( liste_type_accompagnement.label SEPARATOR \', \' )  FROM liste_type_accompagnement WHERE  FIND_IN_SET (liste_type_accompagnement.id, demande_caracteristique.id_type_accompagnement)) as demande_id_type_accompagnement\r\nFROM `demande`\r\nLEFT JOIN `encodage` ON `encodage`.`id_encodage`=`demande`.`id_encodage`\r\nLEFT JOIN `demande_caracteristique` ON `demande_caracteristique`.`id_demande`=`demande`.`id_demande`\r\nWHERE `demande`.`date` > ', 'demande_id_visite,date_demande,utilisateur_createur,id_demande_statut,utilisateur_demande,demande_pole,demande_moyen_contact,id_type_demande,id_type_suivi_accompagnement,id_type_info_conseil,date_attribution,date_assignation,encodage_langue,demande_id_type_accompagnement', '@@array[ou_et]=0@@array[entity]=demande@@array[champ]=date_demande@@array[operateur]=inferieur@@array[choice]=01/02/2023@@array[par_ouvert]=0@@array[par_ferme]=0', 'ou_et_%23%231=AND&par_ouvert_%23%231=0&entity_%23%231=demande&champ_%23%231=date_demande&operateur_%23%231=superieur&%23%231%23%23_value=2023-01-01&par_ferme_%23%231=0&number=1&fields_select%5B0%5D=demande_id_visite&fields_select%5B1%5D=date_demande&fields_select%5B2%5D=utilisateur_createur&fields_select%5B3%5D=id_demande_statut&fields_select%5B4%5D=utilisateur_demande&fields_select%5B5%5D=dem