(600, 'SELECT demande.id_demande as id_demande_id, demande.date as date_demande, CONCAT (joinliste_utilisateur_createur.nom,\' \',joinliste_utilisateur_createur.prenom) as utilisateur_createur , joinliste_id_demande_statut.label as id_demande_statut , CONCAT (joinliste_utilisateur_demande.nom,\' \',joinliste_utilisateur_demande.prenom) as utilisateur_demande , joinliste_demande_pole.label as demande_pole , joinliste_demande_moyen_contact.label as demande_moyen_contact , joinliste_id_type_demande.label as id_type_demande , joinliste_id_type_suivi_accompagnement.label as id_type_suivi_accompagnement , joinliste_id_type_info_conseil.label as id_type_info_conseil , (SELECT dem.date_modification FROM demande_h as dem WHERE dem.index=\'demande_pole\' AND dem.id_entity=demande.id_demande ORDER BY dem.date_modification ASC LIMIT 1) as date_attribution , \r\n        CASE\r\n            WHEN (SELECT dem.date_modification FROM demande_h as dem WHERE dem.value_old = \'Homegrade\' AND dem.index=\'utilisateur_demande\' AND dem.id_entity=demande.id_demande ORDER BY dem.date_modification ASC LIMIT 1) \r\n                IS NOT NULL\r\n            THEN (SELECT dem.date_modification FROM demande_h as dem WHERE dem.value_old = \'Homegrade\' AND dem.index=\'utilisateur_demande\' AND dem.id_entity=demande.id_demande ORDER BY dem.date_modification ASC LIMIT 1) \r\n         ELSE \r\n            (SELECT dem.date FROM demande as dem WHERE dem.id_utilisateur != 25 AND dem.id_demande=demande.id_demande ORDER BY dem.date ASC LIMIT 1) \r\n         END as date_assignation \r\n        \r\n    , joinliste_encodage_langue.label as encodage_langue , joinliste_demande_id_type_accompagnement.label as demande_id_type_accompagnement , joinliste_type_rdv.label as type_rdv , COUNT(DISTINCT rdv.id_rdv) as count_rdv, COUNT(DISTINCT email_outlook.id_primary) as count_email  FROM demande LEFT JOIN personne_bien ON personne_bien.id_demande=demande.id_demande LEFT JOIN encodage ON encodage.id_encodage=demande.id_encodage   LEFT JOIN demande_caracteristique ON demande_caracteristique.id_demande=demande.id_demande  LEFT JOIN demande_rdv ON demande_rdv.id_demande=demande.id_demande LEFT JOIN rdv ON demande_rdv.id_rdv=rdv.id_rdv  LEFT JOIN email_outlook_lien ON email_outlook_lien.id_demande=demande.id_demande LEFT JOIN email_outlook ON email_outlook.id_primary=email_outlook_lien.id_email  LEFT JOIN users as joinliste_utilisateur_createur ON  joinliste_utilisateur_createur.id_user=demande.id_user_create  LEFT JOIN liste_demande_statut as joinliste_id_demande_statut ON  joinliste_id_demande_statut.id=demande.id_demande_statut  LEFT JOIN users as joinliste_utilisateur_demande ON  joinliste_utilisateur_demande.id_user=demande.id_utilisateur  LEFT JOIN liste_pole as joinliste_demande_pole ON  joinliste_demande_pole.id=demande.id_pole  LEFT JOIN liste_moyen_contact as joinliste_demande_moyen_contact ON  joinliste_demande_moyen_contact.id=demande.moyen_contact  LEFT JOIN liste_demande_type as joinliste_id_type_demande ON  joinliste_id_type_demande.id=demande.id_type_demande  LEFT JOIN liste_type_suivi_accompagnement as joinliste_id_type_suivi_accompagnement ON  joinliste_id_type_suivi_accompagnement.id=demande.id_type_suivi_accompagnement  LEFT JOIN liste_type_info_conseil as joinliste_id_type_info_conseil ON  joinliste_id_type_info_conseil.id=demande.id_type_info_conseil  LEFT JOIN liste_langue as joinliste_encodage_langue ON  joinliste_encodage_langue.id=encodage.lang_contact  LEFT JOIN liste_type_accompagnement as joinliste_demande_id_type_accompagnement ON  joinliste_demande_id_type_accompagnement.id=demande_caracteristique.id_type_accompagnement  LEFT JOIN liste_rdv_type as joinliste_type_rdv ON  joinliste_type_rdv.id=rdv.id_type_rdv  WHERE (demande.date>\'2023-06-01\' AND demande.date<\'2023-07-01\' )  AND  (  YEAR(demande.date)=2023 )  GROUP BY demande.id_demande ', 'id_demande_id,date_demande,utilisateur_createur,id_demande_statut,utilisateur_demande,demande_pole,demande_moy