(601, 'SELECT rdv.id_rdv as id_rdv, rdv.titre as titre_rdv, rdv.date_rdv_debut as date_rdv_debut, demande.id_demande as id_demande_id, demande.date as date_demande, CONCAT (joinliste_utilisateur_demande.nom,\' \',joinliste_utilisateur_demande.prenom) as utilisateur_demande , joinliste_id_type_demande.label as id_type_demande , ( SELECT GROUP_CONCAT( liste_th_visite.label)  FROM liste_th_visite WHERE  FIND_IN_SET (liste_th_visite.id,demande_caracteristique.id_visite)) as demande_id_visite, demande.nom as nom_demande, joinliste_demande_id_thematique_principal.label as demande_id_thematique_principal , ( SELECT GROUP_CONCAT( liste_thematique.label)  FROM liste_thematique WHERE  FIND_IN_SET (liste_thematique.id,demande_caracteristique.id_thematique_secondaire)) as demande_id_thematique_secondaire, ( SELECT GROUP_CONCAT( liste_ths_geste.label)  FROM liste_ths_geste WHERE  FIND_IN_SET (liste_ths_geste.id,demande_caracteristique.id_geste)) as demande_id_geste, ( SELECT GROUP_CONCAT( liste_intervention.label)  FROM liste_intervention WHERE  FIND_IN_SET (liste_intervention.id,demande_caracteristique.id_intervention)) as demande_id_intervention, ( SELECT GROUP_CONCAT( liste_intervention_non.label)  FROM liste_intervention_non WHERE  FIND_IN_SET (liste_intervention_non.id,demande_caracteristique.id_intervention_non)) as demande_id_intervention_non, ( SELECT GROUP_CONCAT( liste_travaux.label)  FROM liste_travaux WHERE  FIND_IN_SET (liste_travaux.id,demande_caracteristique.id_travaux)) as demande_id_travaux, bien.id_bien as id_bien, bien.adresse_fr as adresse_fr_bien, bien.bt as adresse_bt, bien.etage_logement as etage_logement_bien, joinliste_id_nombre_bien.label as id_nombre_bien , bien.annee as annee, bien.nombre_facade as nombre_facade, joinliste_id_certificat_peb.label as id_certificat_peb , bien.surface_chauffee as surface_chauffee, joinliste_nombre_habitant.label as nombre_habitant , joinliste_id_chauffage_bien.label as id_chauffage_bien , joinliste_id_type_chauffage.label as id_type_chauffage , joinliste_id_type_eau.label as id_type_eau , joinliste_id_type_four.label as id_type_four , joinliste_id_type_cuisiniere.label as id_type_cuisiniere , bien.consommation_electricite as consommation_electricite, bien.consommation_gaz as consommation_gaz FROM rdv LEFT JOIN demande_rdv ON demande_rdv.id_rdv=rdv.id_rdv   LEFT JOIN demande ON demande_rdv.id_demande=demande.id_demande  LEFT JOIN demande_caracteristique ON demande_caracteristique.id_demande=demande.id_demande  LEFT JOIN encodage ON encodage.id_encodage=demande.id_encodage   LEFT JOIN personne_bien ON personne_bien.id_demande=demande.id_demande  LEFT JOIN personne ON personne.id_personne=personne_bien.id_personne  LEFT JOIN bien ON bien.id_bien=personne_bien.id_bien LEFT JOIN bien_caracteristique ON bien_caracteristique.id_bien=bien.id_bien    LEFT JOIN users as joinliste_utilisateur_demande ON  joinliste_utilisateur_demande.id_user=demande.id_utilisateur  LEFT JOIN liste_demande_type as joinliste_id_type_demande ON  joinliste_id_type_demande.id=demande.id_type_demande  LEFT JOIN liste_th_visite as joinliste_demande_id_visite ON  joinliste_demande_id_visite.id=demande_caracteristique.id_visite  LEFT JOIN liste_thematique as joinliste_demande_id_thematique_principal ON  joinliste_demande_id_thematique_principal.id=demande_caracteristique.id_thematique_principal  LEFT JOIN liste_thematique as joinliste_demande_id_thematique_secondaire ON  joinliste_demande_id_thematique_secondaire.id=demande_caracteristique.id_thematique_secondaire  LEFT JOIN liste_ths_geste as joinliste_demande_id_geste ON  joinliste_demande_id_geste.id=demande_caracteristique.id_geste  LEFT JOIN liste_intervention as joinliste_demande_id_intervention ON  joinliste_demande_id_intervention.id=demande_caracteristique.id_intervention  LEFT JOIN liste_intervention_non as joinliste_demande_id_intervention_non ON  joinliste_demande_id_intervention_non.id=demande_caracteristique.id_intervention_non  LEFT JOIN liste_travaux as joinliste_demande_id_travaux ON  joinliste_demande_id_travaux.id=demande_caracteristique.id_travaux  LEFT JOIN liste_bien_nombre_logement as joinliste_id_nombre_bien ON  joinliste_id_nombre_bien.label=bien.id_nombre_logement  LEFT JOIN liste_type_peb as joinliste_id_certificat_peb ON  joinliste_id_certificat_peb.id=bien.id_certificat_peb  LEFT JOIN liste_nombre as joinliste_nombre_habitant ON  joinliste_nombre_habitant.id=bien.id_chauffage  LEFT JOIN liste_bien_chauffage as joinliste_id_chauffage_bien ON  joinliste_id_chauffage_bien.id=bien.id_chauffage  LEFT JOIN liste_type_chauffage as joinliste_id_type_chauffage ON  joinliste_id_type_chauffage.id=bien.id_type_chauffage  LEFT JOIN liste_type_eau as joinliste_id_type_eau ON  joinliste_id_type_eau.id=bien.id_type_eau  LEFT JOIN liste_type_four as joinliste_id_type_four ON  joinliste_id_type_four.id=bien.id_type_four  LEFT JOIN liste_type_cuisiniere as joinliste_id_type_cuisiniere ON  joinliste_id_type_cuisiniere.id=bien.id_type_cuisiniere  WHERE (( rdv.id_type_rdv  LIKE  \'1\') )  AND  (  YEAR(rdv.date_insert)=2023 ) ', 'id_rdv,titre_rdv,date_rdv_debut,id_demande_id,date_demande,utilisateur_demande,id_type_demande,demande_id_visite,nom_demande,demande_id_thematique_principal,demande_id_thematique_secondaire,demande_id_geste,demande_id_intervention,demande_id_intervention_non,demande_id_travaux,id_bien,adresse_fr_bien,adresse_bt,etage_logement_bien,id_nombre_bien,annee,nombre_facade,id_certificat_peb,surface_chauffee,nombre_habitant,id_chauffage_bien,id_type_chauffage,id_type_eau,id_type_four,id_type_cuisiniere,consommation_electricite,consommation_gaz', '@@array[ou_et]=0@@array[entity]=rdv@@array[champ]=type_rdv@@array[operateur]=egal@@array[choice_is_array]=1@@array[par_ouvert]=0@@array[par_ferme]=0', 'ou_et_%23%231=0&entity_%23%231=rdv&champ_%23%231=type_rdv&operateur_%23%231=egal&%23%231%23%23_value%5B%5D=1&par_ouvert_%23%231=0&par_ferme_%23%231=0&number=1&fields_select%5B%5D=nom_personne&id_rdv&fields_select[]