(608, 'SELECT trim(demande.id_demande) as demande_id_visite, trim(demande.nom) as nom_demande, trim(demande.descriptif) as descriptif_demande, ( SELECT GROUP_CONCAT( liste_thematique.label SEPARATOR \', \' )  FROM liste_thematique WHERE  FIND_IN_SET (liste_thematique.id, demande_caracteristique.id_thematique_secondaire)) as demande_id_thematique_secondaire, ( SELECT GROUP_CONCAT( liste_th_accompagnement.label SEPARATOR \', \' )  FROM liste_th_accompagnement WHERE  FIND_IN_SET (liste_th_accompagnement.id, demande_caracteristique.id_th_accompagnement)) as demande_id_accompagnement, ( SELECT GROUP_CONCAT( liste_langue.label SEPARATOR \', \' )  FROM liste_langue WHERE  FIND_IN_SET (liste_langue.id, encodage.lang_contact)) as encodage_langue, trim(contact.nom_contact) as nom_personne, ( SELECT GROUP_CONCAT( liste_demande_type.label SEPARATOR \', \' )  FROM liste_demande_type WHERE  FIND_IN_SET (liste_demande_type.id, demande.id_type_demande)) as id_type_demande, ( SELECT GROUP_CONCAT( liste_demande_statut.label SEPARATOR \', \' )  FROM liste_demande_statut WHERE  FIND_IN_SET (liste_demande_statut.id, demande.id_demande_statut)) as id_demande_statut, ( SELECT GROUP_CONCAT( liste_pole.label SEPARATOR \', \' )  FROM liste_pole WHERE  FIND_IN_SET (liste_pole.id, demande.id_pole)) as demande_pole, (SELECT dem.date_modification FROM demande_h as dem WHERE dem.index=\'demande_pole\' AND dem.id_entity=demande.id_demande ORDER BY dem.date_modification ASC LIMIT 1) as date_attribution, ( SELECT GROUP_CONCAT( user_accounts.nom SEPARATOR \', \' )  FROM user_accounts WHERE  FIND_IN_SET (user_accounts.id, demande.id_utilisateur)) as utilisateur_demande, CASE\r\n            WHEN (SELECT dem.date_modification FROM demande_h as dem WHERE dem.value_old = \'Homegrade\' AND dem.index=\'utilisateur_demande\' AND dem.id_entity=demande.id_demande ORDER BY dem.date_modification ASC LIMIT 1) \r\n                IS NOT NULL\r\n            THEN (SELECT dem.date_modification FROM demande_h as dem W